INSERT INTO `mac_vod` VALUES('16962','风云岁月','共22集全','fengyunsuiyue','F','','http://photocdn.sohu.com/kis/fengmian/43/43188/43188_ver_big_20160527153003.jpg','http://photocdn.sohu.com/kis/fengmian/43/43188/43188_ver_big_20160527153003.jpg','','陶大宇/张延/关礼杰/周蕾/朱曼芳','蒋家骏','掌门人,上海,朋友,个性,风云','共22集全','大陆','国语','2000','12','',',453,','0','0','0','0','0','0','0','0','995850','0','0','0','0','0','0','2.0','0','297','1481692121','1481692121','0','0','沈氏家族掌门人沈正山为人沉着果断，心狠手辣，一切以利益为大前担提，即使是亲人朋友也不留情面，由其继室李燕所生的儿子沈家伟不但继承了正山在商场上的狠辣个性，加上被正山宠爱有加，性格更是好强骄纵，自视甚高，目中无人。区信安与妻子何秀莲原本是沈正山的司机和女佣，因其子区仲文的前途，而举家迁往上海。一次偶然机会，仲文与家伟相遇，两人因商场之争而发生冲突。家伟其姐沈家敏为排挤家伟不惜动用被炒员工用炸弹向家伟勒索。沈正山决定把家敏剔出遗嘱。心怀仇恨的家敏无意中发现家伟的身世，此时压抑多年的李燕又意图承认一切，慌乱中的家伟竟错手把李燕杀死，并诬告信安，导致信安被捕并被判误杀。','sohu','','','风云岁月第1集$http://tv.sohu.com/20160613/n454166247.shtml#风云岁月第2集$http://tv.sohu.com/20160613/n454166266.shtml#风云岁月第3集$http://tv.sohu.com/20160613/n454166282.shtml#风云岁月第4集$http://tv.sohu.com/20160613/n454166305.shtml#风云岁月第5集$http://tv.sohu.com/20160613/n454166327.shtml#风云岁月第6集$http://tv.sohu.com/20160613/n454166346.shtml#风云岁月第7集$http://tv.sohu.com/20160613/n454166369.shtml#风云岁月第8集$http://tv.sohu.com/20160613/n454166394.shtml#风云岁月第9集$http://tv.sohu.com/20160613/n454166413.shtml#风云岁月第10集$http://tv.sohu.com/20160613/n454166429.shtml#风云岁月第11集$http://tv.sohu.com/20160613/n454166447.shtml#风云岁月第12集$http://tv.sohu.com/20160613/n454166467.shtml#风云岁月第13集$http://tv.sohu.com/20160613/n454166486.shtml#风云岁月第14集$http://tv.sohu.com/20160613/n454166507.shtml#风云岁月第15集$http://tv.sohu.com/20160613/n454166526.shtml#风云岁月第16集$http://tv.sohu.com/20160613/n454166557.shtml#风云岁月第17集$http://tv.sohu.com/20160613/n454166581.shtml#风云岁月第18集$http://tv.sohu.com/20160613/n454166598.shtml#风云岁月第19集$http://tv.sohu.com/20160613/n454166614.shtml#风云岁月第20集$http://tv.sohu.com/20160613/n454166633.shtml#风云岁月第21集$http://tv.sohu.com/20160613/n454166649.shtml#风云岁月第22集$http://tv.sohu.com/20160613/n454166670.shtml','','','','');
INSERT INTO `mac_vod` VALUES('16963','落泪成金','共22集全','luoleichengjin','L','','http://photocdn.sohu.com/kis/fengmian/60/60352/60352_ver_big_20160525165003.jpg','http://photocdn.sohu.com/kis/fengmian/60/60352/60352_ver_big_20160525165003.jpg','','张国强/印小天/刘园园/郑晓宁/戴娇倩','刘涛','总经理,矽肺病,哥哥,经营,律师','共22集全','大陆','国语','2008','12','',',369,','0','0','0','0','0','0','0','0','203051','0','0','0','0','0','0','1.0','0','344','1481692122','1481692122','0','0','二十世纪八十年代的黑镇。哥哥刘强为了同母异父的弟弟刘志继续学业到天光集团当了一名采石工。一转眼三年过去了，就在刘志踌躇满志向往未来的时候，哥哥却在一次事故中失去了左腿，并查出患上了严重的矽肺病，这使本来就困顿的家又陷入更大的困境。刘志和女友成成暗访到天光集团违规经营、偷税、漏税的一些真相，几经周折，终于使天光集团的总经理黎天光答应为刘强出钱治病，可刘强想到的并非完全是为自己，他要刘志帮助同样患矽肺病的其他工友们讨回公道。为争取工友们的合法权益，刘志在协助律师调查取证的过程中，陷入了黎天光布下的陷阱。刘强得知这一切后病情突然恶化，临终前仍鼓励刘志为了正义和良知一定要坚持下去。黎天光发生车祸，生命垂危，让刘志意想不到的是黎天光竟是他的生父。他挣扎、他彷徨，最后还是他用鲜血挽回了黎天。','sohu','','','落泪成金第1集$http://tv.sohu.com/20160613/n454166126.shtml#落泪成金第2集$http://tv.sohu.com/20160613/n454166160.shtml#落泪成金第3集$http://tv.sohu.com/20160613/n454166178.shtml#落泪成金第4集$http://tv.sohu.com/20160613/n454166192.shtml#落泪成金第5集$http://tv.sohu.com/20160613/n454166207.shtml#落泪成金第6集$http://tv.sohu.com/20160613/n454166220.shtml#落泪成金第7集$http://tv.sohu.com/20160613/n454166231.shtml#落泪成金第8集$http://tv.sohu.com/20160613/n454166248.shtml#落泪成金第9集$http://tv.sohu.com/20160613/n454166269.shtml#落泪成金第10集$http://tv.sohu.com/20160613/n454166285.shtml#落泪成金第11集$http://tv.sohu.com/20160613/n454166308.shtml#落泪成金第12集$http://tv.sohu.com/20160613/n454166330.shtml#落泪成金第13集$http://tv.sohu.com/20160613/n454166352.shtml#落泪成金第14集$http://tv.sohu.com/20160613/n454166371.shtml#落泪成金第15集$http://tv.sohu.com/20160613/n454166397.shtml#落泪成金第16集$http://tv.sohu.com/20160613/n454166415.shtml#落泪成金第17集$http://tv.sohu.com/20160613/n454166433.shtml#落泪成金第18集$http://tv.sohu.com/20160613/n454166453.shtml#落泪成金第19集$http://tv.sohu.com/20160613/n454166473.shtml#落泪成金第20集$http://tv.sohu.com/20160613/n454166494.shtml#落泪成金第21集$http://tv.sohu.com/20160613/n454166512.shtml#落泪成金第22集$http://tv.sohu.com/20160613/n454166538.shtml','','','','');
INSERT INTO `mac_vod` VALUES('16964','笑春','共18集全','xiaochun','X','','http://photocdn.sohu.com/kis/fengmian/1103/1103296/1103296_ver_big_20160526160503.jpg','http://photocdn.sohu.com/kis/fengmian/1103/1103296/1103296_ver_big_20160526160503.jpg','','吴瑕/梁爽/其其格/田玉魁','姚中文','社会主义,经营','共18集全','大陆','国语','2009','12','',',398,','0','0','0','0','0','0','0','0','723329','0','0','0','0','0','0','4.0','0','148','1481692123','1481692123','0','0','东北某市郊渔村，经营饭店的王笑春本不想参与村长竞选，但是由于村民支持王笑春放弃经营多年的饭店，回来当上了村长。他的养母二婶知道金品三等人的家族势力，怕干不好得罪他们，引来不必要的麻烦，当村长的王笑春顶住了二婶的百般反对与金品三等人家族势力展开了一场集体与个人利益之争，他顶住各种压力，克服了重重困难，得到了全村人民的拥护和信任带领渔村一步一步向社会主义新农村迈进。','sohu','','','笑春第1集$http://tv.sohu.com/20160613/n454163867.shtml#笑春第2集$http://tv.sohu.com/20160613/n454163896.shtml#笑春第3集$http://tv.sohu.com/20160613/n454163938.shtml#笑春第4集$http://tv.sohu.com/20160613/n454163966.shtml#笑春第5集$http://tv.sohu.com/20160613/n454163987.shtml#笑春第6集$http://tv.sohu.com/20160613/n454163999.shtml#笑春第7集$http://tv.sohu.com/20160613/n454164015.shtml#笑春第8集$http://tv.sohu.com/20160613/n454164026.shtml#笑春第9集$http://tv.sohu.com/20160613/n454164040.shtml#笑春第10集$http://tv.sohu.com/20160613/n454164061.shtml#笑春第11集$http://tv.sohu.com/20160613/n454164084.shtml#笑春第12集$http://tv.sohu.com/20160613/n454164119.shtml#笑春第13集$http://tv.sohu.com/20160613/n454164141.shtml#笑春第14集$http://tv.sohu.com/20160613/n454164175.shtml#笑春第15集$http://tv.sohu.com/20160613/n454164196.shtml#笑春第16集$http://tv.sohu.com/20160613/n454164223.shtml#笑春第17集$http://tv.sohu.com/20160613/n454164248.shtml#笑春第18集$http://tv.sohu.com/20160613/n454164269.shtml','','','','');
INSERT INTO `mac_vod` VALUES('16965','沃野飘香','共26集全','woyepiaoxiang','W','','http://photocdn.sohu.com/kis/fengmian/1198/1198379/1198379_ver_big_20160526161503.jpg','http://photocdn.sohu.com/kis/fengmian/1198/1198379/1198379_ver_big_20160526161503.jpg','','曲德明/张尚萍/赵雅杰','姚中文','共产党员,农民致富,高利贷,包工头,产业链','共26集全','大陆','国语','2010','12','',',398,','0','0','0','0','0','0','0','0','224084','0','0','0','0','0','0','7.0','0','292','1481692123','1481692123','0','0','本剧主人公王儒学是农业技术推广站土专家，普通共产党员。邻居四丫因欠下村中流氓无赖刘万发的高利贷，没钱给女儿看病，被洪艳秋、刘万发、海英跳大神误了诊命丧黄泉。这事件，使王儒学内心深受震撼，他辞去职务，回村带领农民致富。他带着强烈的致富理念开始大棚育苗，发展生态产业链。城里的包工头刘万青、刘万发得知这道产业链前景经济价值不可估量，像条响尾蛇爬来，不择手段和王儒学展开恶性竞争，哥俩一唱一合，夹击着王儒学，王儒学顶着沉重压力和刘万青、刘万发展开一次又一次较量，最终战胜了坑农害农的刘万青、刘万发。朝阳村的百姓最终走上了致富的道路。','sohu','','','沃野飘香第1集$http://tv.sohu.com/20160613/n454165939.shtml#沃野飘香第2集$http://tv.sohu.com/20160613/n454165970.shtml#沃野飘香第3集$http://tv.sohu.com/20160613/n454166003.shtml#沃野飘香第4集$http://tv.sohu.com/20160613/n454166030.shtml#沃野飘香第5集$http://tv.sohu.com/20160613/n454166055.shtml#沃野飘香第6集$http://tv.sohu.com/20160613/n454166074.shtml#沃野飘香第7集$http://tv.sohu.com/20160613/n454166094.shtml#沃野飘香第8集$http://tv.sohu.com/20160613/n454166108.shtml#沃野飘香第9集$http://tv.sohu.com/20160613/n454166124.shtml#沃野飘香第10集$http://tv.sohu.com/20160613/n454166157.shtml#沃野飘香第11集$http://tv.sohu.com/20160613/n454166177.shtml#沃野飘香第12集$http://tv.sohu.com/20160613/n454166188.shtml#沃野飘香第13集$http://tv.sohu.com/20160613/n454166203.shtml#沃野飘香第14集$http://tv.sohu.com/20160613/n454166216.shtml#沃野飘香第15集$http://tv.sohu.com/20160613/n454166228.shtml#沃野飘香第16集$http://tv.sohu.com/20160613/n454166242.shtml#沃野飘香第17集$http://tv.sohu.com/20160613/n454166268.shtml#沃野飘香第18集$http://tv.sohu.com/20160613/n454166286.shtml#沃野飘香第19集$http://tv.sohu.com/20160613/n454166312.shtml#沃野飘香第20集$http://tv.sohu.com/20160613/n454166335.shtml#沃野飘香第21集$http://tv.sohu.com/20160613/n454166359.shtml#沃野飘香第22集$http://tv.sohu.com/20160613/n454166388.shtml#沃野飘香第23集$http://tv.sohu.com/20160613/n454166409.shtml#沃野飘香第24集$http://tv.sohu.com/20160