INSERT INTO `mac_vod` VALUES('16966','杀出绝地','共30集全','shachujuedi','S','','http://photocdn.sohu.com/kis/fengmian/69/69713/69713_ver_big_20160526155502.jpg','http://photocdn.sohu.com/kis/fengmian/69/69713/69713_ver_big_20160526155502.jpg','','王亚楠/郭金/杜雨露/盖丽丽/张岩','孙文学/车径行','遵义会议,国民党,赤水河,喘息声,少奶奶','共30集全','大陆','国语','2009','12','',',376,','0','0','0','0','0','0','0','0','358836','0','0','0','0','0','0','4.0','0','164','1481692123','1481692123','0','0','该剧以上世纪三十年代红军革命战争为背景，叙述了在“遵义会议”召开前夕，红军的特遣支队来到神秘的赤水河地区开展敌后工作的故事。遵义会议前后，红军的一支特谴队来到赤水河地区，这里有的伤员是红军重要的骨干和建设性力量。但是国民党嗅出动静，派出爪牙尾随而来。赤水河，风雨交加，街上除了狗吠空无一人。大山深处，一支神秘的队伍在山中迅速行进，一个战士挂在腰间的帽檐上，一颗红五角星闪着光芒。古家大院，二姨太被雷声惊醒，她推开窗户，突然，一支飞镖钉在了古家大宅的雕花门梁上。古家大院的阴冷仍然在继续，一个女人的喘息声传来，一只眼睛透过窗户盯着里面发生的一切。突然一声凄厉的喊叫：大少奶奶自尽了。','sohu','','','杀出绝地第1集$http://tv.sohu.com/20160613/n454158167.shtml#杀出绝地第2集$http://tv.sohu.com/20160613/n454158190.shtml#杀出绝地第3集$http://tv.sohu.com/20160613/n454158213.shtml#杀出绝地第4集$http://tv.sohu.com/20160613/n454158228.shtml#杀出绝地第5集$http://tv.sohu.com/20160613/n454158251.shtml#杀出绝地第6集$http://tv.sohu.com/20160613/n454158265.shtml#杀出绝地第7集$http://tv.sohu.com/20160613/n454158293.shtml#杀出绝地第8集$http://tv.sohu.com/20160613/n454158320.shtml#杀出绝地第9集$http://tv.sohu.com/20160613/n454158333.shtml#杀出绝地第10集$http://tv.sohu.com/20160613/n454158348.shtml#杀出绝地第11集$http://tv.sohu.com/20160613/n454158369.shtml#杀出绝地第12集$http://tv.sohu.com/20160613/n454158383.shtml#杀出绝地第13集$http://tv.sohu.com/20160613/n454158406.shtml#杀出绝地第14集$http://tv.sohu.com/20160613/n454158447.shtml#杀出绝地第15集$http://tv.sohu.com/20160613/n454158476.shtml#杀出绝地第16集$http://tv.sohu.com/20160613/n454158499.shtml#杀出绝地第17集$http://tv.sohu.com/20160613/n454158523.shtml#杀出绝地第18集$http://tv.sohu.com/20160613/n454158555.shtml#杀出绝地第19集$http://tv.sohu.com/20160613/n454158579.shtml#杀出绝地第20集$http://tv.sohu.com/20160613/n454158610.shtml#杀出绝地第21集$http://tv.sohu.com/20160613/n454158641.shtml#杀出绝地第22集$http://tv.sohu.com/20160613/n454158674.shtml#杀出绝地第23集$http://tv.sohu.com/20160613/n454158690.shtml#杀出绝地第24集$ht