INSERT INTO `mac_vod` VALUES('16967','广州教父','','guangzhoujiaofu','G','','http://photocdn.sohu.com/kis/fengmian/1079/1079443/1079443_ver_big_20160526163002.jpg','http://photocdn.sohu.com/kis/fengmian/1079/1079443/1079443_ver_big_20160526163002.jpg','','江珊/汤镇宗/杨玉梅/高雄/施丹江','林义雄/蒲腾晋','有限公司,陈炯明,广州,上海,教父','27集全','大陆','国语','1996','12','',',363,','0','0','0','0','0','0','0','0','141756','0','0','0','0','0','0','2.0','0','387','1481692123','1482092572','0','0','“北杜南金”三十年代黑白两道如雷贯耳，与上海杜月笙齐名的广州一代大亨——金城。20年代的广州，政局动荡，豪强纷起，各欲称霸。广龙堂龙头大哥林凤平死于非命，一时群龙无首，而鼎立的三山会、洪胜堂和其他帮派正虎视眈眈，一场江湖腥风血雨随时爆发。外来青年金城忍辱负重，继任堂主，施妙计挫败黑道对手，令陈炯明族弟陈达生命死尼庵，做善事博得名利双收，扩张广龙航运有限公司名震省港，贩军火，除青帮，下杀手。在一件件命案中迅速掘起，成为与上海杜月笙齐名的一代闻人。','sohu$$$youku','$$$','$$$','广州教父第1集$http://tv.sohu.com/20160613/n454163572.shtml#广州教父第2集$http://tv.sohu.com/20160613/n454163586.shtml#广州教父第3集$http://tv.sohu.com/20160613/n454163628.shtml#广州教父第4集$http://tv.sohu.com/20160613/n454163657.shtml#广州教父第5集$http://tv.sohu.com/20160613/n454163677.shtml#广州教父第6集$http://tv.sohu.com/20160613/n454163702.shtml#广州教父第7集$http://tv.sohu.com/20160613/n454163719.shtml#广州教父第8集$http://tv.sohu.com/20160613/n454163758.shtml#广州教父第9集$http://tv.sohu.com/20160613/n454163785.shtml#广州教父第10集$http://tv.sohu.com/20160613/n454163800.shtml#广州教父第11集$http://tv.sohu.com/20160613/n454163826.shtml#广州教父第12集$http://tv.sohu.com/20160613/n454163846.shtml#广州教父第13集$http://tv.sohu.com/20160613/n454163870.shtml#广州教父第14集$http://tv.sohu.com/20160613/n454163906.shtml#广州教父第15集$http://tv.sohu.com/20160613/n454163944.shtml#广州教父第16集$http://tv.sohu.com/20160613/n454163971.shtml#广州教父第17集$http://tv.sohu.com/20160613/n454163988.shtml#广州教父第18集$http://tv.sohu.com/20160613/n454164004.shtml#广州教父第19集$http://tv.sohu.com/20160613/n454164013.shtml#广州教父第20集$http://tv.sohu.com/20160613/n454164024.shtml#广州教父第21集$http://tv.sohu.com/20160613/n454164032.shtml#广州教父第22集$http://tv.sohu.com/20160613/n454164051.shtml#广州教父第23集$http://tv.sohu.com/20160613/n454164076.shtml#广州教父第24集$http://tv.sohu.com/20160613/n454164102.shtml#广州