INSERT INTO `mac_vod` VALUES('16140','这个杀手不太冷','','zhegeshashoubutailing','Z','','http://i0.letvimg.com/lc03_isvrs/201608/15/17/13/ed517c72-92b6-4abd-879e-214c0ae11fbf.jpg','[db:缩略图]','[db:幻灯图]','让·雷诺/加里·奥德曼/娜塔莉·波特曼/','吕克·贝松/','[db:tag]','乐视高清','法国','','0','10','',',345,','0','0','0','0','0','0','0','0','66278','0','0','0','0','0','0','9.0','0','292','1481656191','1482348941','0','0','里昂（让·雷诺饰）是名孤独的职业杀手，受人雇佣。一天，邻居家小姑娘马蒂尔达（纳塔丽·波特曼饰)敲开他的房门，要求在他那里暂避杀身之祸。原来邻居家的主人是警方缉毒组的眼线，只因贪污了一小包毒品而遭恶警（加里·奥德曼饰）杀害全家的惩罚。马蒂尔达得到里昂的留救，幸免于难，并留在里昂那里。里昂教小女孩使枪，她教里昂法文，两人关系日趋亲密，相处融洽。 　　女孩想着去报仇，反倒被抓，里昂及时赶到，将女孩救回。混杂着哀怨情仇的正邪之战渐次升级，更大的冲突在所难免……','letv$$$qq','$$$','$$$','高清完整版$http://www.le.com/ptv/vplay/26312597.html$$$腾讯高清$http://v.qq.com/x/cover/fvue88y1fsnk4w2/e0021vrik1q.html','','','','');
INSERT INTO `mac_vod` VALUES('18160','十一级台阶','','shiyijitaijie','S','','http://i1.letvimg.com/vrs/201301/24/cfb1b4fd1a464d168e744e7a0fb81d99.jpg','','','沙溢,文清,金巧巧,黑子,张光北,于越 ,张笑君,李博,白荟,石兰,王珂,','陈健,','十一级台阶,集团军,佼佼者,努力学习,技能','正片','大陆','国语','0','12','','','0','0','0','0','0','0','0','0','526123','0','0','0','0','0','0','6.0','0','254','1481717727','1482174349','0','0','60年代中期，岳军与李银虎、王元亮等几位同乡应征入伍。岳军热爱军营，努力学习，苦练军事技能，成为同批兵中的佼佼者。岳军的接兵干部杨兴荣在与他多年的军旅 生涯中，因观念上的差异和工作上的分歧，常有冲突，两人相互较劲，并在矛盾中成长进步，在竞争中加深友谊。 　　  岳军以过人的胆识、执着的追求，非凡的智慧，不 断化解与战友之间的矛盾、工作中的困难和人生中的挫折，带领和激励官兵为我军的建设发展做出了积极贡献，终于从排长到集团军军长，历经十一级台阶，成为我 军的一名将军，也成为战友心目中的骄傲。','letv','','','http://www.letv.com/ptv/vplay/1236847.html#http://www.letv.com/ptv/vplay/1236860.html#http://www.letv.com/ptv/vplay/1236875.html#http://www.letv.com/ptv/vplay/1237860.html#http://www.letv.com/ptv/vplay/1237875.html#http://www.letv.com/ptv/vplay/1237882.html#http://www.letv.com/ptv/vplay/1239533.html#http://www.letv.com/ptv/vplay/1239539.html#http://www.letv.com/ptv/vplay/24251691.html#http://www.letv.com/ptv/vplay/1239547.html#http://www.letv.com/ptv/vplay/1240502.html#http://www.letv.com/ptv/vplay/1240508.html#http://www.letv.com/ptv/vplay/1240515.html#http://www.letv.com/ptv/vplay/1241653.html#http://www.letv.com/ptv/vplay/1241659.html#http://www.letv.com/ptv/vplay/1241664.html#http://www.letv.com/ptv/vplay/1242582.html#http://www.letv.com/ptv/vplay/1242583.html#http://www.letv.com/ptv/vplay/1242584.html#http://www.letv.com/ptv/vplay/1243017.html#http://www.letv.com/ptv/vplay/1243024.html#http://www.letv.com/ptv/vplay/1243031.html#http://www.letv.com/ptv/vplay/1244214.html#http://www.letv.com/ptv/vplay/1244238.html#http://www.letv.com/ptv/vplay/1244246.html#http://www.letv.com/ptv/vplay/1245232.html#http://www.letv.com/ptv/vplay/1245241.html','','','','');
INSERT INTO `mac_vod` VALUES('15982','半妖倾城','','banyaoqingcheng','B','','http://i3.letvimg.com/lc07_isvrs/201606/30/16/11/f2a97774-7f1b-4032-94c1-0067d2ce3e11.jpg','','','张哲瀚,李一桐,米热,阚清子,何瑞贤,洪尧,王茂蕾,刘敏,戴向宇,安以轩,陈紫函,汪东城,黄景瑜,张馨予,徐海乔,','刘镇明,任海曜,雷瑞麟,','小说,剧本','正片','大陆','国语','0','12','','','0','0','0','0','0','0','0','0','560951','0','0','0','0','0','0','9.0','0','448','1481639502','1482260768','0','0','《半妖倾城》以身为半妖却向往安定生活的聂倾城、对倾城充满恨意的江雪舞、深爱倾城的明夏三人之间的爱恨纠葛为主线，结合民国时期的时代大背景开展剧情。该剧汇集了一批极具颜值与人气的当红偶像，题材新颖、剧情独特。《半妖倾城》还一改往日小说漫画改编剧本的老套路，反其道而行之，创造了剧本改小说与漫画的新模式。','letv','','','http://www.letv.com/ptv/vplay/25892509.html#http://www.letv.com/ptv/vplay/25893025.html#http://www.letv.com/ptv/vplay/25892712.html#http://www.letv.com/ptv/vplay/25892590.html#http://www.letv.com/ptv/vplay/25951883.html#http://www.letv.com/ptv/vplay/25960983.html#http://www.letv.com/ptv/vplay/26009921.html#http://www.letv.com/ptv/vplay/26023456.html#http://www.letv.com/ptv/vplay/26080882.html#http://www.letv.com/ptv/vplay/26090673.html#http://www.letv.com/ptv/vplay/26137428.html#http://www.letv.com/ptv/vplay/26146637.html#http://www.letv.com/ptv/vplay/26194494.html#http://www.letv.com/ptv/vplay/26203981.html#http://www.letv.com/ptv/vplay/26252449.html#http://www.letv.com/ptv/vplay/26262664.html#http://www.letv.com/ptv/vplay/26311050.html#http://www.letv.com/ptv/vplay/26320307.html#http://www.letv.com/ptv/vplay/26372384.html#http://www.letv.com/ptv/vplay/26379573.html','','','','');
INSERT INTO `mac_vod` VALUES('15983','地道战','','didaozhan','D','','http://i2.letvimg.com/vrs/201301/24/db73e58a10284698b5d4a3aec31bafb7.jpg','','','王千源,许还幻,李琦,王奎荣,侯天来,刘金龙,姜华,杨雨婷,','杨毅,','地道战,八路军,日伪军,平原','乐视高清','大陆','国语','0','12','','','0','0','0','0','0','0','0','0','754989','0','0','0','0','0','0','10.0','0','147','1481639503','1482348402','0','0','1942年秋，日军驻华北派遣军对冀中平原展开疯狂的大扫荡。臭名昭著的山田率领着铁杆汉奸汤丙会一路烧杀抢掠杀奔向著名的抗日堡垒村高家庄。 　　此时的高家庄不但有十余名八路军伤员，并且隐藏着刚刚筹集好的军粮。面对日伪军的猝然袭击，高家庄霎时被笼罩在危机之中…… 　　敌人渐渐将村庄包围，百姓们筹集的军粮怎么办？','letv$$$sohu$$$qq','$$$$$$','$$$$$$','高清完整版$http://www.le.com/ptv/vplay/23107140.html$$$第1集$http://tv.sohu.com/20161118/n473542451.shtml#第2集$http://tv.sohu.com/20161118/n473542464.shtml#第3集$http://tv.sohu.com/20161118/n473542469.shtml#第4集$http://tv.sohu.com/20161118/n473542477.shtml#第5集$http://tv.sohu.com/20161118/n473542481.shtml#第6集$http://tv.sohu.com/20161118/n473542490.shtml#第7集$http://tv.sohu.com/20161118/n473542511.shtml#第8集$http://tv.sohu.com/20161118/n473542518.shtml#第9集$http://tv.sohu.com/20161118/n473542530.shtml#第10集$http://tv.sohu.com/20161118/n473542536.shtml#第11集$http://tv.sohu.com/20161118/n473542544.shtml#第12集$http://tv.sohu.com/20161118/n473542550.shtml#第13集$http://tv.sohu.com/20161118/n473542562.shtml#第14集$http://tv.sohu.com/20161118/n473542571.shtml#第15集$http://tv.sohu.com/20161118/n473542581.shtml#第16集$http://tv.sohu.com/20161118/n473542588.shtml#第17集$http://tv.sohu.com/20161118/n473542601.shtml#第18集$http://tv.sohu.com/20161118/n473542617.shtml#第19集$http://tv.sohu.com/20161118/n473542626.shtml#第20集$http://tv.sohu.com/20161118/n473542630.shtml#第21集$http://tv.sohu.com/20161118/n473542632.shtml#第22集$http://tv.sohu.com/20161118/n473542635.shtml#第23集$http://tv.sohu.com/20161118/n473542637.shtml#第24集$http://tv.sohu.com/20161118/n473542639.shtml#第25集$http://tv.sohu.com/20161118/n473542641.shtml#第26集$http://tv.sohu.com/20161118/n473542643.shtml#第27集$http://tv.sohu.com/20161118/n473542648.shtml#第28集$http://tv.sohu.com/20161118/n473542655.shtml#第29集$http://tv.