INSERT INTO `mac_vod` VALUES('16143','辛亥革命','','xinhaigeming','X','','http://i1.letvimg.com/vrs/201301/23/2d018ba1647b4a0cb2a9183b79868742.jpg','[db:缩略图]','[db:幻灯图]','赵文瑄/成龙/李冰冰/胡歌/孙淳/','张黎/','[db:tag]','乐视高清','中国大陆','','0','11','',',345,','0','0','0','0','0','0','0','0','671981','0','0','0','0','0','0','7.0','0','268','1481656420','1482349431','0','0','19世纪末20世纪初，清王朝三百年江山气数将近，内忧外患，时局动荡，正是乱世之际，英雄辈出，中华民族面临着重大的历史变革。以孙中山（赵文瑄 饰）为首的仁人志士意识到只有民主共和才能救中国，他们组成一个个革命政党，旨在推翻满清政府，建立人民当家作主的民主国家。在这一过程中，无数革命者流血牺牲，但是更多的革命家站出来与落后的封建体制作斗争，终于在武昌打响了辛亥革命的第一枪。在此期间，黄兴（成龙 饰）、黎元洪（姜武 饰）、隆裕太后（陈冲 饰）、袁世凯（孙淳 饰）、汪精卫（余少群 饰）、宋教仁（邢桂栋 饰）、秋瑾（宁静 饰）等各方人物你方唱罢我登场，谱写了中国近代史上最为辉煌的篇章……','letv','','','高清完整版$http://www.le.com/ptv/vplay/1399490.html','','','','');
INSERT INTO `mac_vod` VALUES('16144','平原游击队','','pingyuanyoujidui','P','','http://i3.letvimg.com/lc03_isvrs/201508/05/10/04/5c1569e2-f64b-4da4-a883-f69c5e13d04f.jpg','[db:缩略图]','[db:幻灯图]','郭振清/张莹/','苏里/武兆堤/','[db:tag]','乐视高清','中国大陆','','0','11','',',345,','0','0','0','0','0','0','0','0','353027','0','0','0','0','0','0','8.0','0','69','1481656421','1482348403','0','0','抗日战争时期的1943年秋，游击队长李向阳（郭振清）接到牵制日军驻守某县城的松井部队的任务，以达到粉碎日军“扫荡”华北某根据地的阴谋，并保住藏于李庄的粮食。行动时，李向阳与参谋长兵分两路并头进行。 　　李向阳转移粮食时，被地主杨老宗窥见，后者赶去县城向松井（方化）告密，松井闻之大喜，率大部队赶到李庄，但粮食和乡亲已被李向阳安排转移到地道，然而地道终被松井发现。为引诱松井离开李庄，李向阳率队员进县城，炸毁日军弹药列车，并计划在松井撤退时打他个措手不及，但李向阳低估了松井的狡猾，松井半路杀了个“回马枪”折回李庄，残杀了一些不肯说出粮食藏在哪里的乡亲。可是李向阳的神出鬼没松井终没招架住。','letv','','','高清完整版$http://www.le.com/ptv/vplay/23085677.html','','','','');
INSERT INTO `mac_vod` VALUES('15984','神枪手','','shenqiangshou','S','','http://i3.letvimg.com/vrs/201301/24/f27021fb25be4086a4c8cf2bacae4d9d.jpg','','','刘烨,吕行,丁志诚,施京明,于越 ,','滕文骥,','暗杀计划,神枪手,警卫员,共产党,日本','正片','大陆','国语','0','12','','','0','0','0','0','0','0','0','0','333663','0','0','0','0','0','0','8.0','0','81','1481639511','1482260780','0','0','该剧的故事从戴笠座机意外失事说起，一份绝密计划曝光天下：军统雇佣日本刺客，谋杀支持共产党的四川富豪徐德庸，消息暴露后举国哗然。军统调派林家山追杀日本刺客宫十一，中共方面也派出了枪法极准的警卫员彭克虎来到重庆。徐德庸周围连续发生刺杀事件，彭克虎与林家山联手破坏了宫十一的毁灭性计划，但却仍没有阻止宫十一刺杀的脚步，最终的暗杀计划也慢慢浮出水面……','letv$$$sohu$$$qq','$$$$$$','$$$$$$','http://www.letv.com/ptv/vplay/610617.html#http://www.letv.com/ptv/vplay/610618.html#http://www.letv.com/ptv/vplay/610615.html#http://www.letv.com/ptv/vplay/610616.html#http://www.letv.com/ptv/vplay/610619.html#http://www.letv.com/ptv/vplay/610627.html#http://www.letv.com/ptv/vplay/610620.html#http://www.letv.com/ptv/vplay/610628.html#http://www.letv.com/ptv/vplay/610621.html#http://www.letv.com/ptv/vplay/610629.html#http://www.letv.com/ptv/vplay/610622.html#http://www.letv.com/ptv/vplay/610630.html#http://www.letv.com/ptv/vplay/610623.html#http://www.letv.com/ptv/vplay/610624.html#http://www.letv.com/ptv/vplay/610625.html#http://www.letv.com/ptv/vplay/610522.html#http://www.letv.com/ptv/vplay/610626.html#http://www.letv.com/ptv/vplay/610518.html#http://www.letv.com/ptv/vplay/610519.html#http://www.letv.com/ptv/vplay/610521.html#http://www.letv.com/ptv/vplay/610523.html#http://www.letv.com/ptv/vplay/610530.html#http://www.letv.com/ptv/vplay/610532.html#http://www.letv.com/ptv/vplay/610536.html#http://www.letv.com/ptv/vplay/610529.html#http://www.letv.com/ptv/vplay/610534.html#http://www.letv.com/ptv/vplay/610524.html#http://www.letv.com/ptv/vplay/610531.html$$$神枪手第1集$http://tv.sohu.com/20160427/n446434412.shtml#神枪手第2集$http://tv.sohu.com/20160427/n446434428.shtml#神枪手第3集$http://tv.sohu.com/20160427/n446434449.shtml#神枪手第4集$http://tv.sohu.com/20160427/n446434470.shtml#神枪手第5集$http://tv.sohu.com/20160427/n446434495.shtml#神枪手第6