INSERT INTO `mac_vod` VALUES('16147','大空头','','dakongtou','D','','http://i2.letvimg.com/lc07_isvrs/201603/02/11/23/b0a4a43e-6a92-418e-8149-ab41f415239e.jpg','[db:缩略图]','[db:幻灯图]','克里斯蒂安·贝尔/史蒂夫·卡瑞尔/瑞恩·高斯林/布拉德·皮特/梅丽莎·里奥/拉菲·斯波/芬·维特洛克/','亚当·麦凯/','[db:tag]','正片','美国','','0','10','',',345,','0','0','0','0','0','0','0','0','432203','0','0','0','0','0','0','9.0','0','19','1481656826','1482352432','0','0','这部影片将镜头对准了2008年全球金融，讲述华尔街几位眼光独到的投资鬼才在2007年美国信贷风暴前看穿泡沫假象，通过做空次贷CDS而大幅获益，成为少数在金融灾难中大量获利的投资枭雄的故事。据悉，瑞恩·高斯林将扮演一个能把40亿美元单子做成37亿美元收入的德银代理人格雷格-李普曼(Gregg Lippmann) ；克里斯蒂安·贝尔扮演独眼基金管理人迈克尔·巴里(Michael J. Burry) ；史蒂夫-卡瑞尔扮演华尔街世家出身的史蒂夫·艾斯曼（Steve Eisman）；布拉德·皮特将扮演康沃尔资本的本·霍克特（Ben Hockett）。','letv$$$youku$$$sohu','$$$$$$','$$$$$$','高清完整版$http://www.le.com/ptv/vplay/25183936.html$$$http://v.youku.com/v_show/id_XMTU1MTI0OTkwMA==.html$$$高清$http://film.sohu.com/album/9058342.html','','','','');
INSERT INTO `mac_vod` VALUES('16148','同居牢友','','tongjilaoyou','T','','http://i0.letvimg.com/vrs/201411/03/c4073616-b974-45e6-b720-7d1d39ad05a9.jpg','[db:缩略图]','[db:幻灯图]','戴克斯·夏普德/威尔·阿奈特/齐·麦克布赖德/','鲍勃·奥登科克/','[db:tag]','乐视高清','美国','','0','18','',',345,','0','0','0','0','0','0','0','0','196996','0','0','0','0','0','0','6.0','0','129','1481656826','1482348915','0','0','刚刚重获自由的约翰（戴克斯·夏普德 Dax Shepard 饰）再次走入了监狱，不为了别的，只为了复仇。原来，约翰此次入狱是为了执行一个任务——保护检察官的儿子尼尔森（威尔·阿奈特 Will Arnett 饰），这个检察官不是别人，正是害得约翰屡屡遭受牢狱之灾的罪魁祸首。父债子还，刚来到尼尔森身边，约翰就将他卖给了狱中人人望而生畏的同性恋老大巴里（切·麦克布瑞德 Chi McBride 饰），本以为尼尔森即将遭遇非人待遇的约翰却没有想到，尼尔森竟然激起了巴里内心的爱意和温柔，很快两人便心心相印起来。就这样，尼尔森从一个狱中菜鸟转眼变成了大名鼎鼎的“压寨夫人”。绝望中，约翰明白，自己接下来的日子不会太好过。','letv$$$qq','$$$','$$$','高清完整版$http://www.le.com/ptv/vplay/21063740.html$$$腾讯高清$http://v.qq.com/x/cover/6liw9hk1ud73xo6/q0021wuxdzx.html','','','','');
