INSERT INTO `mac_vod` VALUES('22085','道士降魔','','daoshijiangmo','D','','http://i0.letvimg.com/lc03_isvrs/201507/02/16/20/5e88a868-e977-4eeb-86cb-d20f601a8edb.jpg','[db:缩略图]','[db:幻灯图]','辰轩锐/','杨易之/','[db:tag]','乐视高清','中国大陆','','0','24','',',345,','0','0','0','0','0','0','0','0','732276','0','0','0','0','0','0','8.0','0','37','1481918521','1482177098','0','0','七煞教——魔女白雪灵封印百年，突然一天被两个盗墓者解开封印，重现人间，多人阳气被吸干惨遭杀害，灵异研究所罗坤，找到赎靈师——风林山，驱魔师——紫菱，捉妖师——华少。他们各显神通。强强联手，展开了铲除魔女大战。在降魔途中他们遇到了各种离奇事件：阴宅鬼妻，古曼邪灵。降服蛇妖，大战半尸人，千年僵尸王，最终……','letv','','','高清完整版$http://www.le.com/ptv/vplay/23045015.html','','','','');
INSERT INTO `mac_vod` VALUES('22082','我是你的小幂phone','','woshinidexiaomiphone','W','','http://puui.qpic.cn/vcover_vt_pic/0/rdgbwhkcvsf4z6z1481510976/220','http://puui.qpic.cn/vcover_vt_pic/0/rdgbwhkcvsf4z6z1481510976/220','','杨幂/董子健','陈正道','杨幂,朋友,电话,和平,婚礼','腾讯高清','内地','国语','0','1','',',2240,','0','0','0','0','0','0','0','0','927278','0','0','0','0','0','0','4.0','0','414','1481916611','1482347648','0','0','成宇(董子健饰)在一次朋友饭局上意外得知，刚分手不久的前女友竟然要结婚了。盛怒之下，成宇即刻飞往曼谷，想大闹婚礼；没想到落地后霉运连连，更因丢失护照无法入住酒店。潦倒之际，一个号称捡到手机的神秘女生小幂(杨幂饰)打来电话。小幂试图阻止他去闹婚礼，成宇则一心只想拿回手机。在共同相处的一天一夜中，成宇发现小幂似乎对自己非常了解。婚礼当天，小幂在阻止成宇的过程中发生争执，并被他无意推倒受伤。小幂伤心离去，齐远内心被触动，和平地与女友告别，放下过去。却发现，在桌子上的手机，背面伤痕竟和小幂受伤的手臂一样……\n        ','qq','','','腾讯高清$http://v.qq.com/x/cover/rdgbwhkcvsf4z6z/s0022lczu87.html','','','','');
