INSERT INTO `mac_vod` VALUES('16145','飞跃地心','','feiyuedixin','F','','http://i0.letvimg.com/vrs/201410/22/0f7c69c8-5625-4be3-8235-cd00ce2968e7.jpg','[db:缩略图]','[db:幻灯图]','龚蓓苾/张芝华/金粮//陈薪羽/','陈苗/','[db:tag]','乐视高清','中国大陆','','0','4','',',181,','0','0','0','0','0','0','0','0','543059','0','0','0','0','0','0','8.0','0','396','1481656446','1482348972','0','0','一个在地震中埋了3天的女孩文雯（杨宇涵 饰）被救起，被救起来以后，她一直坚信自己爸爸还在地心里旅游，她在每一个可以画上蚕豆的地方穿越到地心里，去拯救会讲童话的爸爸。 雯雯的妈妈（龚蓓苾 饰）带着她走进了一个有奶奶（张芝华 饰）、爸爸（金粮 饰）和哥哥（陈薪羽 饰）的新家，然而，雯雯随之面对的是排山倒海般的爱向她袭来，在这样的爱之下，婆婆和媳妇、儿子和父亲、丈夫和妻子、继母和儿子、母亲和女儿的矛盾交错冲击，雯雯的妈妈终于心力交瘁了，虽然她不顾一切地想要了解和帮助她的女儿，但这样的亲子关系最后仍然以难以捉摸的失败告终——雯雯选择将自己封闭在了一个完全由爸爸的童话故事《地下根娘》的想象世界中，她仍然在自己的绘画中穿越地心，借此逃避爸爸去世的事实，全家矛盾最终以奶奶的求神拜佛而激化，雯雯的妈妈带着她离家啦。 这时，小哥哥英勇出击，他首先参与了雯雯的寻找根娘、救出爸爸的地心历险，并带着全家人一起和雯雯经历一场陌生离奇的，却也令人期待和欣喜的“破茧成蝶”的地心飞跃……','letv','','','高清完整版$http://www.le.com/ptv/vplay/21005844.html','','','','');
INSERT INTO `mac_vod` VALUES('16146','啪嗒啪嗒','','padapada','P','','http://i1.letvimg.com/lc05_isvrs/201602/24/09/40/0cd34de0-5c20-4537-8049-6dfb53c9ebbc.jpg','[db:缩略图]','[db:幻灯图]','','','[db:tag]','乐视高清','韩国','','0','4','',',181,','0','0','0','0','0','0','0','0','895048','0','0','0','0','0','0','4.0','0','109','1481656450','1482261827','0','0','一条生活在海洋里的马鲛鱼被渔网捕捉，而后被困在了一家海鲜餐馆的水箱里。从那以后她不屈不挠地寻找逃脱的方法。跟水箱里其他来自渔场的鱼不同，悲观的怀疑论者“老比目鱼”也生长在大海。作为水箱里幸存时间最长的一条鱼，他凭借其生存之道控制着其他的鱼。对他而言，马鲛鱼试图逃出水箱的举动已经对他的统治构成了威胁。','letv$$$qq','$$$','$$$','高清完整版$http://www.le.com/ptv/vplay/25933470.html$$$腾讯高清$http://v.qq.com/x/cover/fwfadi2sea5jg23/o002146nb6m.html','','','','');
INSERT INTO `mac_vod` VALUES('16974','梅花档案','','meihuadangan','M','','http://photocdn.sohu.com/kis/fengmian/55/55271/55271_ver_big_20160530205002.jpg','http://photocdn.sohu.com/kis/fengmian/55/55271/55271_ver_big_20160530205002.jpg','','周杰/苏瑾/董勇/海清/黄安仪','毛卫宁','四川省,档案馆,北京,中华,和龙','','大陆','国语','2003','12','',',449,','0','0','0','0','0','0','0','0','212001','0','0','0','0','0','0','1.0','0','349','1481692125','1482086318','0','0','建国之初，古老的中华大地一派喜气，然而欢愉的背后仍有冰冷的暗流涌动。在四川省渝州，曾经称霸一时的土匪头子白敬斋被人民政府正法，而他曾居住过的老宅闹鬼的传闻则越传越凶。龙飞十一名来自北京的青年，他在渝州当地档案馆做文员，而档案馆的宿舍正是征用自白敬斋的老宅。由于所有人都怕鬼，因此龙飞只得一个人住进宿舍，却接连遭遇多起奇怪灵异的事件。不久，档案馆发生一起命案，刑警队长肖克由此入驻档案馆调查。在这一过程中，肖克和龙飞不仅感知到自己身上的异样，更偶然知晓了一个名为“梅花党”的特务组织的秘密。','sohu$$$qq','$$$','$$$','梅花档案第1集$http://tv.sohu.com/20160612/n454053874.shtml#梅花档案第2集$http://tv.sohu.com/20160612/n454053876.shtml#梅花档案第3集$http://tv.sohu.com/20160612/n454053883.shtml#梅花档案第4集$http://tv.sohu.com/20160612/n454053885.shtml#梅花档案第5集$http://tv.sohu.com/20160612/n454053888.shtml#梅花档案第6集$http://tv.sohu.com/20160612/n454053890.shtml#梅花档案第7集$http://tv.sohu.com/20160612/n454053892.shtml#梅花档案第8集$http://tv.sohu.com/20160612/n454053896.shtml#梅花档案第9集$http://tv.sohu.com/20160612/n454053903.shtml#梅花档案第10集$http://tv.sohu.com/20160612/n454053905.shtml#梅花档案第11集$http://tv.sohu.com/20160612/n454053907.shtml#梅花档案第12集$http://tv.sohu.com/20160612/n454053909.shtml#梅花档案第13集$http://tv.sohu.com/20160612/n454053914.shtml#梅花档案第14集$http://tv.sohu.com/20160612/n454053924.shtml#梅花档案第15集$http://tv.sohu.com/20160612/n454053932.shtml#梅花档案第16集$http://tv.sohu.com/20160612/n454053937.shtml#梅花档案第17集$http://tv.sohu.com/20160612/n454053940.shtml#梅花档案第18集$http://tv.sohu.com/20160612/n454053943.shtml#梅花档案第19集$http://tv.sohu.com/20160612/n454053950.shtml#梅花档案第20集$http://tv.sohu.com/20160612/n454053954.shtml#梅花档案第21集$http://tv.sohu.com/20160612/n454053959.shtml#梅花档案第22集$http://tv.sohu.com/20160612/n454053961.shtml#梅花档案 第二部$http://tv.sohu.com/item/MTAyMTQzMg==.html$$$01$http://v.qq.com/x/cover/6g9cst2zjor88d8/k0018j7zs62.html#02$htt