INSERT INTO `mac_vod` VALUES('16149','烈日灼心','','lierizhuoxin','L','','http://i1.letvimg.com/lc02_isvrs/201510/23/17/45/202a5342-d9f2-4a73-b249-8eb1991733fe.jpg','[db:缩略图]','[db:幻灯图]','邓超/段奕宏/王珞丹/郭涛/高虎/','曹保平/','[db:tag]','乐视高清','中国大陆','','0','18','',',345,','0','0','0','0','0','0','0','0','597327','0','0','0','0','0','0','9.0','0','313','1481656838','1482348924','0','0','三个结拜兄弟共同抚养着一个孤女，多年来一直潜藏在城市的角落。 一名出租车司机，帮助无数人却从来不接受记者采访；一名协警，除暴安良，却从没想过升迁入职；一名渔夫，每天照料着孤儿的生活……看似风平浪静，实则内心暗涌，直到种种巧合之下， 警察伊谷春以及他的妹妹伊谷夏与他们的生活发生了神秘交织。他们的命运就此改变，曾轰动一时的惊天大案浮出水面，法网和人情究竟谁更无情？','letv','','','高清完整版$http://www.le.com/ptv/vplay/23820652.html','','','','');
