INSERT INTO `mac_vod` VALUES('16975','西安事变','共36集全','xianshibian','X','','http://photocdn.sohu.com/kis/fengmian/45/45784/45784_ver_big_20160530150003.jpg','http://photocdn.sohu.com/kis/fengmian/45/45784/45784_ver_big_20160530150003.jpg','','胡军/霍思燕/刘交心/唐国强/刘劲','叶大鹰','西安事变,张学良将军,蒋介石,周恩来,帝国主义','共36集全','大陆','国语','2007','12','',',353,','0','0','0','0','0','0','0','0','59912','0','0','0','0','0','0','1.0','0','291','1481692125','1481692125','0','0','一九三五年前后，日本帝国主义加强了对我国的侵略。在民族危机空前严重的关头，蒋介石仍旧坚持“攘外必先安内”政策，张学良将军被迫“剿共”，因在陕北战场上屡遭失败，受到蒋介石的责难，于是急于寻求出路。在国民党“五全”大会召开期间，他与杨虎城将军分别通过进步人士杜重远和田文浩与我党有所接触。从南京回到西安后，张学良通过被我军放回的原东北军团长高福源的关系，与我党周恩来同志在延安举行了会谈。张将军决定以民族存亡的大局来说服蒋介石停止内战，一致抗日。与此同时，杨虎城收到了毛主席派人给他送来的亲笔信。但是，他们的活动早就被蒋介石安插在西安的特务头子李达权、郑广清注意并对南京有所密报。','sohu','','','西安事变第1集$http://tv.sohu.com/20160613/n454161672.shtml#西安事变第2集$http://tv.sohu.com/20160613/n454161688.shtml#西安事变第3集$http://tv.sohu.com/20160613/n454161716.shtml#西安事变第4集$http://tv.sohu.com/20160613/n454161741.shtml#西安事变第5集$http://tv.sohu.com/20160613/n454161781.shtml#西安事变第6集$http://tv.sohu.com/20160613/n454161818.shtml#西安事变第7集$http://tv.sohu.com/20160613/n454161843.shtml#西安事变第8集$http://tv.sohu.com/20160613/n454161864.shtml#西安事变第9集$http://tv.sohu.com/20160613/n454161882.shtml#西安事变第10集$http://tv.sohu.com/20160613/n454161914.shtml#西安事变第11集$http://tv.sohu.com/20160613/n454161939.shtml#西安事变第12集$http://tv.sohu.com/20160613/n454161965.shtml#西安事变第13集$http://tv.sohu.com/20160613/n454162001.shtml#西安事变第14集$http://tv.sohu.com/20160613/n454162033.shtml#西安事变第15集$http://tv.sohu.com/20160613/n454162050.shtml#西安事变第16集$http://tv.sohu.com/20160613/n454162068.shtml#西安事变第17集$http://tv.sohu.com/20160613/n454162088.shtml#西安事变第18集$http://tv.sohu.com/20160613/n454162107.shtml#西安事变第19集$http://tv.sohu.com/20160613/n454162117.shtml#西安事变第20集$http://tv.sohu.com/20160613/n454162129.shtml#西安事变第21集$http://tv.sohu.com/20160613/n454162142.shtml#西安事变第22集$http://tv.sohu.com/20160613/n454162154.shtml#西安事变第23集$http://tv.sohu.com/20160613/n454162168.shtml#西安事变第24集$http:/