INSERT INTO `mac_vod` VALUES('16976','待到山花烂漫时','共35集全','daidaoshanhualanmanshi','D','','http://photocdn.sohu.com/kis/fengmian/221/221865/221865_ver_big_20160527143004.jpg','http://photocdn.sohu.com/kis/fengmian/221/221865/221865_ver_big_20160527143004.jpg','','黄维德/饶敏莉/吴迪/巩小榕/刘岳','段果平','国民党,解放军,文工团,山茶花,学习班','共35集全','大陆','国语','2014','12','',',465,','0','0','0','0','0','0','0','0','290696','0','0','0','0','0','0','8.0','0','11','1481692125','1481692125','0','0','1950年，在解放云南的最后一场战役中，国民党少将吴进的夫人和解放军干部夏振中的夫人在战火中同时生下孩子，因吴夫人难产死去，孩子被夏振中收养，却不知哪个是亲生的。17年后，两个孩子夏天、夏云长大成人，因吴部当年的军医收到密令寻找失散的孩子，牵出了这段尘封已久的秘密，也从此改变了两个青年的命运。夏云失去了报考部队文工团的机会，而夏天也不能参军。夏振中因没有及时向组织汇报两个孩子的身世问题，受到批评并进了学习班，家庭陷入困境。在经历种种磨难后，夏天走入军营，夏云考上了军医学院，他们在自己的军旅道路上锻炼成长，成为优秀军人。在执行一次高原试验任务中，夏天为救战友献出了宝贵的生命。坚强的女军人夏云如美丽的山茶花般在严寒中绽放。','sohu','','','待到山花烂漫时第1集$http://tv.sohu.com/20160613/n454164732.shtml#待到山花烂漫时第2集$http://tv.sohu.com/20160613/n454164746.shtml#待到山花烂漫时第3集$http://tv.sohu.com/20160613/n454164761.shtml#待到山花烂漫时第4集$http://tv.sohu.com/20160613/n454164777.shtml#待到山花烂漫时第5集$http://tv.sohu.com/20160613/n454164800.shtml#待到山花烂漫时第6集$http://tv.sohu.com/20160613/n454164815.shtml#待到山花烂漫时第7集$http://tv.sohu.com/20160613/n454164837.shtml#待到山花烂漫时第8集$http://tv.sohu.com/20160613/n454164863.shtml#待到山花烂漫时第9集$http://tv.sohu.com/20160613/n454164884.shtml#待到山花烂漫时第10集$http://tv.sohu.com/20160613/n454164908.shtml#待到山花烂漫时第11集$http://tv.sohu.com/20160613/n454164927.shtml#待到山花烂漫时第12集$http://tv.sohu.com/20160613/n454164956.shtml#待到山花烂漫时第13集$http://tv.sohu.com/20160613/n454164988.shtml#待到山花烂漫时第14集$http://tv.sohu.com/20160613/n454165010.shtml#待到山花烂漫时第15集$http://tv.sohu.com/20160613/n454165030.shtml#待到山花烂漫时第16集$http://tv.sohu.com/20160613/n454165053.shtml#待到山花烂漫时第17集$http://tv.sohu.com/20160613/n454165067.shtml#待到山花烂漫时第18集$http://tv.sohu.com/20160613/n454165089.shtml#待到山花烂漫时第19集$http://tv.sohu.com/20160613/n454165108.shtml#待到山花烂漫时第20集$http://tv.sohu.com/20160613/n454165132.shtml#待到山花烂漫时第21集$http://tv.sohu.com/20160613/n454165151.shtml#待到山花烂漫时第22集$http://