INSERT INTO `mac_vod` VALUES('16977','侦探成旭之千年迷局','共30集全','zhentanchengxuzhiqiannianmiju','Z','','http://photocdn.sohu.com/kis/fengmian/69/69134/69134_ver_big_20160526160011.jpg','http://photocdn.sohu.com/kis/fengmian/69/69134/69134_ver_big_20160526160011.jpg','','于荣光/王力可/唐国强/唐于鸿/张默','刘逢声','侦探成旭,杀人案件,日本,古城,决战','共30集全','大陆','国语','2008','12','',',378,','0','0','0','0','0','0','0','0','509353','0','0','0','0','0','0','8.0','0','447','1481692125','1481692125','0','0','古城龙城，一夜之间风云变幻，奇案迭起。飞檐走壁属于黑暗的杀手，日本风魔家族忍者出现在龙城。随他而来，是一件件离奇的杀人案件。而神秘的忍者，只是混乱的序曲，真正的恐怖，正在缓缓拉开帷幕，龙城，必将成为正与邪，善与恶的决战舞台。是生是死，是胜是负，所有的秘密即将解开，一切的恩怨就要算清，千年迷局，已经到了破局之时。','sohu','','','侦探成旭2第1集$http://tv.sohu.com/20160613/n454161633.shtml#侦探成旭2第2集$http://tv.sohu.com/20160613/n454161668.shtml#侦探成旭2第3集$http://tv.sohu.com/20160613/n454161686.shtml#侦探成旭2第4集$http://tv.sohu.com/20160613/n454161711.shtml#侦探成旭2第5集$http://tv.sohu.com/20160613/n454161740.shtml#侦探成旭2第6集$http://tv.sohu.com/20160613/n454161783.shtml#侦探成旭2第7集$http://tv.sohu.com/20160613/n454161819.shtml#侦探成旭2第8集$http://tv.sohu.com/20160613/n454161846.shtml#侦探成旭2第9集$http://tv.sohu.com/20160613/n454161865.shtml#侦探成旭2第10集$http://tv.sohu.com/20160613/n454161890.shtml#侦探成旭2第11集$http://tv.sohu.com/20160613/n454161920.shtml#侦探成旭2第12集$http://tv.sohu.com/20160613/n454161944.shtml#侦探成旭2第13集$http://tv.sohu.com/20160613/n454161973.shtml#侦探成旭2第14集$http://tv.sohu.com/20160613/n454162010.shtml#侦探成旭2第15集$http://tv.sohu.com/20160613/n454162039.shtml#侦探成旭2第16集$http://tv.sohu.com/20160613/n454162053.shtml#侦探成旭2第17集$http://tv.sohu.com/20160613/n454162072.shtml#侦探成旭2第18集$http://tv.sohu.com/20160613/n454162096.shtml#侦探成旭2第19集$http://tv.sohu.com/20160613/n454162108.shtml#侦探成旭2第20集$http://tv.sohu.com/20160613/n454162119.shtml#侦探成旭2第21集$http://tv.sohu.com/20160613/n454162131.shtml#侦探成旭2第22集$http://tv.sohu.com/20160613/n454162143.shtml#侦探成旭2第23集$http://tv.sohu.com/20160613/n454162157.shtml#侦探成旭2第24集$http://tv.sohu.com/20160613/n454162170.shtml#侦探成旭2第25集$http://tv.sohu.com/20160613/n454162185.