INSERT INTO `mac_vod` VALUES('16978','太行山上（卫视版）','共32集全','taixingshanshangweishiban','T','','http://photocdn.sohu.com/kis/fengmian/1202/1202547/1202547_ver_big_20160525163503.jpg','http://photocdn.sohu.com/kis/fengmian/1202/1202547/1202547_ver_big_20160525163503.jpg','','唐国强/张再新/杨俊勇/刘劲/王伍福','李伟','太行山,中国,胜利,英雄,国家','共32集全','大陆','国语','2015','12','',',371,','0','0','0','0','0','0','0','0','121772','0','0','0','0','0','0','8.0','0','440','1481692125','1481692125','0','0','70年多年前，在国家和民族危难之际，中国人民同仇敌忾、众志成城、前赴后继、英勇斗争，展开了一场波澜壮阔的全民族的伟大抗战，用鲜血和生命谱写了正义战胜邪恶、光明战胜黑暗、进步战胜反动的英雄史诗。经过艰苦卓绝的斗争，取得了抗日战争的伟大胜利。','sohu','','','太行山上第1集$http://tv.sohu.com/20160613/n454164695.shtml#太行山上第2集$http://tv.sohu.com/20160613/n454164714.shtml#太行山上第3集$http://tv.sohu.com/20160613/n454164724.shtml#太行山上第4集$http://tv.sohu.com/20160613/n454164740.shtml#太行山上第5集$http://tv.sohu.com/20160613/n454164749.shtml#太行山上第6集$http://tv.sohu.com/20160613/n454164768.shtml#太行山上第7集$http://tv.sohu.com/20160613/n454164790.shtml#太行山上第8集$http://tv.sohu.com/20160613/n454164808.shtml#太行山上第9集$http://tv.sohu.com/20160613/n454164829.shtml#太行山上第10集$http://tv.sohu.com/20160613/n454164848.shtml#太行山上第11集$http://tv.sohu.com/20160613/n454164875.shtml#太行山上第12集$http://tv.sohu.com/20160613/n454164889.shtml#太行山上第13集$http://tv.sohu.com/20160613/n454164911.shtml#太行山上第14集$http://tv.sohu.com/20160613/n454164933.shtml#太行山上第15集$http://tv.sohu.com/20160613/n454164960.shtml#太行山上第16集$http://tv.sohu.com/20160613/n454164998.shtml#太行山上第17集$http://tv.sohu.com/20160613/n454165018.shtml#太行山上第18集$http://tv.sohu.com/20160613/n454165037.shtml#太行山上第19集$http://tv.sohu.com/20160613/n454165062.shtml#太行山上第20集$http://tv.sohu.com/20160613/n454165081.shtml#太行山上第21集$http://tv.sohu.com/20160613/n454165103.shtml#太行山上第22集$http://tv.sohu.com/20160613/n454165131.shtml#太行山上第23集$http://tv.sohu.com/20160613/n454165152.shtml#太行山上第24集$http://tv.sohu.com/20160613/n454165170.shtml#太行山上第25集$http://tv.sohu.com/20160613/n454165186.shtml#太行山上第26集$http://tv.sohu.com/20160613/n454165205.shtm