INSERT INTO `mac_vod` VALUES('16979','非常代价','共20集全','feichangdaijia','F','','http://photocdn.sohu.com/kis/fengmian/1041/1041559/1041559_ver_big_20160531170503.jpg','http://photocdn.sohu.com/kis/fengmian/1041/1041559/1041559_ver_big_20160531170503.jpg','','李幼斌/陈瑾/王茜华','高健国','出卖肉体,未婚夫,小儿子,小卖部,主人公','共20集全','大陆','国语','2003','12','',',415,','0','0','0','0','0','0','0','0','321302','0','0','0','0','0','0','7.0','0','318','1481692126','1481692126','0','0','主人公马超的弟弟马良为和女友张苇革过上幸福生活，不惜铤而走险，将贪污的十万元公款藏在女友处，后锒铛入狱。马超为偿还弟弟的贪污款到处借钱，导致妹妹马小云的未婚夫傅百强取钱路上车祸身亡，扔下未婚先孕的小云和年过半百的傅家父母；马母由于小儿子被判刑，一气之下命丧黄泉，临终告诉马超，马良与他是同母异父的兄弟，马良的生父是楼下小卖部的张大爷；张大爷为了分担马家的经济压力，不得不变卖家产背井离乡；而马超因向昔日恋人借钱又陷入一场情感旋涡中，女儿与他反目，妻子宫玉卓和他分居；张苇革为了完成马良交待的任务，死守那十万元钱，并用赃款开了家影楼，但三年过后，当马良出狱时，张苇革不仅没守住钱，还赔了进去，于是她只好出卖肉体来换取当年对马良的承诺。当一切结束时，马超和妻子宫玉卓再次相遇，仿佛做了一场恶梦，那般地令人不堪回首。在这场人为的灾难面前，马家的每个人都付出了非常代价。','sohu','','','非常代价第1集$http://tv.sohu.com/20160612/n454053569.shtml#非常代价第2集$http://tv.sohu.com/20160612/n454053571.shtml#非常代价第3集$http://tv.sohu.com/20160612/n454053573.shtml#非常代价第4集$http://tv.sohu.com/20160612/n454053575.shtml#非常代价第5集$http://tv.sohu.com/20160612/n454053597.shtml#非常代价第6集$http://tv.sohu.com/20160612/n454053600.shtml#非常代价第7集$http://tv.sohu.com/20160612/n454053603.shtml#非常代价第8集$http://tv.sohu.com/20160612/n454053605.shtml#非常代价第9集$http://tv.sohu.com/20160612/n454053607.shtml#非常代价第10集$http://tv.sohu.com/20160612/n454053613.shtml#非常代价第11集$http://tv.sohu.com/20160612/n454053618.shtml#非常代价第12集$http://tv.sohu.com/20160612/n454053631.shtml#非常代价第13集$http://tv.sohu.com/20160612/n454053636.shtml#非常代价第14集$http://tv.sohu.com/20160612/n454053638.shtml#非常代价第15集$http://tv.sohu.com/20160612/n454053641.shtml#非常代价第16集$http://tv.sohu.com/20160612/n454053643.shtml#非常代价第17集$http://tv.sohu.com/20160612/n454053648.shtml#非常代价第18集$http://tv.sohu.com/20160612/n454053652.shtml#非常代价第19集$http://tv.sohu.com/20160612/n454053655.shtml#非常代价第20集$http://tv.sohu.com/20160612/n454053659.shtml','','','','');
