INSERT INTO `mac_vod` VALUES('16981','福禄双全','共30集全','fulushuangquan','F','','http://photocdn.sohu.com/kis/fengmian/1099/1099321/1099321_ver_big_20160531170003.jpg','http://photocdn.sohu.com/kis/fengmian/1099/1099321/1099321_ver_big_20160531170003.jpg','','赵君/陶慧敏/沈慧芬/王斑','刘江/舒刚','情妇,江湖,小店','共30集全','大陆','国语','1999','12','',',457,','0','0','0','0','0','0','0','0','944321','0','0','0','0','0','0','8.0','0','317','1481692126','1481692126','0','0','一介书生牛喜内心充满理想且正直、善良而又聪慧、幽默，但偏偏屡试不中，在世态炎凉的社会里，牛喜为躲债只得携妻带子背景离乡，在异乡小店里牛喜已弹尽粮绝，店主却逼牛喜付清店钱才能上路。几乎同时大贪官朱喜却因贪污巨款而东窗事发，幸得当朝太师庇护才得以从轻发落。朱喜被贬为三鸦县县令，他与太师达成交易，藏好财宝以伺机东山再起。心黑手辣的朱喜杀掉参与窃宝的人，然后逃往三鸦县，半路被江湖勇士郑天炮截击，不想朱喜的情妇媚娘却乱中携藏宝图——福禄图逃跑。郑大侠中朱喜毒镖，朱喜继续逃亡，诡计多端的朱喜窃喜媚娘偷走的是假福禄图。牛喜夫妇正辛苦打工还债，发现中毒的郑天炮，于是牛喜不顾一切地救活了郑大侠。郑大侠醒来见与朱喜酷肖的牛喜几乎惊呆了，于是拨刀欲再搏斗，牛喜忙解释因由，郑大侠抱拳相谢，随即领牛喜夫妇在郊野伏击朱喜，郑大侠怒斩朱喜，郑大侠为报救命之恩，将朱喜的福禄图和行囊送与牛喜夫妇，并“硬逼”他们冒名顶替。','sohu','','','福禄双全第1集$http://tv.sohu.com/20160612/n454053375.shtml#福禄双全第2集$http://tv.sohu.com/20160612/n454053378.shtml#福禄双全第3集$http://tv.sohu.com/20160612/n454053380.shtml#福禄双全第4集$http://tv.sohu.com/20160612/n454053386.shtml#福禄双全第5集$http://tv.sohu.com/20160612/n454053394.shtml#福禄双全第6集$http://tv.sohu.com/20160612/n454053400.shtml#福禄双全第7集$http://tv.sohu.com/20160612/n454053403.shtml#福禄双全第8集$http://tv.sohu.com/20160612/n454053406.shtml#福禄双全第9集$http://tv.sohu.com/20160612/n454053408.shtml#福禄双全第10集$http://tv.sohu.com/20160612/n454053413.shtml#福禄双全第11集$http://tv.sohu.com/20160612/n454053417.shtml#福禄双全第12集$http://tv.sohu.com/20160612/n454053424.shtml#福禄双全第13集$http://tv.sohu.com/20160612/n454053434.shtml#福禄双全第14集$http://tv.sohu.com/20160612/n454053441.shtml#福禄双全第15集$http://tv.sohu.com/20160612/n454053444.shtml#福禄双全第16集$http://tv.sohu.com/20160612/n454053447.shtml#福禄双全第17集$http://tv.sohu.com/20160612/n454053450.shtml#福禄双全第18集$http://tv.sohu.com/20160612/n454053453.shtml#福禄双全第19集$http://tv.sohu.com/20160612/n454053455.shtml#福禄双全第20集$http://tv.sohu.com/20160612/n454053457.shtml#福禄双全第21集$http://tv.sohu.com/20160612/n454053459.shtml#福禄双全第22集$http