INSERT INTO `mac_vod` VALUES('17412','战略阴谋：神鬼狙击手','搜狐高清','zhanlueyinmoushenguijujishou','Z','','http://photocdn.sohu.com/kis/fengmian/1206/1206989/1206989_ver_big_20160804182510.jpg','http://photocdn.sohu.com/kis/fengmian/1206/1206989/1206989_ver_big_20160804182510.jpg','','丹尼斯·海斯伯特/VelislavPavlov/EnochFrost/尼克·戈麦斯','唐·迈克尔·保罗	','狙击手,迈克尔,理查德,贝克特,布兰登','搜狐高清','美国','英语','2016','1','',',732,','0','0','0','0','0','0','0','0','399047','0','0','0','0','0','0','7.0','0','378','1481704329','1482342936','0','0','精英狙击手布兰登·贝克特(乍得迈克尔·柯林斯)和理查德·米勒(比利赞恩)负责保护一个天然气管道从恐怖分子想要发表声明。 与敌人战斗时导致狙击手被鬼射击谁知道他们的确切位置,紧张情绪安全漏洞被怀疑。 有人与敌人在里面工作吗? 任务前对其他活动吗? 上校的幕后黑手?','sohu','','','高清$http://film.sohu.com/album/9161506.html','','','','');
INSERT INTO `mac_vod` VALUES('17411','黑洞效应·救赎','搜狐高清','heidongxiaoyingjiushu','H','','http://photocdn.sohu.com/kis/fengmian/1206/1206958/1206958_ver_big_20160802181527.jpg','http://photocdn.sohu.com/kis/fengmian/1206/1206958/1206958_ver_big_20160802181527.jpg','','彭德松/李治源/栗菡','洛森	','一个人生活,总经理,黑衣人,绿宝石,新生活','搜狐高清','大陆','国语','2016','1','',',643,','0','0','0','0','0','0','0','0','736730','0','0','0','0','0','0','6.0','0','288','1481704329','1482342945','0','0','影片讲述了社会中层小职员张珂（李治源饰演）工作不尽人意，遭受上司欺辱，同时面临巨大生活压力甚至无法支付房租。上司王强剽窃下属张珂创意方案向总经理邀功，张珂理论遭遇开除，谁知屋漏偏逢连阴雨，回到家中又碰巧抓到女友黎小玉（栗菡饰演）在出租屋劈腿，懦弱无助的张珂选择爬到楼顶跳楼轻生。就在张珂决定坠楼那一刻，突然出现一个神秘黑衣人（彭德松饰演），神秘黑衣人既然对张珂了如指掌，张珂在惊诧之余讲述了他为何选择轻生的一肚子苦水。神秘黑衣人试图阻止张珂无效，张珂在坠楼那一刻，突然胸前的绿宝石吊坠光芒四射，把他带入黑洞穿越至广告方案被剽窃之前，张珂惊喜自己的人生改变之余，却依然无法阻止女友出轨的事实，他决定与轻浮的女友分手，重新开始自己的新生活。此时，故事才刚刚开始。分手后独自一个人生活的张珂依然无法忘记女友黎小玉，他想起胸前绿宝石可以带他穿越改变这一切，他决定穿越至与黎小玉第一次约会前，改变他们之间相识。熟知黑衣人却跟随者他穿越至2015年阻止他们相恋，张珂的这次穿越改变了整个时空的轨迹，故事有了新的轨迹。','sohu','','','高清$http://film.sohu.com/album/9157245.html','','','','');
INSERT INTO `mac_vod` VALUES('17410','飓风复仇','搜狐高清','jufengfuchou','J','','http://photocdn.sohu.com/kis/fengmian/1207/1207022/1207022_ver_big_20160812115524.jpg','http://photocdn.sohu.com/kis/fengmian/1207/1207022/1207022_ver_big_20160812115524.jpg','','蒋德亮/段冉/刘奕凯/媛媛','康瑞林	','突如其来,复仇计划,小家庭,爱情,爱人','搜狐高清','大陆','国语','2016','1','',',739,','0','0','0','0','0','0','0','0','127309','0','0','0','0','0','0','10.0','0','465','1481704329','1482342944','0','0','平静的森林里，红色的血在流淌着……凯文是一个英俊帅气新婚丈夫，妻子晶晶性感迷人，一天他和妻子熟睡在温暖的爱情小屋内，而坏人却无处不在,温暖的小家庭被这突如其来的横祸所打破。美好的家庭，炙热的恋人，一切都在暴力与凌辱中玉碎。爱情被撕裂，生命被毁灭。两个蒙面歹徒对他们下了毒手······施暴之后，他和爱人被抛尸河流，漂落荒岛，一场大雨过后，脑海已经平静，人生的一切皆被归零！可此刻伤口还在剧痛，仇恨依旧压抑，亡妻的悲伤，让他痛不欲生。报仇！对妻子的爱有多深，对坏人的恨就有多深。凯文开始了周密的复仇计划，最终手刃了强歼和杀死自己心爱的妻子的歹徒，可是余下的时光却只愿与亡妻的尸体长相厮守。','sohu','','','高清$http://film.sohu.com/album/9163406.html','','','','');
INSERT INTO `mac_vod` VALUES('17409','非常关系','搜狐高清','feichangguanxi','F','','http://photocdn.sohu.com/kis/fengmian/1207/1207042/1207042_ver_big_20160815110502.jpg','http://photocdn.sohu.com/kis/fengmian/1207/1207042/1207042_ver_big_20160815110502.jpg','','石三亿/宁玉辉','唐朋	','宝马车,小姨子,房产,秘密','搜狐高清','大陆','国语','2016','1','',',727,','0','0','0','0','0','0','0','0','977165','0','0','0','0','0','0','7.0','0','323','1481704328','1482342944','0','0','作品简介：  唐广庭的父亲突然去世。他继承上亿财产的同时引来了同胞兄弟唐广富的妒忌，以至于父亲祭日他的兄弟都不想去。这份上亿的遗产让他身边的亲人们都有了自己的小算盘。妻子的宝马车，儿子的结婚清单，女儿的房产，兄弟的咄咄逼人，前妻索要金钱，小姨子为自己的女儿争取遗产份额，这些要求被他一概拒绝。他身边的亲人为了得到继承遗产的身份绞尽脑汁，沆瀣一气，同流合污，用尽卑鄙之能事陷害他。但解决遗产纠纷的时候，他发现这里面有着不可告人的秘密。','sohu','','','高清$http://film.sohu.com/album/9165218.html','','','','');
INSERT INTO `mac_vod` VALUES('17408','川囧·青春有梦','搜狐高清','chuanqingchunyoumeng','C','','http://photocdn.sohu.com/kis/fengmian/1206/1206932/1206932_ver_big_20160728174524.jpg','http://photocdn.sohu.com/kis/fengmian/1206/1206932/1206932_ver_big_20160728174524.jpg','','海涛/车侑蓝/侯刚','刘汪洋	','改变自己,青春,陈冲,拍摄,台球','搜狐高清','大陆','国语','2016','1','',',630,','0','0','0','0','0','0','0','0','290996','0','0','0','0','0','0','10.0','0','318','1481704327','1482342934','0','0','一个落魄的电影导演和一个破产企业的老板为了逃避生活来到了战狼研习营学习，想改变自己的人生，从开始华丽丽的装逼到谎言被逐个揭穿，两人却因此成为了好兄弟，于是在同学们的帮助下，大家开始了剧中剧的拍摄，并最终取得了成功，也见到了陈冲的女神车侑蓝，并和自己打了一局台球。','sohu','','','高清$http://film.sohu.com/album/9157188.html','','','','');
INSERT INTO `mac_vod` VALUES('17407','燃情岁月2016','搜狐高清','ranqingsuiyue2016','R','','http://photocdn.sohu.com/kis/fengmian/1207/1207049/1207049_ver_big_20160825152611.jpg','http://photocdn.sohu.com/kis/fengmian/1207/1207049/1207049_ver_big_20160825152611.jpg','','彭远扬/孙言/何依芳/廖妃儿','梁富源	','黑社会老大,打工赚钱,医疗费,东莞,豹哥','搜狐高清','大陆','国语','2016','1','',',613,','0','0','0','0','0','0','0','0','645045','0','0','0','0','0','0','6.0','0','425','1481704326','1482342940','0','0','倚凤的妈妈身怀重病，庞大的医疗费用使得家境更加贫穷。倚凤毅然放弃读书的机会，出外打工赚钱为妈妈治病。低学历的倚凤只身来到东莞，只能在KTV工作，期间不惜出卖自己身体，赚取妈妈的医疗费。在工作中倚凤认识了同在KTV上班的好姐春春和KIKI，她们同甘共苦认识了对自己有心意的黑社会老大豹哥，交际当中还接触了学校校长、富家子弟、社会青年等等。复杂的KTV工作，令倚凤经历了从未有过的艰辛和痛苦，最后还是坚强的挺过去了。','sohu','','','高清$http://film.sohu.com/album/9165234.html','','','','');
