INSERT INTO `mac_vod` VALUES('17398','音乐之声（下部）','搜狐高清','yinlezhishengxiabu','Y','','http://photocdn.sohu.com/kis/fengmian/1206/1206969/1206969_ver_big_20160802101002.jpg','http://photocdn.sohu.com/kis/fengmian/1206/1206969/1206969_ver_big_20160802101002.jpg','','克里斯托弗·普鲁默/朱丽·安德鲁斯/埃琳诺·帕克','罗伯特·怀斯	','安德鲁斯,克里斯托弗,音乐之声,妻子去世,家庭教师','搜狐高清','美国','英语','2016','1','',',733,','0','0','0','0','0','0','0','0','890846','0','0','0','0','0','0','10.0','0','361','1481704312','1482342923','0','0','玛利亚（朱丽·安德鲁斯 饰）是一个年轻活泼的修女，喜欢在大自然下高声歌唱，所以她常常忘记了修道院里的规矩。院长认为玛利亚并不属于规矩严格的修道院。院长与众嬷嬷商量后，决定安排玛利亚到一位名叫特拉普（克里斯托弗·普卢默 饰）上校家当家庭教师。　　上校的妻子去世多年，留下7个孩子，他要求对孩子严格管教。他告诉玛利亚在他家的家庭教师都做不长久，都是因为孩子的恶作剧。玛利亚果然也遭到了恶作剧，可是这位善良的老师并没有告诉他们的父亲，而是像个母亲一样照顾孩子，很快跟孩子打成一片。上校也渐渐在玛利亚的引导下改变了对孩子们的态度。上校与玛利亚之间发生了感情，他们完婚后回到了已被纳粹占领的奥地利，上校并不想为纳粹办事，一家人准备逃跑。','sohu','','','高清$http://film.sohu.com/album/9157235.html','','','','');
