INSERT INTO `mac_vod` VALUES('17395','野外求爱','搜狐高清','yewaiqiuai','Y','','http://photocdn.sohu.com/kis/fengmian/1206/1206867/1206867_ver_big_20160722180003.jpg','http://photocdn.sohu.com/kis/fengmian/1206/1206867/1206867_ver_big_20160722180003.jpg','','杨景辉/蔡荣/赖嘉豪/朱静霞/易阳阳','廖顺劲	','黑社会,绑架,梦里,王浩,勇气','搜狐高清','大陆','国语','2016','1','',',623,','0','0','0','0','0','0','0','0','423288','0','0','0','0','0','0','3.0','0','242','1481704311','1482342919','0','0','王浩是一个经常倒霉的男生，趁国庆假期和两个兄弟一起跟着喜欢的女生旅行，天生胆小的他几次都告白失败，不幸途中遇到黑社会流氓误会追赶，万般无奈之下返回城市时遭到绑架殴打昏迷，医院醒来发现是一场梦，借着梦里的勇气跑出医院向喜欢的女生告白，终于他抱得了美人归！','sohu','','','高清$http://film.sohu.com/album/9155444.html','','','','');
INSERT INTO `mac_vod` VALUES('17394','赏金杀手','搜狐高清','shangjinshashou','S','','http://photocdn.sohu.com/kis/fengmian/1128/1128468/1128468_ver_big_20160801104503.jpg','http://photocdn.sohu.com/kis/fengmian/1128/1128468/1128468_ver_big_20160801104503.jpg','','李·范·克里夫/克劳斯·金斯基/克林特·伊斯特伍德/RobertoCamardiel/JosephEgger/BenitoStefanelli/AldoSambrell/路易吉·皮斯蒂利','赛尔乔·莱翁内	','伊斯特伍德,抢劫银行,通缉犯,赏金猎人,克里夫','搜狐高清','美国','英语','2016','1','',',613,','0','0','0','0','0','0','0','0','118932','0','0','0','0','0','0','7.0','0','147','1481704311','1482342921','0','0','Indio（吉昂·马利亚·沃隆特 Gian Maria Volonté 饰）是一个穷凶极恶的通缉犯，他伙同他的团伙屡次作案，他有一个怀表，每次大开杀戒之前都会看一看表，表上有一个女人的照片。赏金猎人Manco（克林特·伊斯特伍德 Clint Eastwood 饰）正在追捕Indio，而另外一个赏金猎人Colonel Douglas Mortimer（李·范·克里夫 Lee Van Cleef 饰）也在追捕同样的目标。两人一开始都看对方不顺眼，后来才决定一起追捕Indio。两人得知Indio准备去抢劫银行，于是定下计谋，让Monco加入Indio的团队，之后再和Mortimer来个里应外合。后来两人不慎被Indio所抓获。到底Manco和Mortimer能否除掉Indio，而Indio怀表里那个女人又和Mortimer有何联系？','sohu','','','高清$http://film.sohu.com/album/9157229.html','','','','');
INSERT INTO `mac_vod` VALUES('17393','青楼艳妓','搜狐高清','qinglouyanji','Q','','http://photocdn.sohu.com/kis/fengmian/23/23208/23208_ver_big_20160801103503.jpg','http://photocdn.sohu.com/kis/fengmian/23/23208/23208_ver_big_20160801103503.jpg','','劳伦斯·哈维/伊丽莎白·泰勒/埃迪·费舍','丹尼尔·曼	','伊丽莎白,青楼艳妓,社会名流,菲尔德,嫖客','搜狐高清','美国','英语','2016','1','',',613,','0','0','0','0','0','0','0','0','272272','0','0','0','0','0','0','9.0','0','399','1481704310','1482342920','0','0','格丽娅·旺德劳斯（伊丽莎白·泰勒 饰）玩世不恭，无所不为：抽烟、喝酒、纵欲，她表面的身份是一个光彩照人的模特，实际却是暗娼联络所的高级应召女郎，她的电话号码是“巴特菲尔德第八”，同时也成为她的绰号。风流放荡的格丽娅·旺德劳斯无可避免地走向堕落，后来她爱上她的嫖客——一位社会名流，但归于失败。心灰意冷之际，她想到了自杀，便有意制造了一起车祸。临死前，她终于醒悟了，想要过一种全新的生活，但已太晚了……','sohu','','','高清$http://film.sohu.com/album/1002030.html','','','','');
INSERT INTO `mac_vod` VALUES('17392','纳瓦隆大炮（下部）','搜狐高清','nawalongdapaoxiabu','N','','http://photocdn.sohu.com/kis/fengmian/1206/1206968/1206968_ver_big_20160802100503.jpg','http://photocdn.sohu.com/kis/fengmian/1206/1206968/1206968_ver_big_20160802100503.jpg','','格里高利·派克/大卫·尼文/安东尼·奎恩','J·李·汤普森	','爱琴海,游击队,英国,希腊','搜狐高清','美国','英语','2016','1','',',732,','0','0','0','0','0','0','0','0','408138','0','0','0','0','0','0','4.0','0','96','1481704310','1482342920','0','0','纳粹军队在爱琴海上的某希腊小岛上，安装了两支火力超强的巨炮，威协到邻近岛屿英军的安危，于是六名同盟国与希腊士兵受英国之命，在军官法兰克林少校的带领下潜入该岛，与岛上游击队会合后，执行摧毁巨炮的任务。但是，当法兰克林少校在任务中受伤后，凯西上校因为经验不足而坏了大事。不久后，他们发觉小队中有叛徒，导致凯西上校、爆破专家米勒下士与希腊游击队员安德瑞亚之间起了嫌隙。这六名壮士是否能完成这项艰巨的任务呢？','sohu','','','高清$http://film.sohu.com/album/9157226.html','','','','');
