INSERT INTO `mac_vod` VALUES('17390','末路江湖','搜狐高清','molujianghu','M','','http://photocdn.sohu.com/kis/fengmian/1206/1206915/1206915_ver_big_20160728175024.jpg','http://photocdn.sohu.com/kis/fengmian/1206/1206915/1206915_ver_big_20160728175024.jpg','','孙易扬/邪国军','王斌	','江湖,大哥,生意','搜狐高清','大陆','国语','2016','1','',',634,','0','0','0','0','0','0','0','0','218469','0','0','0','0','0','0','10.0','0','420','1481704308','1482342914','0','0','肖海17岁开始跟着大哥做黑道生意，每次大哥给的酬劳都少的可怜，一次，肖海向大哥提出多给些拿来还房贷，大哥却如以往一样说道：下次，等下次做笔大的再说，和以往的回答没有区别。后来果然做了笔大单，可这次大单却出了意外，钱被小偷偷了去，使他无法向大哥交代，只好想办法把钱补上，于是阴差阳错之下抢劫到了偷了他钱的小偷房间内，而小偷正因偷到一笔巨款而沾沾自喜，还惬意的准备招妓，丝毫不知危险渐渐他靠近，肖海抢了小偷的钱和车子，而他看在被小偷招的小姐-红红也是生活所迫才干这一行，便决定带她一起走，然而在他们远走高飞的路上又发生了什么...','sohu','','','高清$http://film.sohu.com/album/9157152.html','','','','');
INSERT INTO `mac_vod` VALUES('17389','踏雪寻梅','搜狐高清','taxuexunmei','T','','http://photocdn.sohu.com/kis/fengmian/1206/1206931/1206931_ver_big_20160728174527.jpg','http://photocdn.sohu.com/kis/fengmian/1206/1206931/1206931_ver_big_20160728174527.jpg','','舒宇歌/谢诗欣/李心悦/李奇原/宋文豪/阳东霖','李三平	','大一女生,贷款炒股,中年男人,业务员,白雪','搜狐高清','大陆','国语','2016','1','',',613,','0','0','0','0','0','0','0','0','615314','0','0','0','0','0','0','8.0','0','285','1481704308','1482342916','0','0','影片讲述了大一女生杜小梅清纯漂亮，被许多男生视为校花，她与同校同乡好友白雪交往甚密。大二学生赵强兼职一家网贷公司业务员，痴情杜小梅，想方设法接近，他在校外租了一套房，以极低成本邀杜小梅和白雪合租。杜小梅贷款炒股，一周赚到务农父亲一年才能赚到的钱，从此一发不可收，她用其它同学的证件高额贷款入股市进行杠杆操作，最终失手被强行平仓，欠贷百万。网贷公司使尽招数逼迫杜小梅还贷，白雪替杜小梅想到援交损招挣钱还贷，在联络了两个肯出一百万的中年男人后，杜小梅突然失踪。实习女警郭蓉接手调查，通过白雪提供的一条条线索，找寻小梅失踪的真相。。。。。。当迷团解开之际，令所有的人震惊！','sohu$$$qq','$$$','$$$','高清$http://film.sohu.com/album/9157186.html$$$腾讯高清$http://v.qq.com/x/cover/7a3c2tei8t7qi0s/j0314e1jpg0.html','','','','');
INSERT INTO `mac_vod` VALUES('17387','妈妈','搜狐高清','mama','M','','http://photocdn.sohu.com/kis/fengmian/1206/1206903/1206903_ver_big_20160726180003.jpg','http://photocdn.sohu.com/kis/fengmian/1206/1206903/1206903_ver_big_20160726180003.jpg','','曹越/秦跃芳/文超琳','范丛柏	','环卫工人,消防队员,主人翁,故事,学校','搜狐高清','大陆','国语','2016','1','',',613,','0','0','0','0','0','0','0','0','685472','0','0','0','0','0','0','6.0','0','114','1481704307','1482342913','0','0','本故事描写一位环卫女工（故事主人翁）方方一家三口幸福的生活。但是方方的丈夫消防队员李强，退伍前却在一次执行任务救火中，献出了宝贵的生命。倔强的方方拒绝了社会各界的帮助，一个人含辛茹苦的抚养着自己心爱的女儿文文。可是由于方方是一名环卫工人的身份，方方的女儿文文在学校却招到同学的歧视。从此女儿也渐渐疏远了妈妈。方方为了女儿却默默无闻的承受着一切痛苦。','sohu','','','高清$http://film.sohu.com/album/9157133.html','','','','');
