INSERT INTO `mac_vod` VALUES('17386','百万英镑','搜狐高清','baiwanyingbang','B','','http://photocdn.sohu.com/kis/fengmian/10/10792/10792_ver_big_20160727155003.jpg','http://photocdn.sohu.com/kis/fengmian/10/10792/10792_ver_big_20160727155003.jpg','','乔伊丝·格伦菲尔/格里高利·派克/罗纳德·斯奎尔','罗纳德·尼姆	','出国旅行,银行利息,小伙子,亚当斯,买衣服','搜狐高清','英国','英语','2016','1','',',641,','0','0','0','0','0','0','0','0','85677','0','0','0','0','0','0','6.0','0','444','1481704307','1482342918','0','0','富豪之家的两兄弟，从银行取出面额为一百万英镑的钞票，想以此验证一个穷人拿到这张巨额钞票的结局。哥哥认为这张钞票对一个穷人毫无价值，最终他还是会穷困潦倒；而弟弟则认为他会因为这张钞票摆脱困境过上富足的生活。为了证明各自的理论的正确的，兄弟两人为此打起了赌。他们将这张钞票留给穷困潦倒的美国小伙子亨利·亚当斯（格利高里·派克 Gregory Peck 饰）后出国旅行了，留下对未来一片迷茫的亨利。人们对这位突然暴富的罕见富翁，竟拼命地拉拢他，从免费吃饭，买衣服，到免费住宿，一个个像乞丐一样讨好他，并不断提高他的社会地位。不仅如此，这位幸运的小伙子还取到了一位好妻子和三万英镑的银行利息，从此以后过着非常幸福的生活。','sohu','','','高清$http://film.sohu.com/album/9157155.html','','','','');
