INSERT INTO `mac_vod` VALUES('15617','女孩睡着了','2016-12-7 20:19:23','nvhaishuizhouliao','N','','2d98898952d3ae08.jpg','','','埃蒙·法伦 / 贝塔尼·维特莫尔 / 马修·惠德特 / 丹妮艾尔·卡坦扎利蒂','RosemaryMyers','childhood,surprise,turning,friend,things','BD','欧美','英语','2016','10','','','0','0','0','0','0','0','0','0','994043','0','0','0','0','0','0','6.0','0','148','1481638540','1482367181','0','0','The world is closing in on Greta Driscoll. On the cusp of turning fifteen she can\"t bear to leave her childhood, it contains all the things that give her comfort in this incomprehensible new world. She floats in a bubble of loserdom with her only friend Elliott, until her parents throw her a surprise 15th birthday party and she\"s flung into a parallel place; a world that\"s weir..','ykyun','','','BD$COTAzMzk0NA==','','','','');
INSERT INTO `mac_vod` VALUES('13902','封灵记','01:04:34','fenglingji','F','','/npimg.php?pic=http://pic9.qiyipic.com/image/20161207/43/ca/v_111102974_m_601_m1_180_236.jpg','/npimg.php?pic=http://pic9.qiyipic.com/image/20161207/43/ca/v_111102974_m_601_m1_180_236.jpg','','魏巍,许奕','沈慕晗','','奇艺高清','大陆','国语','2016','5','',',78,','0','0','0','0','0','0','0','0','589942','0','0','0','0','0','0','3.0','0','116','1481135678','1482345869','0','0','胡八蛋的家是一个平房。胡八蛋经过了门口，但没有从大门进去，而是径直往窗口处走去。当他走过门口之后，一个黑影蹿出，躲在了门口的阴影里。胡八蛋来到窗口，推开窗户，摘掉头套，一甩头发，一个帅气的侧身翻进了屋子。黑色紧身裤的裆部传来了撕裂的声音，原来是裤子被钉子蹭到，露出了他喜羊羊图案的秋裤。翻进屋子的一刹那，胡八蛋熟练地用左手托住了窗户上的一桶水，右手堵住了一处弹簧的开关，紧接着双脚如同凌波散步一般穿梭在地上布满的弹珠球之间的空隙，经过一个裸女海报的时候顺手摸了摸裸女的乳头部位，房间的灯在此刻便亮了；经过音箱时旋了旋音量按钮，写字台的台灯亮了；然后一个帅气的姿势入座写字台，打开了台灯按钮，音箱系统打开了，自动放出了《命运交响曲》。窗外的那个阴影，此刻在黑暗中再度闪现...','qiyi$$$ykyun','$$$','$$$','高清$http://www.iqiyi.com/v_19rr9nj8yk.html$$$BD$COTA1NDY5Ng==','','','','');
INSERT INTO `mac_vod` VALUES('13903','独立日大电影','','duliridadianying','D','','/npimg.php?pic=http://pic4.qiyipic.com/image/20161207/a5/02/v_111409038_m_601_m1_180_236.jpg','/npimg.php?pic=http://pic4.qiyipic.com/image/20161207/a5/02/v_111409038_m_601_m1_180_236.jpg','','JacquelinArroyo,FayGauthier,SalLandi,JohnnyReyDiaz','Laura Beth Love','','正片','大陆','国语','2016','5','',',78,','0','0','0','0','0','0','0','0','782337','0','0','0','0','0','0','5.0','0','164','1481135679','1482352532','0','0','兰尼副总统正在为儿童健康基金会做宣讲时，一艘不明身份的巨型飞船悄然而至。战术空军司令部派出的多架飞机均被击毁，总统遇难，兰尼接任。原来这艘飞船来自太空中的猎户星云。猎户星人摧毁了全世界的政府和军事设施，并声称要给人类一个重启新世界的机会，他们将会带给人类更好的生活。猎户星人通过治愈兰尼儿子的腿疾获取人类的信任，各地居民纷纷登上猎户星人的运输船。但是凯利带领的“第一地球”自卫队并不相信猎户星人，他们通过袭击运输船企图将外星人赶走。另一边，兰尼和她的军官们发现猎户星人对地球和人类原来另有企图，他们必须想办法阻止猎户星人的入侵。当猎户星人首领因不满自卫队袭击运输船的行为要与兰尼会面时，兰尼和军官们决定将研制好的病原体和炸药带上猎户星人的母舰。最终，他们成功摧毁了猎户星人的大本营，并安全返回地球，解救了全人类。','qiyi$$$youku','$$$','$$$','高清$http://www.iqiyi.com/v_19rra8tbfc.html$$$http://v.youku.com/v_show/id_XMTg1MjAyODIyNA==.html','','','','');
INSERT INTO `mac_vod` VALUES('15571','非凡','','feifan','F','','http://i3.letvimg.com/lc06_isvrs/201610/13/10/51/306a7f90-a9c3-4a56-9dad-47df76d25e07.jpg','[db:缩略图]','[db:幻灯图]','马克·韦伯/露西·格里菲思/大卫·克莱顿·罗杰斯/','Matthew Leutwyler/','[db:tag]','正片','美国','','0','8','',',345,','0','0','0','0','0','0','0','0','807527','0','0','0','0','0','0','8.0','0','353','1481638472','1482352487','0','0','科技记者获得一个星期的独家访问权，他即将访问世界上第一个完美的人工智能AI。当记者与科学家将人工智能AI放在世界面前开始展现时，人工智能AI表现出了一种和以往完全不同的行为，这让人们开始不安和害怕起来……','letv$$$youku','$$$','$$$','高清完整版$http://www.le.com/ptv/vplay/26754062.html$$$http://v.youku.com/v_show/id_XMTc1NzUyNDcyNA==.html','','','','');
INSERT INTO `mac_vod` VALUES('13904','游戏时间到','01:09:35','youxishijiandao','Y','','/npimg.php?pic=http://pic9.qiyipic.com/image/20161207/21/52/v_111413937_m_601_m2_180_236.jpg','/npimg.php?pic=http://pic9.qiyipic.com/image/20161207/21/52/v_111413937_m_601_m2_180_236.jpg','','王龙,许梦圆','王龙','','奇艺高清','大陆','国语','2016','18','',',78,','0','0','0','0','0','0','0','0','478751','0','0','0','0','0','0','6.0','0','453','1481135690','1482345929','0','0','唐牛是个普通大学生 ,他爱慕女神颜一,却被富二代王羞辱,人生陷入绝境。走投无路之时,他得到了一张神奇的光盘，进入到游戏世界成为英雄。不料,游戏中潜藏的恶魔悄然登场,她要让世界上所有玩家互相残杀,从中吸取“恶”的能量,最终毁灭人类。觉醒后的唐牛与化敌为友的王,颜一一起愤然抵抗恶魔,当唐牛的灵魂坠入游戏中的迷失域时,遇见了颜一的母亲,她用爱的力量唤醒了死去玩家,给了恶魔致命一击。游戏世界崩塌了, 回到了游戏之前,唐牛成为了无人知晓,却又浩然存在的英雄。','qiyi$$$ykyun$$$sohu','$$$$$$','$$$$$$','高清$http://www.iqiyi.com/v_19rra93vt4.html$$$BD1280高清$COTA2OTUxMg==$$$高清$http://film.sohu.com/album/9256921.html','','','','');
INSERT INTO `mac_vod` VALUES('15474','华尔街：金钱永不眠','2016-11-30 19:00:57','huaerjiejinqianyongbumian','H','','583e946f28bd1.jpg','','','迈克尔·道格拉斯/希亚·拉博夫/乔什·布洛林/凯瑞·穆里根','奥利佛·斯通','道格拉斯,詹姆斯,华尔街,Michael,hellip','BD1280超清中字','美国','英语对白 中文字幕','2010','10','','','0','0','0','0','0','0','0','0','414520','0','0','0','0','0','0','5.0','0','437','1481638362','1482367164','0','0','https://site.douban.com/108127/  华尔街：金钱永不眠 小站2001年，昔日叱咤华尔街的戈登（迈克尔&bull;道格拉斯 Michael Douglas 饰）出狱了，无人来接，8年未见的女儿维妮（凯瑞&bull;穆里根 Carey Mulligan 饰）与他势同水火。不过，她的男友&mdash;&mdash;股票交易员杰克（希亚&bull;拉博夫 Shia LaBeouf 饰）却对他有些崇拜。杰克热衷清洁能源项目，但他的老板兼导师路易斯都劝他早日收手，并给了他一笔钱。没想到，公司因负面新闻债台高筑，投资银行的詹姆斯趁机收购。被逼无奈的路易斯卧轨自杀。杰克决心为导师复仇。他向戈登毛遂自荐，希望得到他的指点。戈登了解到他与维妮的关系，便提出了一个交易：杰克给他创造接近女儿的机会，他教杰克如何操作资本。为了复仇，杰克决定铤而走险，然而感情的翻转却让他始料不及&hellip;&hellip;','ykyun','','','BD$CODc0NDUwMA==','','','','');
INSERT INTO `mac_vod` VALUES('14861','外星男友','','waixingnanyou','W','','/npimg.php?pic=http://pic8.qiyipic.com/image/20161205/0b/0c/v_111293969_m_601_m1_180_236.jpg','/npimg.php?pic=http://pic8.qiyipic.com/image/20161205/0b/0c/v_111293969_m_601_m1_180_236.jpg','','秦翔宇,王子琦','丁惟','外星人,地球,李佳,秘密,女孩','乐视高清','大陆','国语','2016','8','',',78,','0','0','0','0','0','0','0','0','925636','0','0','0','0','0','0','3.0','0','50','1481636858','1482349909','0','0','外星人马嘉无意间来到地球，目睹了地球女孩李佳被抛弃的全过程。马嘉决定用自己的爱让李佳走出失恋阴影。经过马嘉的不懈努力，最终李佳答应了马嘉的追求。但是，慢慢李佳发现马嘉藏了很多秘密，李佳决定和闺蜜张蓉跟踪马嘉，发现马嘉跟一个老人在废弃工厂见面，更加加重了李佳的怀疑，李佳质问马嘉，但是由于一些原因，马嘉无法告知李佳真相，李佳决定分手，来到了新的城市。最终，马嘉带着遗憾离开了地球，得知真相的李佳后悔莫及……','qiyi$$$letv$$$sohu$$$ykyun','$$$$$$$$$','$$$$$$$$$','高清$http://www.iqiyi.com/v_19rr9bj45c.html$$$高清完整版$http://www.le.com/ptv/vplay/27198126.html$$$高清$http://film.sohu.com/album/9243210.html$$$BD$CODk1OTY0MA==','','','','');
