INSERT INTO `mac_vod` VALUES('13952','青春韶华','2016-12-9 18:22:04','qingchunshaohua','Q','','http://i0.letvimg.com/vrs/201408/12/bf5ff459-47fc-421b-9cb8-a3b0090cb491.jpg','[db:缩略图]','[db:幻灯图]','埃里奥·杰曼诺/伊莎贝拉·拉贡内瑟/埃尼奥·凡塔斯蒂奇尼/','马里奥·马尔托内/','[db:tag]','BD1280超清中字','意大利','','0','10','',',159,','0','0','0','0','0','0','0','0','821978','0','0','0','0','0','0','6.0','0','206','1481138105','1482367184','0','0','《青春韶华》这部传记片，讲述的是意大利著名诗人、哲学家贾科莫·莱帕尔德的故事，扮演莱帕尔德的则是戛纳影帝、意大利男星埃里奥·杰曼诺。莱帕尔德1798年出生在一个小镇，被认为是意大利最伟大的诗人之一，地位仅次于但丁。尽管他出身贫寒，但即使是他早期的作品，也提出了对他的时代至关重要的问题，它们显示了启蒙主义的影响，并且在很多方面预示了尼采的虚无主义。 \r\n　　莱帕尔德是个神童，很早就掌握了多门古老和现代的语言，20岁写就《诗歌》，但38岁时，他就因病早逝。叔本华称莱帕尔德为其“精神上的兄长”，意大利人认为他是最伟大的智者之一，他的思想被盛赞为“超越从歌德到瓦莱里的每一位欧洲文学家”。但是，尽管身负众多赞誉，这位19世纪的诗人和哲学家在主流英语世界仍然鲜为人知。影片在媒体评论处获得了不坏的评价。《好莱坞报道者》称：“随着影片的进展，故事愈发地引人入胜。尤其值得一提的是，影片的摄影，绝对是顶尖水准的。”英国的《卫报》则评论称：“虽然说，这并不是本届威尼斯上最激进的影片，但它绝对值得人们的关注。”','letv$$$ykyun','$$$','$$$','高清完整版$http://www.le.com/ptv/vplay/27164636.html$$$BD1280高清$COTEwODE4MA==','','','','');
