INSERT INTO `mac_vod` VALUES('14051','龙珠Z：复活的弗利萨 日语版','','longzhuZfuhuodefulisariyuban','L','','http://i1.letvimg.com/lc03_isvrs/201612/05/16/28/0539aac2-f92b-4f82-9d9c-792553ed1e64.jpg','[db:缩略图]','[db:幻灯图]','中尾隆圣/山寺宏一/森田成一/','山室直儀/','[db:tag]','乐视高清','日本','','0','4','',',181,','0','0','0','0','0','0','0','0','228701','0','0','0','0','0','0','8.0','0','333','1481224239','1482348218','0','0','许多年前，宇宙最大魔王弗利萨（中尾隆圣 配音）接连败在超级赛亚人之手，他的残党欲孽则流浪宇宙之中寻找那美克星人的新定居点，以期将弗利萨再度复活。几经周折，军队代理索尔贝（斋藤志郎 配音）利用地球的龙珠把弗利萨带回人间，而这个刚刚复活不久的魔王很快展开了他的复仇计划。半年之后，浩浩荡荡的弗利萨大军降临地球，悟饭（野泽雅子 配音）、比克大魔王（古川登志夫 配音）、克林、天津饭、武天老师挺身而出，而孙悟空（野泽雅子 配音）和贝吉塔（堀川亮 配音）则正跟随维斯（森田成一 配音）在遥远的宇宙深处接受试炼。','letv','','','高清完整版$http://www.le.com/ptv/vplay/27207779.html','','','','');
INSERT INTO `mac_vod` VALUES('13939','超能力者','','chaonenlizhe','C','','http://i1.letvimg.com/lc03_isvrs/201602/23/16/30/8a048d35-21fb-49c6-a37a-26f75b556aa2.jpg','[db:缩略图]','[db:幻灯图]','姜东元/高修/郑恩彩/','金民锡/','[db:tag]','正片','韩国','','0','8','',',159,','0','0','0','0','0','0','0','0','927684','0','0','0','0','0','0','1.0','0','471','1481137883','1482352522','0','0','从小，楚仁（姜东元 饰）就知道自己拥有能够控制人心的超能力，凡是被他的双眼所正视的人，无一例外的会被迷惑而任其摆布。靠着着神奇的超能力，楚仁得到了一切他想要得到的东西，但人性本就贪婪，个性乖僻的他依然没有感到满足，而是变本加厉的使用这能力干起了犯罪的勾当。 \r\n　　在一次偷窃行动中，楚仁和名为奎南（高修 饰）的男子相遇了。让楚仁感到震惊的是，这个外表平凡的男子居然没有受到自己的蛊惑，他不仅让行动遭遇了失败，还害自己错手杀死了无辜的人成为了通缉的对象。更让楚仁愤怒的是，不自量力的奎南居然对自己展开了调查。一场猫鼠之间的追逐正式拉开了序幕。','letv$$$youku$$$qq','$$$$$$','$$$$$$','高清完整版$http://www.le.com/ptv/vplay/27150469.html$$$http://v.youku.com/v_show/id_XMTgzMDE3OTUwOA==.html$$$腾讯高清$http://v.qq.com/x/cover/1viyexphol24vc4/r0022fjxxwe.html','','','','');
INSERT INTO `mac_vod` VALUES('13954','乌龙大家庭','','wulongdajiating','W','','http://i2.letvimg.com/vrs/201308/09/4059e0041fbd407bb20c772721d8d142.jpg','[db:缩略图]','[db:幻灯图]','石天/拿乔宏/黎姿/韵蕊/林振康/','石天/','[db:tag]','乐视高清','香港','','0','10','',',159,','0','0','0','0','0','0','0','0','293487','0','0','0','0','0','0','3.0','0','189','1481138334','1482176619','0','0','某疯狂科学家（乔宏 饰）因儿子感染艾滋病死亡而精神失常,他命令助手四处绑架同性恋者带到私人货柜船龙宝号上进行活体实验。警局督察长发叔（曹达华 饰）先后派人数次登船搜集证据,最后皆以失败告终。在夜总会演杂耍的石罅米（石天 饰）自幼研习武功,成年后进入特种大队,却因被指控有虐待倾向而离开警队,永不叙用。如今他独自抚养三个孩子,生活倒也快乐。某晚演出时,他和好友老虎仔（林振康 饰）目睹并插手一起绑架事件。由此将麻烦引到自己身上,而另一方面,发叔发现石罅米和一与疯狂科学家有勾结的日本人容貌相似,遂拟定了一个计划……','letv','','','高清完整版$http://www.le.com/ptv/vplay/1119808.html','','','','');
INSERT INTO `mac_vod` VALUES('13945','星空','','xingkong','X','','http://i0.letvimg.com/vrs/201301/24/a3cf06eb287141a782612c07f252dfd9.jpg','[db:缩略图]','[db:幻灯图]','刘若英/桂纶镁/徐娇/庾澄庆/林晖闵/','林书宇/','[db:tag]','乐视高清','台湾','','0','20','',',159,','0','0','0','0','0','0','0','0','100204','0','0','0','0','0','0','9.0','0','14','1481138021','1482348871','0','0','在人生最最纯然且充满想象力的几年里，13岁的小女孩谢欣美（徐娇 饰）都与爷爷（曾江 饰）在深山里度过。古朴的小木屋和静寂迷人的夜空，是她记忆深处最遥远和笃定的依恋。可是终于有一天小美要离开这里，她随着爸爸（庾澄庆 饰）妈妈（刘若英 饰）回到城市生活。繁华的都市五光十色，却无法带给她些许的归属与感动。与小美有着类似地感受的是频繁随着父母搬家与转学的男孩周宇杰（林晖闵饰），相似的境遇与心境让他们走到一起，成为最要好的朋友。某一天，小美的爸爸妈妈选择分手，而她也终于决定回到深山，带着她的好朋友小杰，一同去仰望那久违已久的星空……','letv','','','高清完整版$http://www.le.com/ptv/vplay/1493432.html','','','','');
INSERT INTO `mac_vod` VALUES('13946','猎狼犬','','lielangquan','L','','http://i3.letvimg.com/vrs/201301/23/e99dbbac7c0e4c74a1548a76877dc439.jpg','[db:缩略图]','[db:幻灯图]','亚历山大·多莫加罗夫/奥莎娜·阿金什那/亚历山大·布哈罗夫/','尼古拉·列别捷夫/','[db:tag]','乐视高清','俄罗斯','','0','20','',',159,','0','0','0','0','0','0','0','0','641695','0','0','0','0','0','0','8.0','0','208','1481138022','1482348894','0','0','猎狼犬是来自灰犬族的一位勇敢的战士，在他孩提的时候，亲眼目睹了自己的家族被屠杀的悲剧，凶手Zhadoba是一个戴着恶魔面具的神父，他还有一个追随者是食人者。成为奴隶之后，猎狼犬逐渐长大，心中依旧充满了复仇的愿望，随后他逃走了。他先是杀死了食人者，解救了几个他俘虏的犯人，其中有智者Tilorn 和奴隶女孩Niilit。勇士随后向命名为Galirad的城市前进，寻找任何实现复仇计划的机会，同时还要寻找他的助手邪恶女神Morana……','letv','','','高清完整版$http://www.le.com/ptv/vplay/1117527.html','','','','');
INSERT INTO `mac_vod` VALUES('15653','僵尸叔叔','','jiangshishushu','J','','81f1d136834b339f.jpg','','','午马 / 钱嘉乐 / 李丽珍 / 陈友 / 元华','刘观伟','钱嘉乐,hellip,僵尸叔叔,比邻,王子','乐视高清','香港','国语','1988','9','','','0','0','0','0','0','0','0','0','312269','0','0','0','0','0','0','2.0','0','293','1481638579','1482348169','0','0','偏僻山间，一僧一道比邻而居。和尚（午马 饰）随和开朗，更有一女徒菁菁（李丽珍 饰）玲珑可爱；道士（陈友 饰）古板严厉，而徒弟嘉乐（钱嘉乐 饰）却鬼马顽皮。性格不同的两个师傅口角不断，大斗其法，两个冤家徒弟也搞笑连连，笑料频出。  　　某天，一支奇异的丧葬队伍路过此地，某边疆皇族中尸毒死去，幻化成僵尸，千鹤道长及王子护送棺木上京。途中遭遇暴雨，棺木被雷劈开，僵尸破棺而出，大开杀戒。乌侍郎（元华 饰）携王子侥幸逃命，但王子已中尸毒。和尚与道士命徒儿照看王子，两人则冲入树林寻找千鹤道长&hellip;&hellip;','ykyun$$$letv','$$$','$$$','BD$CODMwMzc0OA==$$$高清完整版$http://www.le.com/ptv/vplay/2198370.html','','','','');
INSERT INTO `mac_vod` VALUES('13932','与魔鬼同行','','yumoguitongxing','Y','','http://i2.letvimg.com/vrs/201301/24/2d8568636ca1490c87963dfba2453157.jpg','[db:缩略图]','[db:幻灯图]','哈里森·福特/布拉德·皮特/玛格丽特·柯林/卢宾·布雷兹/特里特·威廉斯/','艾伦·J·帕库拉/','[db:tag]','乐视高清','美国','','0','10','',',159,','0','0','0','0','0','0','0','0','823243','0','0','0','0','0','0','2.0','0','70','1481137578','1482349512','0','0','年幼的弗兰基与家人生活在北爱尔兰恬静的小岛上，慈善的爸爸教导他捕鱼，然而一天晚饭时分，一名蒙面歹徒竟然闯进来枪杀了他父亲，仅仅因为他父亲透露了同情爱尔兰共和军的倾向。长大后的弗兰基（布拉德·皮特 Brad Pitt 饰）成为了一名爱尔兰共和军神枪手，然而英军始终武力强大，因此弗兰基等人决定购买毒刺式导弹。 \r\n　　五个月后，弗兰基隐藏了身份，同时被内线安排到了警察汤姆（哈里森·福特 Harrison Ford 饰）的家中暂时住下。一方面，富有魅力的他与汤姆一家人很快建立了友谊，并将大笔买金先藏于汤姆家中，一方面，弗兰基找到当地黑市军火商波克（特里特·威廉斯 Treat Williams 饰）购置导弹。然而军火商急于要钱，竟派蒙面人闯入汤姆家中，整个棋局全盘打乱，火力混乱之际，面对一边是身为警察的朋友，一边是爱尔兰的使命，弗兰基将如何选择……','letv','','','高清完整版$http://www.le.com/ptv/vplay/1970324.html','','','','');
