INSERT INTO `mac_vod` VALUES('13921','飞来横财','2016-12-9 18:21:12','feilaihengcai','F','','http://i3.letvimg.com/lc05_isvrs/201612/01/14/07/f768d7ce-2901-4075-a7f9-195ec5777e5b.jpg','[db:缩略图]','[db:幻灯图]','帕克•托斯/','阿加德•玛祖阿/','[db:tag]','BD1280超清中字','西班牙','','0','10','',',159,','0','0','0','0','0','0','0','0','260207','0','0','0','0','0','0','9.0','0','252','1481137567','1482367183','0','0','《飞来横财》是一部由Alejandro Marzoa执导的喜剧电影。电影讲述了两个男人从穷变富的故事。两个男人一起钓鱼，可时间不短流逝鱼却一直不上钩，无奈之下两人去了鱼市，购买了最大的那条鱼。其中一个男人带着鱼回到家，她的妻子为家人准备了丰盛的菜肴，一家人其乐融融，而此时妻子的爸爸终于说出了他一直想说的话：很明显，我的女儿跟了你这样的男人非常不幸，你甚至不能支付孩子去马略卡岛旅行的费用，你简直一无是处……','letv$$$youku$$$ykyun','$$$$$$','$$$$$$','高清完整版$http://www.le.com/ptv/vplay/27005732.html$$$http://v.youku.com/v_show/id_XMTgxMTg3MTEwOA==.html$$$BD1280高清$COTEwNzYwNA==','','','','');
INSERT INTO `mac_vod` VALUES('13922','天空的黄金马车','2016-12-8 18:07:10','tiankongdehuangjinmache','T','','http://i0.letvimg.com/lc06_isvrs/201612/01/14/44/42c7f512-e3f4-48d9-8377-7baa9a74ff44.jpg','[db:缩略图]','[db:幻灯图]','','O Muel/','[db:tag]','BD1280超清中字','韩国','','0','10','',',159,','0','0','0','0','0','0','0','0','475341','0','0','0','0','0','0','2.0','0','371','1481137568','1482367182','0','0','《天空的黄金马车》是一部韩国剧情电影，由吴篾执导并编剧，文石范、金东虎领衔主演。片名中的“黄金马车”是一个三人乐队的名字，这听起来好像很气派，但事实却是，他们使用着那些看起来非常不专业的音乐设备，并且非常穷困，他们正想方设法的筹备乐队资金，这样他们就可以开演唱会了。乐队的一员无奈之下打电话向妈妈求助，希望能得到300万元的资金来实现他当主唱的梦想。那他们三人到底能筹到资金开一场属于自己的华丽演唱会吗？','letv$$$youku$$$ykyun','$$$$$$','$$$$$$','高清完整版$http://www.le.com/ptv/vplay/27164894.html$$$http://v.youku.com/v_show/id_XMTgzMDIzODQyMA==.html$$$BD1280高清$COTA2OTQ0NA==','','','','');
INSERT INTO `mac_vod` VALUES('15622','僵尸世界大战','','jiangshishijiedazhan','J','','http://i1.letvimg.com/lc05_isvrs/201609/28/17/17/a98570a6-31f6-4933-b453-dd0552f8446a.jpg','[db:缩略图]','[db:幻灯图]','布拉德·皮特/米瑞·伊诺丝/艾德·哈里斯/','马克·福斯特/','[db:tag]','乐视高清','美国','','0','8','',',345,','0','0','0','0','0','0','0','0','802613','0','0','0','0','0','0','4.0','0','458','1481638546','1482348653','0','0','《僵尸世界大战》通过联合国战后调查人员对一场毁灭世界各国的僵尸战争幸存者的调查展现了一次虚构的世界大战。 故事背景设定在人类赢得僵尸大战的十年后，当年那场对抗僵尸的战争波及整个世界，差点毁掉了人类。布拉德·皮特在片中饰演一位联合国工作人员，负责对僵尸大战后的幸存者进行调查。','letv','','','高清完整版$http://www.le.com/ptv/vplay/2128395.html','','','','');
INSERT INTO `mac_vod` VALUES('15623','蚁人','2016-11-23 20:37:30','yiren','Y','','http://i2.letvimg.com/lc03_isvrs/201509/11/10/37/26fa6cea-ca1f-4db1-a57a-8e85cee80260.jpg','[db:缩略图]','[db:幻灯图]','保罗·路德/迈克尔·道格拉斯/伊万杰琳·莉莉/寇瑞·斯托尔/迈克尔·佩纳/','佩顿·里德/','[db:tag]','BD1280超清中字','美国','','0','8','',',345,','0','0','0','0','0','0','0','0','491946','0','0','0','0','0','0','9.0','0','496','1481638547','1482367246','0','0','前工程师斯科特（保罗·路德 Paul Rudd 饰）由于劫富济贫进了监狱，出狱后的他为了争取看望女儿的权利又走上了盗窃之路。没想到一次意外的偷盗事件让他成为了新一代“蚁人”，老蚁人汉克.皮姆博士（迈克尔·道格拉斯 Michael Douglas 饰）成为了他的导师，可皮姆博士的女儿霍普（伊万杰琳·莉莉 Evangeline Lilly 饰）却并不看好他。但是危机迫在眉睫，为了对付强大的敌人拯救世界，斯科特不得不叫来自己的一帮狐朋狗友帮助自己完成一个不可能完成的任务。而取得任务的成功也是斯科特挽回女儿的关键，屌丝能否逆袭就看最后一击。','letv$$$ykyun','$$$','$$$','高清完整版$http://www.le.com/ptv/vplay/24163206.html$$$BD$CODQzOTQ0NA==','','','','');
INSERT INTO `mac_vod` VALUES('15652','我的个神啊','','wodegeshena','W','','http://i3.letvimg.com/lc03_isvrs/201505/08/10/36/1d2ee42c-bb48-41cd-aeaf-305ba9687e63.jpg','[db:缩略图]','[db:幻灯图]','阿米尔·汗/安努舒卡·莎玛/桑杰·达特/波曼·伊拉妮/沙鲁巴·舒克拉/','拉库马·希拉尼/','[db:tag]','乐视高清','印度','','0','20','',',345,','0','0','0','0','0','0','0','0','827714','0','0','0','0','0','0','5.0','0','179','1481638579','1482348897','0','0','贾古（安努舒卡·莎玛 Anushka Sharma 饰）和男友相恋多年，感情十分要好的两人终于决定步入婚姻的殿堂，然而，一场意外的突然降临让贾古所期望的一切都化为了泡影，因此，伤心欲绝的贾古决定返回家乡，成为了一名记者。一次偶然中，贾古遇见了名为PK（阿米尔·汗 Aamir Khan 饰）的男子，让贾古感到惊讶的是，PK竟然声称自己是一名外星人，因为宇宙飞船被劫持，所以流落至地球。刚开始，贾古以为PK在胡言乱语，不过，之后发生的种种令贾古开始相信PK所言，贾古甚至决定帮助PK寻找返回他的星球的方法。随着时间的推移，PK渐渐爱上了勇敢善良的贾古，可惜贾古依然还爱着男友，PK决定暂且放下心中的感情，帮助贾古和男友破镜重圆。','letv','','','高清完整版$http://www.le.com/ptv/vplay/25790846.html','','','','');
INSERT INTO `mac_vod` VALUES('13947','钟无艳 国语','','zhongwuyanguoyu','Z','','http://i2.letvimg.com/vrs/201301/24/00a5e324da7c45008bbdd484db71cdab.jpg','[db:缩略图]','[db:幻灯图]','郑秀文/梅艳芳/张柏芝/黄浩然/林雪/王天林/许绍雄/','杜琪峰/韦家辉/','[db:tag]','乐视高清','香港','','0','20','',',159,','0','0','0','0','0','0','0','0','924064','0','0','0','0','0','0','10.0','0','159','1481138028','1482348881','0','0','春秋战国时期，一向昏庸好色的齐宣王（梅艳芳饰）误闯夜叉山，碰上了美丽的寨主钟无艳（郑秀文饰），齐宣王决定把钟无艳娶为皇后，可是一直倾心于钟无艳的“狐狸精”（张柏芝饰）出手阻挠，只要钟无艳爱上其他的人，脸上便会无缘无故多出一块难看的红斑。狐狸精后来化身夏迎春勾引齐宣王，齐宣王终日沉醉温柔乡。而钟无艳为了夫君出生入死、南征北战。齐宣王只会有事求助于钟无艳时才好言相向。齐宣王十分好赌，竟然把钟无艳作为作为筹码输掉了，钟无艳愤怒离开，脸上红斑也自然消失。夏迎春得逞后也离开了皇宫，齐宣王才发现自己最爱为何人，浪子回头。在受到叛徒攻击时，还是爱着齐宣王的钟无艳，赶到了皇宫，帮忙驱走外敌……','letv','','','高清完整版$http://www.le.com/ptv/vplay/1566176.html','','','','');
INSERT INTO `mac_vod` VALUES('13948','妙药春情','','miaoyaochunqing','M','','http://i1.letvimg.com/vrs/201301/23/9c9c3073c6ec4ddea1832fdf6bbb57f2.jpg','[db:缩略图]','[db:幻灯图]','玛丽莲·梦露/加里·格兰特/金吉·罗杰斯/查尔斯·科本/','霍华德·霍克斯/','[db:tag]','乐视高清','美国','','0','20','',',159,','0','0','0','0','0','0','0','0','161586','0','0','0','0','0','0','4.0','0','39','1481138032','1482348893','0','0','富顿教授（加里·格兰特 Cary Grant 饰）是一位科学家，正在研究一种能够让人返老还童的神奇药物。某一天，富顿用来试验药物的黑猩猩从笼子里逃了出来，在实验室里“大闹天宫”，没想到竟然在误打误撞之下将富顿一直想要研制但始终没有成功的神药给捣鼓了出来。 　　对此一无所知的富顿在偶然间喝下了这种药物，很快，药效便发挥了作用，富顿一反常态，言行举止俨然一幅二十岁小伙子的模样。秘书路易斯（玛丽莲·梦露 Marilyn Monroe 饰）前来拜访富顿教授，没想到却被他邀请去游泳、溜冰。之后，富顿的妻子爱德华（金格尔·罗杰斯 Ginger Rogers 饰）亦误食了药物，一连串让人忍俊不禁的趣事就此展开。','letv','','','高清完整版$http://www.le.com/ptv/vplay/1100771.html','','','','');
INSERT INTO `mac_vod` VALUES('13949','林肯律师','','linkenlvshi','L','','http://i3.letvimg.com/vrs/201208/30/6deed014b4e24924baef662ae42c36b2.jpg','[db:缩略图]','[db:幻灯图]','马修·麦康纳/玛丽莎·托梅/瑞恩·菲利普/威廉姆·H·梅西/约翰·雷吉扎莫/迈克尔·佩纳/凯瑟琳·莫宁/','布拉德·福尔曼/','[db:tag]','乐视高清','美国','','0','18','',',159,','0','0','0','0','0','0','0','0','292243','0','0','0','0','0','0','9.0','0','79','1481138058','1481310852','0','0','故事讲述洛杉矶刑事辩护律师米奇·豪勒（马修·麦康纳 Matthew McConaughey 饰），绰号“林肯律师”，经手的都是些处于社会底层的客户。他善恶分明、正直守信，并非贪财小人。然而这一次，豪勒的辩护对像是年轻富有的房地产开发商路易斯-罗莱特（瑞恩·菲利普 Rya n Phillippe 饰）。罗莱特受到的指控是殴打并企图强奸应招女郎瑞琪（玛格丽塔-莱维瓦 Margarita Levieva 饰），但罗莱特声称自己是无辜的，有人栽赃陷害他。罗莱特的母亲愿意不惜重金证明自己心爱儿子的清白。为了解案情的细节，豪勒及其私人调查员对此案进行了调查。他们最初获得的证据证明罗莱特似乎确实无辜，这个案子能够轻而易举地打赢，豪勒也能够轻松地获得一笔高额的律师费。然而，一个偶然的机会使豪勒发现，此案与他曾经接手的另一桩强奸杀人案有诸多相似之处……','letv','','','高清完整版$http://www.le.com/ptv/vplay/1734767.html','','','','');
