INSERT INTO `mac_vod` VALUES('17428','黑营','搜狐高清','heiying','H','','http://photocdn.sohu.com/kis/fengmian/1153/1153362/1153362_ver_big_20160811180003.jpg','http://photocdn.sohu.com/kis/fengmian/1153/1153362/1153362_ver_big_20160811180003.jpg','','J·马列什/F·彼杰尔卡','Vladimir Cech	','德国法西斯,帝国主义,越南','搜狐高清','其它','其它','2016','1','',',745,','0','0','0','0','0','0','0','0','658434','0','0','0','0','0','0','6.0','0','353','1481704335','1482342945','0','0','第二次世界人战结束后，法帝国主义仍企图在越南维持它的殖民统治，公开组织以德国法西斯军官为骨干、以及亡命之徒和战时流落法国的东欧难民的“黑营军”向越南人民进攻。','sohu','','','高清$http://film.sohu.com/album/9165002.html','','','','');
INSERT INTO `mac_vod` VALUES('17415','雁南飞','搜狐高清','yannanfei','Y','','http://photocdn.sohu.com/kis/fengmian/8/8749/8749_ver_big_20160811152002.jpg','http://photocdn.sohu.com/kis/fengmian/8/8749/8749_ver_big_20160811152002.jpg','','塔吉娅娜·萨莫依洛娃/阿列克谢·维特洛夫','米哈依尔·卡拉托佐夫	','莫斯科,鲍里斯,胜利,青年,鲜花','搜狐高清','俄罗斯','英语','2016','1','',',740,','0','0','0','0','0','0','0','0','688617','0','0','0','0','0','0','5.0','0','185','1481704332','1482342947','0','0','薇罗尼卡和鲍里斯是一对热恋中的青年。战争爆发后，鲍里斯上了前线。薇罗尼卡的家夷为平地，双亲被炸死。借住在鲍里斯的父亲家中。在痛苦的日子里，她受到了鲍里斯的表弟马尔克的诱骗，失身给他。遭到鲍里斯的父母及其他人的遣责，双重的打击使薇罗尼卡想自杀。但她心中存着一线希望，那就是等鲍里斯归来。但鲍里斯上前线不久就牺牲了。这消息很久以后才被薇罗尼卡知道，她绝望了。但是，战争胜利的到来对每一个人都是一个新的开始。在莫斯科市民欢迎士兵凯旋归来的盛会上，薇罗尼卡把手中的鲜花一枝枝分给来自前方的战士。这时，大枞又在空中飞过，就像当初薇罗尼卡和鲍里斯在莫斯科河畔漫步的情景一样。','sohu','','','高清$http://film.sohu.com/album/674.html','','','','');
