INSERT INTO `mac_vod` VALUES('17370','复仇者','','fuchouzhe','F','','http://photocdn.sohu.com/kis/fengmian/1206/1206835/1206835_ver_big_20160720145510.jpg','http://photocdn.sohu.com/kis/fengmian/1206/1206835/1206835_ver_big_20160720145510.jpg','','周骆风/李俊燕/陈典路/詹发盛','周骆风	','随心所欲,复仇者,互联网,杀手','正片','大陆','国语','2016','1','',',634,','0','0','0','0','0','0','0','0','329027','0','0','0','0','0','0','5.0','0','135','1481704291','1482352452','0','0','由互联网电影集团星图传媒独家发行，本片讲述一群黑暗中的游戏者，在黑暗和夹缝中苟活，忍辱草芥，命如薄纸，他们随心所欲，肝胆相照，然而在一次行动中，陷入了无尽的仇杀之中，为了逝者，选择了一条充满荆棘的复仇之路，为了摧毁黑暗势力，却成为最冷酷的杀手，一场血雨腥风由此展开...','sohu$$$youku','$$$','$$$','高清$http://film.sohu.com/album/9150687.html$$$http://v.youku.com/v_show/id_XMTU4OTU0MTM0OA==.html','','','','');
INSERT INTO `mac_vod` VALUES('17369','艾玛的机会','搜狐高清','aimadejihui','A','','http://photocdn.sohu.com/kis/fengmian/1206/1206103/1206103_ver_big_20160602162503.jpg','http://photocdn.sohu.com/kis/fengmian/1206/1206103/1206103_ver_big_20160602162503.jpg','','约瑟夫·劳伦斯/米西·派勒/NormaMichaels/AnthonyCrivello/特雷西·尼尔森','Anna Elizabeth James	','艾玛,技能,牧场','搜狐高清','美国','英语','2016','1','',',613,','0','0','0','0','0','0','0','0','830132','0','0','0','0','0','0','8.0','0','383','1481704287','1482342895','0','0','在一个马匹救援牧场的社区服务中，艾玛发现了一匹被虐待过不愿让任何人骑的马，并与其产生不可思议的联系。获得新的技能和充分的自信后，艾玛解放自我，最终拯救了这个让她成长的牧场。','sohu','','','高清$http://film.sohu.com/album/9135916.html','','','','');
INSERT INTO `mac_vod` VALUES('17368','血迷庄','搜狐高清','xuemizhuang','X','','http://photocdn.sohu.com/kis/fengmian/1206/1206823/1206823_ver_big_20160719181010.jpg','http://photocdn.sohu.com/kis/fengmian/1206/1206823/1206823_ver_big_20160719181010.jpg','','徐冰/罗立群/郭子溪/胡田幸子/梁靖晨','童小辉	','主治医生,黑衣人','搜狐高清','大陆','国语','2016','1','',',632,','0','0','0','0','0','0','0','0','516655','0','0','0','0','0','0','5.0','0','104','1481704287','1482342902','0','0','第一代网红雪菲与男友王宇进行野外探险之旅，夜晚在山间迷路。无奈入住了一座诡异的山庄。雪菲用DV录播自己的探险节目时无意间拍到了药业公司老总郑东杀妻的过程而遭到追杀。逃跑中，雪菲遭到黑衣人钝器重击昏迷，醒来后便失忆了。郑东得知消息，重金买通雪菲主治医生对其失忆症进行反向治疗，让其彻底疯掉。王宇为了保护雪菲，从医院接走她并带她到山庄恢复记忆，指认凶手。当雪菲经历多重痛苦终于回忆起凶手郑东模样的时候，却惊人的发现郑东居然就是王宇，那么眼前这个王宇又是谁？','sohu','','','高清$http://film.sohu.com/album/9150660.html','','','','');
INSERT INTO `mac_vod` VALUES('17366','霸道总裁名流秘书','搜狐高清','badaozongcaimingliumishu','B','','http://photocdn.sohu.com/kis/fengmian/1206/1206799/1206799_ver_big_20160715154503.jpg','http://photocdn.sohu.com/kis/fengmian/1206/1206799/1206799_ver_big_20160715154503.jpg','','田理/萧赫/孙梦纯/叶思浵','廉欣	','搞笑故事,霸道总裁,秘书','搜狐高清','大陆','国语','2016','1','',',618,','0','0','0','0','0','0','0','0','568093','0','0','0','0','0','0','8.0','0','138','1481704285','1482342893','0','0','屌丝梅有钱创业遇困境，落魄时在街上偶遇老同学兼前任何佩琪，在何佩琪的帮助下屌丝融资成功，成为霸道总裁。成为总裁后招聘名流秘书，与名流秘书，前任之前发生扑朔迷迭，高潮迭起的搞笑故事。','sohu','','','高清$http://film.sohu.com/album/9150606.html','','','','');
INSERT INTO `mac_vod` VALUES('17367','2B青年之漳南兄弟','搜狐高清','2Bqingnianzhizhangnanxiongdi','2','','http://photocdn.sohu.com/kis/fengmian/1206/1206812/1206812_ver_big_20160718183506.jpg','http://photocdn.sohu.com/kis/fengmian/1206/1206812/1206812_ver_big_20160718183506.jpg','','赵富贵/吴志博/田星杰/方国志','吴静儿	','高利贷,2B青年,大哥,青春,上班','搜狐高清','大陆','国语','2016','1','',',630,','0','0','0','0','0','0','0','0','561118','0','0','0','0','0','0','7.0','0','324','1481704286','1482342901','0','0','每个人都有一个青春，这三兄弟的青春却是这样的，上学时期浩北因打架遭学校开除，随后两兄弟相继缀学，缀学后三人分别在不同工厂上班，有一天老二突然在集市上遇见流浪的老三将其带回家找大哥，经了解原来老三误入歧途欠下高利贷，无奈之下三人最终面对讨债方，然而在逃跑过程中大哥浩北被警方抓获......','sohu','','','高清$http://film.sohu.com/album/9150638.html','','','','');
INSERT INTO `mac_vod` VALUES('17365','青春的旅途','搜狐高清','qingchundelvtu','Q','','http://photocdn.sohu.com/kis/fengmian/1206/1206745/1206745_ver_big_20160712160007.jpg','http://photocdn.sohu.com/kis/fengmian/1206/1206745/1206745_ver_big_20160712160007.jpg','','李宗雷/何乙轩/姜程程','王俊潾	','喜欢女人,自行车,小两口,玩游戏,青春','搜狐高清','大陆','国语','2016','1','',',691,','0','0','0','0','0','0','0','0','100402','0','0','0','0','0','0','8.0','0','135','1481704282','1482342896','0','0','圣诞节甜甜与闺蜜们玩游戏，抽中独自旅行，甜甜选择去荒凉的大山中旅行。甜甜本以为可以在山中惬意的享受一下宁静，却不成想山中三天两夜，遇到了摩托少年小亮的欺诈，但又被他善良父母的淳朴打动，遇到了身患绝症赶回家看老母亲的工程老板韩峰，遇到了陷入自己狭隘世界无法自拔的阿城，遇到了收山货却很爱贪小便宜的小两口大刚与红璐，遇到了骚扰她，后来撞车死在山路上的潮男周游，遇到了跋山涉水千里迢迢骑着自行车完成梦想的老吕，遇到了离婚后独自生活开始喜欢女人的芳姐。最后她见到了远离都市，过着田园生活的老纪。与闺蜜小梅喝酒终于让她知道安排此次旅行的真正目的。原来这一切都是一个阴谋，也解开了男友与她分手的真正原因。','sohu','','','高清$http://film.sohu.com/album/9150525.html','','','','');
