INSERT INTO `mac_vod` VALUES('17339','导演，我们不约','搜狐高清','daoyanwomenbuyue','D','','http://photocdn.sohu.com/kis/fengmian/1206/1206033/1206033_ver_big_20160526180517.jpg','http://photocdn.sohu.com/kis/fengmian/1206/1206033/1206033_ver_big_20160526180517.jpg','','肖霄/周文羽/魏峰/张帆','周孜凯	','游泳池,朋友,大学,故事,拍摄','搜狐高清','大陆','国语','2016','1','',',630,','0','0','0','0','0','0','0','0','262481','0','0','0','0','0','0','4.0','0','150','1481704237','1482342854','0','0','大学期间，杨帆和钱园在游泳池偷拍梦夏和王璐璐，被发现后两人心虚，说是在拍校园电影，要约梦夏和王璐璐一起拍摄。然而电影拍摄到一半，梦夏发生了意外，导致拍摄无法完成。    毕业后，一直坚持追梦的杨帆约着朋友们，想把大学时的那部电影拍完，但朋友们如今为生计奔波，各忙各的，都不愿意参加。故事在两个时空交错地讲述着，所有人都面临着一个选择：是继续做着看似应该做的事情，还是去做自己真正想要做的事。“难道说我们早晚要放弃做自己吗？也就是说20岁不放弃，30岁还是要放弃；30岁不放弃，40岁还是要放弃。可是我们毕竟才20岁，我们什么都还来得及做。”','sohu','','','高清$http://film.sohu.com/album/9133934.html','','','','');
INSERT INTO `mac_vod` VALUES('17340','孕囧','搜狐高清','yun','Y','','http://photocdn.sohu.com/kis/fengmian/1206/1206079/1206079_ver_big_20160531175011.jpg','http://photocdn.sohu.com/kis/fengmian/1206/1206079/1206079_ver_big_20160531175011.jpg','','王嘉翔/董钒/陈韵芬/任珍/法捷耶娃','张文龙/郝冠来	','月子会所,丈母娘,要孩子,企业家,小两口','搜狐高清','大陆','国语','2016','1','',',710,','0','0','0','0','0','0','0','0','943736','0','0','0','0','0','0','6.0','0','302','1481704238','1482342849','0','0','企业家解大威和程黎新婚后一直想要孩子，用尽各种方法就是怀不上。医院检查后，医生确诊了不育是女方的生理疾病所致，建议代孕养子。于是小两口开始寻找代孕对象。晚饭前的一次意外交流，导致丈母娘卫婴知道了此事，三人一番讨论过后，作出决定，由丈母娘亲自实施代孕！要对外包括程黎公婆在内的所有人封锁消息。此时，传来了解大威的父亲病倒的消息，小两口一急之下谎称程黎已怀孕。公公一下疾病全无。程黎怀孕消息一下子公开后，程黎只能假装怀孕。婆家推算着程黎临盆的日子，来看程黎，程黎刚好想送母亲去月子会所待产，两家相遇，发生了误会和冲突。冲突中，卫婴破水，被紧急送往医院。孩子顺利产下。病房中，三方都进行了反思。解家的父母觉得不应逼儿子生养，小辈也不应欺骗父母。卫婴也道出自己内心中的一个秘密，正是这件事支撑着她一定要帮女儿代孕。','sohu','','','高清$http://film.sohu.com/album/9135175.html','','','','');
