INSERT INTO `mac_vod` VALUES('17325','不良少年','搜狐高清','buliangshaonian','B','','http://photocdn.sohu.com/kis/fengmian/1205/1205913/1205913_ver_big_20160516094507.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205913/1205913_ver_big_20160516094507.jpg','','袁布/齐观/伍萧萧/董灏','王子	','背景音乐,而且,青春,世纪,影片','搜狐高清','大陆','国语','2016','1','',',651,','0','0','0','0','0','0','0','0','880188','0','0','0','0','0','0','4.0','0','385','1481704223','1482342835','0','0','该片根据真实事件改编而成，将观众拉回上个世纪九十年代的小城镇生活。在那个狂放喧嚣的年代，许多触目、细微、不羁的青春痕迹都历历在目，而且真实有力的展现在面前。所有情境随着人物的周遭逐步还原，记忆中熟悉的背景音乐，或许将点燃你对成长片段的真诚回应，让其成为一部青春热血味十足的影片。','sohu','','','高清$http://film.sohu.com/album/9129445.html','','','','');
