INSERT INTO `mac_vod` VALUES('17321','我的房客是天神','搜狐高清','wodefangkeshitianshen','W','','http://photocdn.sohu.com/kis/fengmian/1205/1205898/1205898_ver_big_20160513152024.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205898/1205898_ver_big_20160513152024.jpg','','朱天福/苏童','赵旭	','爱情故事,东方古国,平衡,神界','搜狐高清','大陆','国语','2016','1','',',699,','0','0','0','0','0','0','0','0','504841','0','0','0','0','0','0','8.0','0','354','1481704221','1482342833','0','0','一道闪电打破了少年的平静生活。一个诱人的活动打破了东西方神界的平衡，一套房子和100万现金的奖励使得众位神仙纷纷下界到这个神秘的东方古国，来到一个普普通通少年的家里各施神通。最终因为这个少年的梦想和爱情故事，中西方众神决定鼎力相助。又是因为什么这个少年在众位神仙的帮助下本应拿到冠军而放弃，这个少年的爱情故事又会出现什么样的结局，他会得到最终的奖励吗......','sohu','','','高清$http://film.sohu.com/album/9129415.html','','','','');
INSERT INTO `mac_vod` VALUES('17318','鸟人渣','搜狐高清','niaorenzha','N','','http://photocdn.sohu.com/kis/fengmian/1205/1205939/1205939_ver_big_20160518130503.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205939/1205939_ver_big_20160518130503.jpg','','张国富','张国富	','执法人员,神经质,角色,曙光,阳光','搜狐高清','大陆','国语','2016','1','',',630,','0','0','0','0','0','0','0','0','345695','0','0','0','0','0','0','8.0','0','456','1481704218','1482342836','0','0','嘻嘻哈哈的你我他，为何会在街头乞讨？为何会成为神经质？为何会成为执法人员？站在阳光下而看不到曙光，没有恐惧就不会有希望，现实中的我们总给自己戴着臆想中的“鸟人”光环，然而事实上演绎着一个“人渣”角色……','sohu','','','高清$http://film.sohu.com/album/9130913.html','','','','');
INSERT INTO `mac_vod` VALUES('17317','婚之姻','搜狐高清','hunzhiyin','H','','http://photocdn.sohu.com/kis/fengmian/1205/1205937/1205937_ver_big_20160518112007.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205937/1205937_ver_big_20160518112007.jpg','','刘辉/朱婧雅/谢芳','胡文冰	','村里人,小日子,小店','搜狐高清','大陆','国语','2016','1','',',710,','0','0','0','0','0','0','0','0','412518','0','0','0','0','0','0','2.0','0','393','1481704217','1482342835','0','0','易龙与杨艳本来是一对恩爱夫妻，小日子过得美满幸福。然而，当村里的土地被征收之后，易龙全家获得了一笔征地赔偿款。俗话说：饱暖思淫欲。平时不赌不嫖老实巴交的易龙一夜富起来后开始不安份起来，他经常与同村老相好阿春混在一起。这天晚上一直不见易龙回来，眼看都凌晨两点了，杨艳想起去村小店里买点蚊香。好事的小店主刘姐告诉杨艳，说看到易龙去阿春家里了。杨艳听罢，不由心生疑窦。杨艳二话不说，悄悄来到阿春家，眼前的现实让她惊呆了，果然看到易龙和阿春在里面偷情。杨艳当场将阿春痛骂了一顿，把易龙轰回去。天将亮了，杨艳越想越痛苦，越想越想不开，一怒之下，拿起铁锤趁易龙睡觉之时，狠狠地在易龙头上猛砸，眼看易龙人事不醒，伤心之余，杨艳又跑到小店里买农药喝。刘姐立即叫了村里人来将杨艳和易龙连夜送往医院抢救，结果杨艳的人是抢过来了，易龙成了脑瘫，杨艳悔恨交集，好不容易分来的十几万全花光了，被公安人员戴上了镣铐，走上了铁窗生涯。这征收拆迁之后一夜暴富的农民，为何就经不住生活的诱惑，到头来人财两空，令人深思。','sohu','','','高清$http://film.sohu.com/album/9130906.html','','','','');
INSERT INTO `mac_vod` VALUES('17315','我想静静','搜狐高清','woxiangjingjing','W','','http://photocdn.sohu.com/kis/fengmian/1205/1205895/1205895_ver_big_20160513152003.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205895/1205895_ver_big_20160513152003.jpg','','冷漠/赵小兵/夏望/李嘉雯/陈赫','窦微/刘红民	','小伙伴,爱情,高中,男人,舞台','搜狐高清','大陆','国语','2016','1','',',708,','0','0','0','0','0','0','0','0','393105','0','0','0','0','0','0','10.0','0','429','1481704215','1482342826','0','0','新晋唱片公司老板赵小兵的签约歌手陈幺妹被从小跟他作对的孙紫挖了墙角，小兵黯然神伤和录音师喝酒倾诉，回忆起了高中时期小伙伴的成长，和静静韩梅的朦胧爱情以及和小明创业的辛酸。最后静静回国帮助小兵摆脱困境，重回舞台，一首《我想静静》唱出了男人的辛酸和无奈，以及对美好爱情的向往。','sohu','','','高清$http://film.sohu.com/album/9129409.html','','','','');
INSERT INTO `mac_vod` VALUES('17316','凶夜','搜狐高清','xiongye','X','','http://photocdn.sohu.com/kis/fengmian/1205/1205851/1205851_ver_big_20160510172010.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205851/1205851_ver_big_20160510172010.jpg','','王宏健/张青霞','马凡	','名牌大学,三部曲,毕业生,现代人,城中村','搜狐高清','大陆','国语','2016','1','',',709,','0','0','0','0','0','0','0','0','38183','0','0','0','0','0','0','7.0','0','98','1481704216','1482342828','0','0','出身城中村的女子随凤凰骤然异变，死死压住卫生间马桶盖的新婚丈夫张锋吓坏了！似乎张锋在拼尽全力阻止什么令人惊恐的东西顺马桶爬出来！在闻讯赶来的朋友们面前，随凤凰的脑海中瞬间浮现出不堪回首的往事；正是因为不堪的过去，在认识211名牌大学的优秀毕业生张锋后，她的内心再一次开始在黑暗中挣扎。当她完全对丈夫张峰袒露隐秘的过往之后……事业即将起步的张锋却闯下难以回头的祸端！张锋精神崩溃了！但这一切是真正发生在随风凰生活中的？还是她因自己的经历，疯狂臆想出来的？在黑暗幽深的长道中一切都是那么的诡异！看着随风凰渐渐走向黑暗深处的背影，故事的结束也许才是真正的开始！作为系列IP网络电影《凶夜》三部曲的第一部作品，整部影片就是围绕着心与身的魔障，解读环境与个人在某一特定契机下的应对、状态来传递出作者对当代生活的思考与矛盾。揭示出心与身想分离却缠绕难以摆脱的咬合怪圈。本片对人性的解剖，把现代人的物质富足与精神贫困牢牢地拴在一起，富与贫是那么的纠结与残酷，冰冷与惨烈。在类型元素内刻意放大的关联与离析，造成烧脑、梳理时的巨大障碍，也正是这种梳理把不同文化背景、知识层面、社会认知迥然的观众聚合在一起，在相同的故事观看中根据自己的心得，得到自己的事件认识。','sohu','','','高清$http://film.sohu.com/album/9126549.html','','','','');
INSERT INTO `mac_vod` VALUES('17314','末路狂奔','搜狐高清','molukuangben','M','','http://photocdn.sohu.com/kis/fengmian/1205/1205880/1205880_ver_big_20160512175006.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205880/1205880_ver_big_20160512175006.jpg','','牛文德/朱哲漪','杜文静	','阿娇,秘密,命运','搜狐高清','大陆','国语','2016','1','',',707,','0','0','0','0','0','0','0','0','113738','0','0','0','0','0','0','4.0','0','77','1481704215','1482342833','0','0','城市边缘人物阿三，一次事故中发现自己的生命所剩无几，在心灰意冷的时候他遇到了跟他命运相似的阿娇，阿三疯狂的爱上了她，但随着一步步的靠近，阿三发现了阿娇越来越多的秘密，阿三再一次陷入了疯狂与挣扎，为了拯救阿娇，阿三开始了他的末路狂奔。。。','sohu','','','高清$http://film.sohu.com/album/9128802.html','','','','');
