INSERT INTO `mac_vod` VALUES('17311','我的黑道女友','搜狐高清','wodeheidaonvyou','W','','http://photocdn.sohu.com/kis/fengmian/1205/1205890/1205890_ver_big_20160512174502.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205890/1205890_ver_big_20160512174502.jpg','','张颖/张印/张志豪/刘莉敏','刘含	','小说,杀手','搜狐高清','大陆','国语','2016','1','',',634,','0','0','0','0','0','0','0','0','531048','0','0','0','0','0','0','5.0','0','396','1481704213','1482342829','0','0','陈伟大（张志豪饰）是一名作品无法发表的小说作家，在小说无法出版跟女友分手的双重打击下，与好友麻涛相约喝酒，不料误杀黑帮头号杀手夜叉。不幸被卷入黑帮纷争。与女老大高静（刘莉敏饰）结识，不料确与高静死去的前男友长相十分相似。高静开始慢慢培养陈伟大，并且开始让陈伟大接替自己的位置，在经历种种帮派争斗后，陈伟大终于成功踏上了黑帮之路。','sohu','','','高清$http://film.sohu.com/album/9128823.html','','','','');
INSERT INTO `mac_vod` VALUES('17308','怂人囧事','搜狐高清','songrenshi','S','','http://photocdn.sohu.com/kis/fengmian/1205/1205797/1205797_ver_big_20160505180011.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205797/1205797_ver_big_20160505180011.jpg','','李俊/赵刚/俞佳/刘远向','雷涌	','发廊小姐,李医生,小四川,北京,合伙','搜狐高清','大陆','国语','2016','1','',',686,','0','0','0','0','0','0','0','0','780171','0','0','0','0','0','0','6.0','0','150','1481704211','1482342821','0','0','小四川和表弟来到北京，刚下火车，就被骗进黑剧组。为了扮演一个只有一分钟镜头的角色，表弟交出了身上所有的钱。一心想当影帝的傻刚梦想能接到一部有台词的电影，他靠发廊小姐小玉供养，用小玉给他的钱孝敬戏头。小四川被戏头玷污，又被房东赶出，为生活所迫，不得不以收废品勉强糊口。卖肾集团马仔阿强盯上了他，与李医生合伙将小四川肾脏摘掉。始终接不到戏的傻刚，为了整容，卖掉了自己的肾脏。身心屡遭摧残的小四川，为了揭露黑暗，惩恶扬善，决定将自己的经历拍成电影。','sohu','','','高清$http://film.sohu.com/album/9125252.html','','','','');
