INSERT INTO `mac_vod` VALUES('17310','卢瑟很嚣张','搜狐高清','lusehenxiaozhang','L','','http://photocdn.sohu.com/kis/fengmian/1205/1205872/1205872_ver_big_20160511172003.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205872/1205872_ver_big_20160511172003.jpg','','那朵/张玉轩/顾权','兰城序	','朋友,青年,情侣','搜狐高清','大陆','国语','2016','1','',',613,','0','0','0','0','0','0','0','0','156810','0','0','0','0','0','0','7.0','0','419','1481704212','1482342829','0','0','三十而立的失败青年卢瑟，因为收错快递竟然一夜之间变身土豪。卢瑟这个屌丝平日的夙愿达成，屌丝一夜的逆袭已然上演在自己的身上，半梦半醒间一场土豪生活之旅随之展开。朋友的恭维，现实的嘴脸，态度360°大反转。然而物极必反的规则并没有打破，沉浸在黄粱梦的卢瑟貌似很快就要醒了...一次宿醉之后，肇事的快递员，失主老板的手下，贪财的贼情侣各路追击卢瑟。突增的危机四伏，卢瑟将逢凶化吉还是原形毕露，这意外之财是上天对卢瑟怜悯的眷顾还是恶意的调笑？重新选择的的卢瑟最终翻开新的人生篇章。','sohu','','','高清$http://film.sohu.com/album/9128121.html','','','','');
INSERT INTO `mac_vod` VALUES('17306','校园之恋','搜狐高清','xiaoyuanzhilian','X','','http://photocdn.sohu.com/kis/fengmian/1205/1205798/1205798_ver_big_20160505180007.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205798/1205798_ver_big_20160505180007.jpg','','张卓霖/汪小壹/范云飞/张皓瑒','王子	','主人公,爱情,情感,校园,暗号','搜狐高清','大陆','国语','2016','1','',',671,','0','0','0','0','0','0','0','0','262280','0','0','0','0','0','0','3.0','0','242','1481704211','1482342820','0','0','主人公闫帅、夏草可能是因为月老的眷顾，在大学校园那么多同学中以短信方式冥冥相恋，却因为这样独特的方式，俩人在第一次正式面对面时却鬼使神差的变换了男主人公。蹊跷的爱情暗号和剧情的曲折发展，使这对‘恋人’数次擦肩，当谜底揭开的那一瞬间他们还能继续最初的情感吗？','sohu','','','高清$http://film.sohu.com/album/9125254.html','','','','');
INSERT INTO `mac_vod` VALUES('17307','痴情泪','搜狐高清','chiqinglei','C','','http://photocdn.sohu.com/kis/fengmian/44/44714/44714_ver_big_20160509112002.jpg','http://photocdn.sohu.com/kis/fengmian/44/44714/44714_ver_big_20160509112002.jpg','','叶枫/凌云/张翼/冯宝宝','秦剑	','日久生情,交际花,钢琴,教师,生日','搜狐高清','香港','国语','2016','1','',',618,','0','0','0','0','0','0','0','0','494387','0','0','0','0','0','0','6.0','0','142','1481704211','1482342821','0','0','交际花白丽兰，艳名四播，乃为生活强颜欢笑，一切受其干爹杜兰亭支配，丽兰与爱女小兰相依为命，并将之寄养姊姊家中聘请教师张志萍教授钢琴。丽兰的生日舞会上，张志萍被聘演奏，方知丽兰之双重生活，不料丽兰演唱之际因肺病而晕倒，志萍时往探视，两人亦日久生情。事为兰亭所知，命学校将志萍开除，志萍之母苦求丽兰远离志萍，丽兰遂含泪出走。','sohu','','','高清$http://film.sohu.com/album/5113821.html','','','','');
INSERT INTO `mac_vod` VALUES('17304','阿里巴巴和四十大盗','搜狐高清','alibabahesishidadao','A','','http://photocdn.sohu.com/kis/fengmian/16/16358/16358_ver_big_20160509104503.jpg','http://photocdn.sohu.com/kis/fengmian/16/16358/16358_ver_big_20160509104503.jpg','','费南代尔/DieterBorsche/SamiaGamal','雅克·贝克	','阿里巴巴','搜狐高清','法国','法语','2016','1','',',641,','0','0','0','0','0','0','0','0','903790','0','0','0','0','0','0','4.0','0','115','1481704210','1482342820','0','0','憨厚乐观的阿里巴巴（Fernandel 饰）是卡西莫老爷的仆役，这日奉命去集上买回舞女莫尔基拉（Samia Gamal 饰）。卡西莫对舞女欲行不轨，阿里巴巴施计救出莫尔基拉，在为莫尔基拉购买宠物的路上，四十大盗打劫驼队，阿里巴巴藏身藤笼，混进盗贼藏宝的洞穴并记下开门口诀。凭洞中数之不尽的金银珠宝，阿里巴巴摇身一变成为阿里老爷，并与莫尔基拉结为伉俪。听到风声的四十大盗头领登门试探，同时藏身酒窖的盗贼们跃跃欲试，准备在宴会上夺回宝藏。虔诚的阿里巴巴相信，真主将这笔财富交托给他，是有独到的用心。','sohu','','','高清$http://film.sohu.com/album/5078598.html','','','','');
INSERT INTO `mac_vod` VALUES('17305','不了情','搜狐高清','buliaoqing','B','','http://photocdn.sohu.com/kis/fengmian/19/19688/19688_ver_big_20160509105003.jpg','http://photocdn.sohu.com/kis/fengmian/19/19688/19688_ver_big_20160509105003.jpg','','林黛/杨志卿/关山/蒋光超/高宝树','陶秦	','夜总会,朋友,海边','搜狐高清','香港','国语','2016','1','',',623,','0','0','0','0','0','0','0','0','351940','0','0','0','0','0','0','5.0','0','227','1481704211','1482342821','0','0','乡村少女李青青到城中寻访舅父，因而结识了年青有为的汤鹏南。得汤鹏南之助，青青成为夜总会的红歌星，两人渐生情愫。　　汤父去世，汤才察觉公司与家庭面临经济困境，青青不忍见对方意志消沉，而借助另一富商的借贷以助汤解困。她答应与富商周游列国以报答，难以向汤解释只有选择失踪。数年后两人重逢，汤不明青青所受的委屈难原谅她。最后经朋友调解，汤知道错怪了青青而重修旧好。　　此时青青却发觉自己患了不治之症，免拖累汤，她选择离开隐居在海边小屋，独自面对死亡。最后汤找到青青，她咽下最后一口气时，汤陪伴在侧。','sohu','','','高清$http://film.sohu.com/album/5129343.html','','','','');
INSERT INTO `mac_vod` VALUES('17303','贼大胆儿','搜狐高清','zeidadaner','Z','','http://photocdn.sohu.com/kis/fengmian/1205/1205748/1205748_ver_big_20160429151032.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205748/1205748_ver_big_20160429151032.jpg','','刘骥/聂毛/王卿伟','孟凯	','剧情片,骨灰盒,拍卖会,大众,风水','搜狐高清','大陆','国语','2016','1','',',704,','0','0','0','0','0','0','0','0','424497','0','0','0','0','0','0','6.0','0','171','1481704210','1482342819','0','0','该片为悬疑、搞笑、荒诞、惊悚、推理的青春剧情片，适合现代大众人群观看；故事主要讲述：一场荒诞的拍卖会上，一个高价骨灰盒，被两个人拍成了天价，富商在拍到骨灰盒后，由于幸福过度猝死。富商死后，家人找到风水先生范大师选择安葬之地，用拍得骨灰盒为其安葬，又雇佣保全公司看管。三个无业者看到了这个天价骨灰盒消息后，起了盗窃之心，觉得是他们改变人生机会来了，所以他们与保全人员的周旋，搞笑一个接着一个，他们又是怎么样从富商的坟墓里盗出了价值2000万元的骨灰盒呢？','sohu','','','高清$http://film.sohu.com/album/9124525.html','','','','');
INSERT INTO `mac_vod` VALUES('17302','长腿姐姐','搜狐高清','changtuijiejie','C','','http://photocdn.sohu.com/kis/fengmian/1142/1142668/1142668_ver_big_20160509135503.jpg','http://photocdn.sohu.com/kis/fengmian/1142/1142668/1142668_ver_big_20160509135503.jpg','','叶枫/蒋光超/刘恩甲','唐煌	','堕入爱河,恋爱对象,富家子,代理商,生日会','搜狐高清','香港','国语','2016','1','',',630,','0','0','0','0','0','0','0','0','483676','0','0','0','0','0','0','9.0','0','381','1481704209','1482342819','0','0','长腿姑娘胡亭亭沉默内向，妹彬彬则活泼好动。亭因性格高傲，迟迟未有恋爱对象，令母陈静芳焦急万分。芳为求攀龙附凤，强逼丈夫与女儿出席富贵友人的生日会。宴会上，姊妹俩结织了富家子金却利和车行工人小金。利向亭，彬大献殷勤，亭不屑一顾，反而对忠厚朴实的金萌生好感，二人旋即堕入爱河，却遭劫利的芳反对。利转而追求彬，被顽皮的彬连番戏弄，吃尽苦头。后芳得知金实为车行代理商的儿子，遂欣然接受金与亭的婚事。','sohu','','','高清$http://film.sohu.com/album/9126514.html','','','','');
INSERT INTO `mac_vod` VALUES('17300','血溅牡丹红','搜狐高清','xuejianmudanhong','X','','http://photocdn.sohu.com/kis/fengmian/1063/1063034/1063034_ver_big_20160509134503.jpg','http://photocdn.sohu.com/kis/fengmian/1063/1063034/1063034_ver_big_20160509134503.jpg','','叶枫/金汉/蓝娣','何梦华	','革命党,华为,军事','搜狐高清','香港','国语','2016','1','',',613,','0','0','0','0','0','0','0','0','973498','0','0','0','0','0','0','1.0','0','322','1481704209','1482342818','0','0','民国初年，军阀曹霖割据华北施行暴政，有志之士组织地下革命党，推行推翻暴政工作。绰号红牡丹的歌女唐佩华与学生林克强相爱，大帅曹霖垂涎华美色，诬陷强为革命党。华为拯救强，被逼做霖的七姨太。其后强与华妹佩芸加入革命党，乘霖摆寿宴潜入曹府，得华帮助窃取霖的军事机密文件。霖大怒，派兵围捕众人，强掩护芸和同党离去。最后强被抢毙，华于混乱中杀死霖，但也身中多枪，与强相拥而逝。','sohu','','','高清$http://film.sohu.com/album/9126512.html','','','','');
INSERT INTO `mac_vod` VALUES('17301','古宅艳尸','搜狐高清','guzhaiyanshi','G','','http://photocdn.sohu.com/kis/fengmian/1205/1205799/1205799_ver_big_20160505180004.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205799/1205799_ver_big_20160505180004.jpg','','简佳琳','丁惟	','年轻女人','搜狐高清','大陆','国语','2016','1','',',632,','0','0','0','0','0','0','0','0','684040','0','0','0','0','0','0','8.0','0','150','1481704209','1482342819','0','0','古老的院落，滴答的流水声，悬梁上的女人。乡下的深山中，有一座宋氏老宅，是宋茜祖上的产业。可是宋茜从小到大都被严禁靠近那所宅子。当宋茜问起原因时，所有人都支支吾吾，不愿说出实情，宋茜偷偷潜入老宅，揭开了一个年轻女人在封建社会残酷的身世。','sohu','','','高清$http://film.sohu.com/album/9125256.html','','','','');
INSERT INTO `mac_vod` VALUES('17297','山歌恋','搜狐高清','shangelian','S','','http://photocdn.sohu.com/kis/fengmian/44/44706/44706_ver_big_20160509133003.jpg','http://photocdn.sohu.com/kis/fengmian/44/44706/44706_ver_big_20160509133003.jpg','','叶枫/欧阳莎菲/张石庵','罗臻	','爱情故事,帆船,老虎,青年','搜狐高清','香港','国语','2016','1','',',703,','0','0','0','0','0','0','0','0','823047','0','0','0','0','0','0','7.0','0','26','1481704208','1482342822','0','0','一出动人的爱情故事。牧羊姑娘古秀秀（叶枫 饰）喜唱山歌，惟父亲古老头嗜赌如命；青年刘大龙（关山 饰）自置帆船，运货于县城与小镇之间。秀秀与大龙时以山歌对唱，情愫互生。曾老虎（朱牧 饰）欲娶秀秀，以魏癞子为媒，并以追债要挟古老头许婚；大龙知情，冒险运货入城，冀以报酬替古老头还债。怎知大龙帆船归来，蓬穿船烂，大龙失踪！古老头既无钱还债，秀秀亦以为大龙已死，无奈答允下嫁曾老虎。','sohu','','','高清$http://film.sohu.com/album/5064819.html','','','','');
