INSERT INTO `mac_vod` VALUES('17299','体育皇后','搜狐高清','tiyuhuanghou','T','','http://photocdn.sohu.com/kis/fengmian/1132/1132831/1132831_ver_big_20160509134003.jpg','http://photocdn.sohu.com/kis/fengmian/1132/1132831/1132831_ver_big_20160509134003.jpg','','丁皓/雷震/罗维','唐煌	','篮球队,农家女,球场,学校','搜狐高清','香港','国语','2016','1','',',630,','0','0','0','0','0','0','0','0','523088','0','0','0','0','0','0','8.0','0','180','1481704208','1482342818','0','0','农家女郭素娥入城读书，因一身土气，饱受同学欺负。娥偶然在体育比赛中展露潜质，获邀加入篮球队，从此纵横球场，带领球队赢尽比赛，令同学刮目相看。娥却因而耽误了学业，致考试不及格，遭父亲老坤痛斥。娥得同学兄长周昌杰恶补功课，终补考及格，自此不再参加篮球比赛。学校的球队在校际比赛中连场败北，校长急请坤夫妇观看球赛，坤见球队表现不振，即命娥上阵。娥在父母支持下，终带领球队反败为胜，并赢得‘体育皇后’的美誉。','sohu','','','高清$http://film.sohu.com/album/9126510.html','','','','');
INSERT INTO `mac_vod` VALUES('17295','美人计','','meirenji','M','','http://photocdn.sohu.com/kis/fengmian/7/7587/7587_ver_big_20160509115503.jpg','http://photocdn.sohu.com/kis/fengmian/7/7587/7587_ver_big_20160509115503.jpg','','路易斯·卡尔亨/英格丽·褒曼/加里·格兰特','阿尔弗雷德·希区柯克	','亚历克斯,佛罗里达,开车兜风,陌生人,美国','','美国','英语','2016','1','',',676,','0','0','0','0','0','0','0','0','892036','0','0','0','0','0','0','7.0','0','76','1481704207','1482344868','0','0','1946年4月，佛罗里达法庭判德国间谍约翰·赫伯曼20年徒刑。约翰开朗、热情、迷人的女儿莉亚·赫伯曼对父亲的罪恶既反感又痛苦，从法庭回家后找来朋友以小型舞会驱除烦恼，一个陌生的不速之客出现了。凌晨，所有人都醉倒以后，醉酒的莉亚拉着这个陌生人开车兜风，在警察拦截之后才发现这个陌生人是为美国情报部门工作的官员迪普。    早晨，莉亚醒来，在迪普的说服下，答应为国家效力。两人来到纳粹余孽聚集的巴西里约，在那里得到了约翰在狱中自杀身亡的消息。很快，迪普和莉亚共坠爱河。就在此时，迪普接到命令，莉亚要诱惑纳粹首脑亚历克斯·契巴斯以取得情报。迪普以国家利益为重，让莉亚去执行任务，莉亚却以为迪普并不爱她。    聪明机警的莉亚利用父亲的老关系很快得到契巴斯的信任和爱情，在对迪普的失望和上级的指示下，莉亚答应了契巴斯的求婚。婚后的莉亚为情报部门探听出不少重要情报，并感到家中的酒窖很可疑。迪普借莉亚开舞会的机会来到契巴斯家，莉亚为他弄到酒窖的钥匙，他们查出酒窖中有装有矿石的红酒。契巴斯察觉了莉亚偷了自己的钥匙，明白了莉亚的身份和企图，十分愤怒。    为了不被纳粹同伙知道自己曾泄漏了机密，契巴斯在母亲的授意下给莉亚服用了慢性毒药，企图让她在不知不觉中死去。莉亚后来虽然察觉了这个秘密，但连逃出的力气都没有。    迪普发觉情形不对，来到契巴斯家探听情况，并利用契巴斯母子不能向纳粹同伙泄漏秘密的弱点，成功把莉亚救了出来。莉亚还带出纳粹集团采掘铀矿的秘密，而契巴斯母子则要接受纳粹分子严厉的制裁。','sohu$$$qq','$$$','$$$','高清$http://film.sohu.com/album/224.html$$$01$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/w0022v8i6ii.html#02$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/p0022waajnw.html#03$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/p0022ko73wg.html#04$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/f0022uzufv2.html#05$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/g0022m3h03m.html#06$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/n0022jqn3yc.html#07$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/d0022qqafvm.html#08$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/w0022tgezx2.html#09$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/i00222d2lrv.html#10$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/y0022j0k3j0.html#11$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/b00229ywyqj.html#12$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/i0022ezwwz9.html#13$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/n0022cb0kn0.html#14$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/y0022j7e604.html#15$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/v0022f0jvd2.html#16$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/v0022vitsxl.html#17$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/w00224b0s3z.html#18$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/y0022rjqpjp.html#19$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/f0022o1s2mn.html#20$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/y0022vdq10h.html#21$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/e00221bqv3o.html#22$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/b0022dq2edy.html#23$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/v002209szon.html#24$http://v.qq.com/x/cover/eqrjlmqa0x66vr7/z0022nxqzxk.html','','','','');
INSERT INTO `mac_vod` VALUES('17296','教我如何不想她','搜狐高清','jiaoworuhebuxiangta','J','','http://photocdn.sohu.com/kis/fengmian/1142/1142803/1142803_ver_big_20160509114003.jpg','http://photocdn.sohu.com/kis/fengmian/1142/1142803/1142803_ver_big_20160509114003.jpg','','蒋光超/葛兰/麦玲','易文/王天林	','歌舞团,日本,如何,前途,事业','搜狐高清','香港','国语','2016','1','',',703,','0','0','0','0','0','0','0','0','730957','0','0','0','0','0','0','6.0','0','61','1481704208','1482342817','0','0','李美心与杜子平是一对同在小歌舞团工作的爱侣。平为了前途，抛下以身相许的心，远赴日本学艺。心悲痛之余，加入了一旅行歌舞团，寄情事业。团长金石鸣赏识心，欲培养她成为台柱。歌舞团载誉归来，心亦走红，却发现怀了平的孩子。鸣为了歌舞团与心的声誉，与心结婚。平学成回来，与心重遇，且同台演出。平欲再续前缘，心感念鸣的恩情，多番拒绝，最后在台上演出时，不堪平的纠缠，从升降板上失足堕下，香消玉殒，心的首本名曲“教我如何不想她”从此成为绝唱。','sohu','','','高清$http://film.sohu.com/album/9126207.html','','','','');
