INSERT INTO `mac_vod` VALUES('17294','非法同居','搜狐高清','feifatongji','F','','http://photocdn.sohu.com/kis/fengmian/1205/1205781/1205781_ver_big_20160504145007.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205781/1205781_ver_big_20160504145007.jpg','','刘苗/王禹添/阿含','惠祥意	','日常生活,生活琐事,曾经拥有,青春,影片','搜狐高清','大陆','国语','2016','1','',',613,','0','0','0','0','0','0','0','0','457183','0','0','0','0','0','0','1.0','0','138','1481704206','1482342818','0','0','也许我们的生活有过苦涩，但更多的是美好的甜蜜,在这个浮躁的世界，我们是否珍惜过我们曾经拥有的一切。影片描述了婚后的于蕾和胡乐由于种种生活琐事逐渐地对对方失去了耐心，离婚后的他们又不得不住在一起，分开后的他们通过啼笑皆非日常生活的点滴唤起了彼此对过往青春美好的回忆，到底是什么让他们迷失了自己，他们未来的路又会在哪里。','sohu','','','高清$http://film.sohu.com/album/9125209.html','','','','');
