INSERT INTO `mac_vod` VALUES('17286','修女也疯狂2','搜狐高清','xiunvyefengkuang2','X','','http://photocdn.sohu.com/kis/fengmian/4/4050/4050_ver_big_20160419125502.jpg','http://photocdn.sohu.com/kis/fengmian/4/4050/4050_ver_big_20160419125502.jpg','','乌比·戈德堡/詹姆斯·柯本/玛丽·威克斯','比尔·杜克	','拉斯韦加斯,修女也疯狂,青少年','搜狐高清','美国','英语','2016','1','',',613,','0','0','0','0','0','0','0','0','453582','0','0','0','0','0','0','5.0','0','387','1481704199','1482342813','0','0','在这一集里，狄乐丝正成为拉斯韦加斯的知名歌手，而在上一集里与她同患难共欢乐的修女们也被调至一个社区学校服务。但是，那里的青少年实在不好对付，与拘于传统的修女们简直是水火不容，没精神时，这些学生就打瞌睡，有了精神他们又该捣乱破坏了。没有办法，修女们只好请狄乐丝再度出山。一开始，那些冥顽不灵的学生拿她不当回事，照样想尽各种办法整她，出她的洋相。但是，很快他们就领教了狄乐丝厉害，因为他们发现，凡是射向狄乐丝的箭最终都向自己身上射来。这一下，连最顽皮的孩子也服了。正当孩子们的乐队参加一次大赛时，狄乐丝身份又成了问题……','sohu','','','高清$http://film.sohu.com/album/1010478.html','','','','');
INSERT INTO `mac_vod` VALUES('17287','浪男队','搜狐高清','langnandui','L','','http://photocdn.sohu.com/kis/fengmian/1205/1205604/1205604_ver_big_20160419164010.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205604/1205604_ver_big_20160419164010.jpg','','迈克尔·罗森巴姆/哈兰德·威莱姆斯/巴里·沃森','华莱士·沃罗达斯基	','学生公寓,女孩儿,会员,朋友,联谊','搜狐高清','美国','英语','2016','1','',',630,','0','0','0','0','0','0','0','0','234708','0','0','0','0','0','0','10.0','0','71','1481704199','1482342813','0','0','戴夫、亚当和杜弗本来是三个以捉弄女孩儿为乐的坏小子，他们因为胡乱花钱而破产，即将被学生公寓扫地出门。他们找到了一家免费公寓，但只对本校女生联谊组织Delta Omicron Gamma的会员开放。 三人迫不得已，决定假扮女生，变成戴茜、娅迪娜和罗贝塔加入D.O.G。在那里，他们见到了女孩儿们的真实一面，也体验了被讨厌男生欺负的尴尬，更加理解女孩，交到了许多好朋友。','sohu','','','高清$http://film.sohu.com/album/9120683.html','','','','');
INSERT INTO `mac_vod` VALUES('17285','惊声尖笑4','搜狐高清','jingshengjianxiao4','J','','http://photocdn.sohu.com/kis/fengmian/16/16781/16781_ver_big_20160419124502.jpg','http://photocdn.sohu.com/kis/fengmian/16/16781/16781_ver_big_20160419124502.jpg','','安东尼·安德森/克雷格·比尔克/比尔·普尔曼/雷吉娜·赫尔/安娜·法瑞丝','大卫·扎克	','外星人入侵,逃出生天,坎贝尔,惊声尖笑,Anna','搜狐高清','美国','英语','2016','1','',',630,','0','0','0','0','0','0','0','0','870271','0','0','0','0','0','0','8.0','0','46','1481704198','1482342812','0','0','经历了好友之死和几多悲惨恐怖的过去，辛蒂.坎贝尔（Anna Faris 饰）决心开始新的人生。她受聘来到一所闹鬼的房子里照顾一位行动不便的老妇人，笨手笨脚的辛蒂好心办坏事，使得老妇人灾难连连。而这座鬼屋也绝非徒有虚名，一个因被杀而冤魂不散的男孩不时出现，希望辛蒂帮他找到真正的凶手。　　在这所房子的旁边住着失败的父亲汤姆.瑞恩（Craig Bierko 饰），他正和一双儿女共度周末。一来二去的交谈过后，汤姆与辛蒂坠入爱河。就在此时，恐怖的外星人入侵地球，他们欲将人类彻底消灭。辛蒂和汤姆如何才能逃出生天？','sohu','','','高清$http://film.sohu.com/album/1010337.html','','','','');
INSERT INTO `mac_vod` VALUES('17282','别有洞天','搜狐高清','bieyoudongtian','B','','http://photocdn.sohu.com/kis/fengmian/1090/1090421/1090421_ver_big_20160419143003.jpg','http://photocdn.sohu.com/kis/fengmian/1090/1090421/1090421_ver_big_20160419143003.jpg','','乔恩·沃伊特/希亚·拉博夫/西格妮·韦弗','安德鲁·戴维斯	','黑色幽默,少年犯,管理者,斯坦利,个性','搜狐高清','美国','英语','2016','1','',',696,','0','0','0','0','0','0','0','0','72438','0','0','0','0','0','0','3.0','0','465','1481704197','1482342806','0','0','故事主角是一位名叫斯坦利的少年，就像是宿命注定，他家好几代一直都很倒霉，所以当他因为审判不公而被判偷窃罪时，他一点也不感到意外，他知道，这只不过是自己悲惨命运的一部分而已。法官给了斯坦利一个选择服刑的地点的机会，他选择了名字好听一点的绿湖营，可他没想到的是，这却是更悲惨命运的开始。位于沙漠的绿湖营根本就没有什么湖，监狱管理者要这些少年犯每天在干涸的河床上挖一个大洞，这些明明毫无意义的苦工，管理者说是为了磨练他们的个性，但斯坦利却觉得他们动机并不单纯，决定要挖出真相。后来才发现原来那些管理者根本是为了埋藏在河床之下的宝藏，更没想到生命中许多事情真的就是宿命的安排，甚至在好几代以前就已经决定一切了！这是一个关于罪罚救赎、命运轮回的黑色幽默故事，一个个盘根错节的谜团，随着情节发展一一从洞中被挖出来！','sohu','','','高清$http://film.sohu.com/album/9120687.html','','','','');
INSERT INTO `mac_vod` VALUES('17283','惊曝内幕','搜狐高清','jingpunamu','J','','http://photocdn.sohu.com/kis/fengmian/0/393/393_ver_big_20160419115503.jpg','http://photocdn.sohu.com/kis/fengmian/0/393/393_ver_big_20160419115503.jpg','','罗素·克洛/阿尔·帕西诺','迈克尔·曼	','克里斯托弗,节目主持人,单打独斗,医疗保险,华莱士','搜狐高清','美国','英语','2016','1','',',698,','0','0','0','0','0','0','0','0','213592','0','0','0','0','0','0','9.0','0','13','1481704197','1482342807','0','0','劳埃尔·伯格曼(艾尔·帕西诺 饰)是CBS电视台“60分钟”节目的王牌制作人，和德高望重的节目主持人迈克·华莱士(克里斯托弗·普拉默 饰)向来合作无间。乔佛瑞·维根(罗素·克罗 饰)刚被大烟草公司解雇，他的人生似乎瞬间坠入谷底。伯格曼收到一份显示烟草公司制造的香烟对人体有害的报告，找到维根来翻译。然而从这个时候开始，维根便感觉到有人在跟踪监视自己，并给家人带来极大的威胁。烟草公司提醒维根与自己签署的保密协议，他将不能公开任何有关香烟制造的研究给公众。维根不想失去医疗保险等等对家人生活的保障，然而又在备受良心拷问。他最终决定向外界宣布这一切，即使违反保密协议。他先和伯格曼录制了一集“60分钟”栏目，然后前往密西西比州出庭作证控告烟草公司。　　然而，烟草公司比他更快一步申请了言论禁制令，他妻子带着两名女儿离去，“60分”栏目又遭到CBS禁播。这一切巨大的代价让人压不过气。维根和伯格曼成了单打独斗的勇士，他们面对内心的正义、勇敢，并一直坚持。','sohu','','','高清$http://film.sohu.com/album/5136879.html','','','','');
INSERT INTO `mac_vod` VALUES('17284','神秘美人鱼','','shenmimeirenyu','S','','http://photocdn.sohu.com/kis/fengmian/1205/1205669/1205669_ver_big_20160422141026.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205669/1205669_ver_big_20160422141026.jpg','','郜小良/刘小乔','薛少	','美人鱼,大海,教练','正片','大陆','国语','2016','1','',',630,','0','0','0','0','0','0','0','0','813288','0','0','0','0','0','0','3.0','0','469','1481704197','1482352429','0','0','紫浠是一条来自大海的美人鱼，因为大海被污染，来到了人类的世界，寻找变成人类的方法，她在陆地上以热身教练的身份来隐藏自己，而就在她在陆地上当教练的时候，遇到了呆呆傻傻的阿飞，阿飞看到了紫浠，爱上了她，可是紫浠却一心只想找变成人类的方法，就在阿飞死缠烂打的追紫浠的时候，大海里的另一个族类阿黑也来到了岸上，找寻变成人类的方法的同时，也要杀了紫浠，就在最后一刻，阿黑要杀紫浠的时候，阿飞冲了出来，救了紫浠一命，而紫浠，也变成了人类。','sohu$$$youku','$$$','$$$','高清$http://film.sohu.com/album/9122257.html$$$http://v.youku.com/v_show/id_XMTU1ODk1OTc2NA==.html','','','','');
INSERT INTO `mac_vod` VALUES('17280','妈妈在哪里','搜狐高清','mamazainali','M','','http://photocdn.sohu.com/kis/fengmian/1205/1205755/1205755_ver_big_20160429151003.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205755/1205755_ver_big_20160429151003.jpg','','王丹/王枫/朱玲','严涵/陈玺文	','感恩母亲,男主角,老人家,女主角,音乐人','搜狐高清','大陆','国语','2016','1','',',613,','0','0','0','0','0','0','0','0','539601','0','0','0','0','0','0','3.0','0','233','1481704195','1482342805','0','0','影片讲述成功音乐人王枫（男主角）60多岁的母亲独身一人不辞辛苦……千里迢迢从河南老家坐火车来到广州与儿子、孙女们一起团聚过年。王枫欲趁此机会介绍与自己恋爱多年的徐梦娇（女主角）给家人认识，不料两个女儿均不乐意。母亲默默地用行动支持王枫，王枫感恩母亲创作了一首歌《妈妈在哪里》，并准备在年三十晚在会所演唱。不料，年三十早上老人家早早离家，不知去向。','sohu','','','高清$http://film.sohu.com/album/9124538.html','','','','');
INSERT INTO `mac_vod` VALUES('17281','相见恨早','搜狐高清','xiangjianhenzao','X','','http://photocdn.sohu.com/kis/fengmian/1169/1169948/1169948_ver_big_20160420093503.jpg','http://photocdn.sohu.com/kis/fengmian/1169/1169948/1169948_ver_big_20160420093503.jpg','','阿曼达·皮特/塔恩·曼宁/艾什顿·库彻','奈吉·柯尔	','年轻男女,洛杉矶,奥利弗,小伙子,艾米','搜狐高清','美国','英语','2016','1','',',626,','0','0','0','0','0','0','0','0','302870','0','0','0','0','0','0','7.0','0','448','1481704196','1482342809','0','0','两个年轻男女在洛杉矶到纽约的航班上的偶遇。奥利弗是一个刚刚从大学中毕业的小伙子，他聪明机敏，并且踌躇满志，对于自己的未来——事业成功以及寻找到真爱——有着周密的规划。艾米丽则是一个个性张扬的女孩，她的自我意识非常的强烈，并且在她的生活中充斥着自相矛盾的观点和选择。虽然初次见面让两个人的心中都泛起了涟漪，但奥利弗和艾米丽都清楚的认识到，长久相处并不属于他们。 虽然在短暂的相处之后，奥利弗和艾米丽又各自行走在自己的生活轨道上，但两个人在对方心中所留下的影子却长久的挥之不去。经过了初次见面时的怦然心动之后，年复一年，从一个城市到另一个城市，他们又多次的见面、然后就是分离。随着时间流逝，这对小冤家慢慢变成了无话不谈的好朋友。虽然他们能共同拥有激情，但是两人似乎总是阴差阳错地和爱情擦肩而过，最终总是会有充分的理由离开对方。 可是，冥冥中仍然有一种说不清的力量一次又一次将他们两人聚在一起。他们一起聚餐，一起跳舞，一起笑出胸中的烦闷。他们互相倾诉，一起缠绵，在野外享受激情的夜晚…… 在七年之后，奥利弗终于意识到了其实艾米丽才是他真正寻找的女孩。于是，他带着新买的吉他，在艾米丽的门前唱了一曲Bon Jovi著名的歌曲《I&#039;ll be there for you》。经过了漫长的七年，有情人终于牵手。 浪漫是什么？浪漫就是毁灭友情，建立爱情。','sohu','','','高清$http://film.sohu.com/album/9121804.html','','','','');
INSERT INTO `mac_vod` VALUES('17278','那些年唐伯虎追的女票2','搜狐高清','naxieniantangbohuzhuidenvpiao2','N','','http://photocdn.sohu.com/kis/fengmian/1205/1205512/1205512_ver_big_20160413163503.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205512/1205512_ver_big_20160413163503.jpg','','','','','搜狐高清','大陆','国语','2016','1','',',674,','0','0','0','0','0','0','0','0','281630','0','0','0','0','0','0','4.0','0','310','1481704193','1482342808','0','0','','sohu','','','高清$http://tv.sohu.com/20160503/n447352255.shtml','','','','');
INSERT INTO `mac_vod` VALUES('17279','魔境仙踪','搜狐高清','mojingxianzong','M','','http://photocdn.sohu.com/kis/fengmian/91/91893/91893_ver_big_20160503140004.jpg','http://photocdn.sohu.com/kis/fengmian/91/91893/91893_ver_big_20160503140004.jpg','','米拉·库妮丝/蕾切尔·薇姿/詹姆斯·弗兰科/米歇尔·威廉姆斯','山姆·雷米	','女人偷情,热气球,魔法师,西奥多,东方','搜狐高清','美国','英语','2016','1','',',693,','0','0','0','0','0','0','0','0','493448','0','0','0','0','0','0','9.0','0','313','1481704195','1482342804','0','0','一个卖蛇油的打扮成魔法师走街串巷推销他的产品，他和一个女人偷情，结果被这个女人的丈夫发现，不得已坐上了热气球。他来到了奥兹国，成为“奥兹国的魔法师”。他还爱上了“北方好女巫”格林达，并和她一起对抗“东方坏女巫”伊瓦诺拉和“西方坏女巫”西奥多拉。西奥多拉本来也是好女巫，但被奥兹甩了以后，真正的坏女巫伊瓦诺拉说服了她变坏，并让其帮助自己统治整个奥兹国……','sohu','','','高清$http://film.sohu.com/album/5026532.html','','','','');
INSERT INTO `mac_vod` VALUES('17277','隐形人','搜狐高清','yinxingren','Y','','http://photocdn.sohu.com/kis/fengmian/215/215849/215849_ver_big_20160419105005.jpg','http://photocdn.sohu.com/kis/fengmian/215/215849/215849_ver_big_20160419105005.jpg','','米歇尔·哈里逊/玛格丽塔·莱维瓦/克里斯·马奎特/贾斯汀·查特文','大卫·S·高耶	','贾斯汀,Justin,优等生,伊娃,朋友','搜狐高清','美国','英语','2016','1','',',692,','0','0','0','0','0','0','0','0','858411','0','0','0','0','0','0','5.0','0','195','1481704191','1482342807','0','0','尼克（贾斯汀?钱特温 Justin Chatwin 饰）出生于富足的家庭，亦是学校里的优等生。他梦想着可以成为诗人，但他的母亲却早已为他安排了以后的人生。他希望通过自己的努力去实现梦想。安妮（玛格丽塔?列维伊娃 Margarita Levieva 饰）和尼克在同一所高中，是一个问题少女，受家庭影响，终日游手好闲。在一宗偷窃案中，安妮被男友出卖，却误认为是尼克告的密，遂与一帮朋友将尼克拖入树林暴打一顿。转天，尼克像往常一样去学校上课，却发现自己变成了幽灵一般的隐形人。','sohu','','','高清$http://film.sohu.com/album/9120677.html','','','','');
INSERT INTO `mac_vod` VALUES('17275','夜色','搜狐高清','yese','Y','','http://photocdn.sohu.com/kis/fengmian/1045/1045794/1045794_ver_big_20160412102503.jpg','http://photocdn.sohu.com/kis/fengmian/1045/1045794/1045794_ver_big_20160412102503.jpg','','卢宾·布雷兹/布鲁斯·威利斯/斯科特·巴库拉/珍·玛奇','理查德·拉许	','洛杉矶,布鲁斯,心理医生,威利斯,哥哥','搜狐高清','美国','英语','2016','1','',',691,','0','0','0','0','0','0','0','0','399667','0','0','0','0','0','0','6.0','0','275','1481704190','1482342800','0','0','年轻的心理医生比尔（布鲁斯威利斯 饰）因为病人蜜雪在他面前跳窗自杀，深受打击。为了抚平自己波动的情绪，他来到洛杉矶，找到他的老友鲍伯。鲍伯也是心理医生，他将一些病人聚在周一训练他们能舒坦的面对其它人，但次日，鲍伯被残酷地谋杀了，身中38刀。比尔开始调查，发现一名叫萝丝（雅内马奇 饰）的神秘女子，比尔找到萝丝，得知她患有三重分裂人格，并受人控制。原来控制萝丝的竟然是她的哥哥，她的哥哥由于痛失自己的亲弟弟，于是，强迫萝丝装扮成已死的弟弟。当比尔发现了这一切，萝丝的哥哥也开始向他下手了。','sohu','','','高清$http://film.sohu.com/album/9118914.html','','','','');
INSERT INTO `mac_vod` VALUES('17276','小姐好辣','搜狐高清','xiaojiehaola','X','','http://photocdn.sohu.com/kis/fengmian/1075/1075657/1075657_ver_big_20160419104004.jpg','http://photocdn.sohu.com/kis/fengmian/1075/1075657/1075657_ver_big_20160419104004.jpg','','马修·劳伦斯/罗伯·施奈德/安娜·法瑞丝','汤姆·布莱迪	','加油站加油,洁西卡,拉拉队,尖叫声,新生活','搜狐高清','美国','英语','2016','1','',',664,','0','0','0','0','0','0','0','0','666956','0','0','0','0','0','0','10.0','0','213','1481704190','1482342806','0','0','洁西卡（瑞秋·麦克亚当斯 饰）是一所高中的校花，也是校橄榄球拉拉队的队长。她虽然长相迷人，可却极其尖酸刻薄，常以捉弄人为乐。连去加油站加油都不忘捉弄一下修车工。一天，洁西卡又在课堂上嘲讽了一位女同学，没想到这位同学竟然会法术，她默默的诅咒了洁西卡一番。哈哈，第二天早上我们的洁西卡一觉醒来，就发现自己变成了一个男人，就是那个被自己捉弄过的、奇丑无比的修车工。随着一声尖叫声，洁西卡的新生活也开始了。','sohu','','','高清$http://film.sohu.com/album/9120675.html','','','','');
INSERT INTO `mac_vod` VALUES('17274','失恋排行榜','搜狐高清','shilianpaixingbang','S','','http://photocdn.sohu.com/kis/fengmian/6/6707/6707_ver_big_20160414151503.jpg','http://photocdn.sohu.com/kis/fengmian/6/6707/6707_ver_big_20160414151503.jpg','','托德·路易斯/约翰·库萨克/蒂姆·罗宾斯/艾本·叶尤/凯瑟琳·泽塔·琼斯','斯蒂芬·弗雷斯	','失恋排行榜,情感生活,花花公子,流行音乐,芝加哥','搜狐高清','美国','英语','2016','1','',',626,','0','0','0','0','0','0','0','0','191130','0','0','0','0','0','0','8.0','0','151','1481704190','1482342805','0','0','已过而立之年的罗伯·高登(约翰·库萨克 饰)是一家芝加哥唱片店的老板，他与店里的两个伙计迪克和柏利都是流行音乐的狂热乐迷，对流行乐可谓了如指掌。但罗伯的唱片店里只出售老式的乙烯塑料唱片，有时三人甚至因为顾客的音乐喜好与自己不同而将其赶出店门，因此店里的生意每况愈下。　　与此同时，罗伯的情感生活也亮起了红灯，与他相处已久的女友劳拉(艾本·叶尤 饰)也要离他而去，因为她觉得某些东西是罗伯无法给他的。罗伯惊异地发现劳拉居然开始与住在自家楼上的伊安(蒂姆·罗宾斯 饰)约会，他可是这座楼上有名的花花公子。　　痛定思痛，罗伯不得不开始对自己的失败生活进行检讨。现在，他必须面对的是一个被自己有意无意忽视的事实：他已经步入成年，在对流行乐的青春热情和一个成年人应付的责任间应该存在平衡。','sohu','','','高清$http://film.sohu.com/album/5088274.html','','','','');
INSERT INTO `mac_vod` VALUES('17273','美国队长2','搜狐高清','meiguoduichang2','M','','http://photocdn.sohu.com/kis/fengmian/1173/1173717/1173717_ver_big.jpg','http://photocdn.sohu.com/kis/fengmian/1173/1173717/1173717_ver_big.jpg','','塞巴斯蒂安·斯坦/塞缪尔·杰克逊/克里斯·埃文斯','安东尼·罗素/乔·罗素	','里约热内卢,美国队长,埃文斯,加勒比,飞机坠毁','搜狐高清','美国','英语','2016','1','',',689,','0','0','0','0','0','0','0','0','459640','0','0','0','0','0','0','7.0','0','191','1481704189','1482342799','0','0','美国队长在现代社会的故事，是一部政治惊险片，也会穿插闪回部分。本片将出现一位黑人英雄“猎鹰”，猎鹰原名为山姆，在一次赴里约热内卢执行任务中，飞机坠毁在一个偏远的加勒比小岛上，美国队长的死敌红骷髅试图利用山姆对抗正在岛上搜捕他的美国队长。他用宇宙立方体将“Snap”埋入山姆内心深处，并赋予山姆能与任何鸟儿进行心灵沟通的能力，通过这种心灵联系，他甚至可以获得鸟儿所见到的影像。最终，山姆帮助美国队长打败了红骷髅，并成为了他的战友——猎鹰。而上一集中从火车跌下去并掉进冰河的美国队长搭档巴奇(Bucky)也会出现，不过他将被洗脑成为俄国间谍“冬日战士”(Winter Soldier 饰)。由于美国队长（克里斯·埃文斯 饰）在沉睡几十年醒来后佩姬（海莉·阿特维尔 饰）已不在人世，因此续集中将为他安排一个新的爱慕对象——在第一部结尾现身的特工莎朗·卡特（艾米丽·万凯普 饰）。','sohu','','','高清$http://film.sohu.com/album/8990405.html','','','','');
INSERT INTO `mac_vod` VALUES('17272','危机解密','搜狐高清','weijijiemi','W','','http://photocdn.sohu.com/kis/fengmian/219/219395/219395_ver_big_20160413162002.jpg','http://photocdn.sohu.com/kis/fengmian/219/219395/219395_ver_big_20160413162002.jpg','','本尼迪克特·康伯巴奇/丹·史蒂文斯/艾丽西卡·维坎德','比尔·康顿	','厄瓜多尔,伦敦警方,政治庇护,秘密文件,维基解密','搜狐高清','其它','其它','2016','1','',',688,','0','0','0','0','0','0','0','0','439753','0','0','0','0','0','0','9.0','0','455','1481704189','1482342804','0','0','本尼迪克特·康伯巴奇饰演“维基解密”创始人朱利安·保罗·阿桑奇。维基解密是一个大型文档泄露及分析网站，曾经在2010年公开了多达9.2万份的驻阿美军秘密文件而引起轩然大波。康伯巴奇将要饰演的朱利安·保罗·阿桑奇是网站的董事与发言人，曾主修过物理、数学，做过程序员和黑客。阿桑奇本人和网站一样都备受争议，他曾经因为解密工作获得过多项荣誉，也曾收到过国际刑警组织的逮捕令。2010年阿桑奇因涉嫌在瑞典强奸及性侵犯2名女性被通缉，2010年12月7日他向伦敦警方自首，随即被押送到威斯敏斯特地方法院出席引渡聆讯，保释申请被驳回。2012年8月16日，阿桑奇获厄瓜多尔政治庇护。','sohu','','','高清$http://film.sohu.com/album/5611204.html','','','','');
INSERT INTO `mac_vod` VALUES('17271','贝隆夫人','搜狐高清','beilongfuren','B','','http://photocdn.sohu.com/kis/fengmian/3/3190/3190_ver_big_20160413151004.jpg','http://photocdn.sohu.com/kis/fengmian/3/3190/3190_ver_big_20160413151004.jpg','','乔纳森·普雷斯/安东尼奥·班德拉斯/麦当娜','艾伦·帕克	','第一夫人,娱乐圈,阿根廷,麦当娜,艾薇塔','搜狐高清','美国','英语','2016','1','',',687,','0','0','0','0','0','0','0','0','642360','0','0','0','0','0','0','5.0','0','144','1481704188','1482342804','0','0','艾薇塔（麦当娜 Madonna 饰）和当时在阿根廷颇为走红的歌手一夜情后，就以此为跳板踏上了前往布宜诺斯艾利斯之路。这个美丽的少女，就是日后名气大震的贝隆夫人。可是，15岁的艾薇塔一无所有，她被抛弃在陌生的城市里，唯一的资本就是自己的美貌。艾薇塔挤入了上流圈子，成为名流男士中间的交际花。随之而来的，是她进军娱乐圈取得的不俗成绩。她一跃成为名人，并在慈善会上结识了贝隆上校（乔纳森·普雷斯 Jonathan Pryce 饰），二人情投意合。艾薇塔从此正式登上了政治舞台。她当上了贝隆政治生涯的贤内助，并一直主张为穷人谋利益。政治的世界风云幻变，而艾薇塔也渐渐找到实现自己政治理想的路径，并为此努力一生，成为阿根廷民众心中的“第一夫人”。','sohu','','','高清$http://film.sohu.com/album/9118957.html','','','','');
INSERT INTO `mac_vod` VALUES('17270','日历女郎','搜狐高清','rilinvlang','R','','http://photocdn.sohu.com/kis/fengmian/14/14636/14636_ver_big_20160411154502.jpg','http://photocdn.sohu.com/kis/fengmian/14/14636/14636_ver_big_20160411154502.jpg','','塞伦·希德/海伦·米伦/朱丽·沃特斯','尼杰尔·科尔	','好莱坞,中年妇女,白血病,克里斯,转折点','搜狐高清','英国','英语','2016','1','',',686,','0','0','0','0','0','0','0','0','393815','0','0','0','0','0','0','1.0','0','103','1481704188','1482342798','0','0','这是一个风景优美的英国小镇。男男女女过着平静如水的生活。自从安妮（朱丽·沃特斯 Julie Walters 饰） 的丈夫患上白血病去世之后，一切发生了变化：安妮和好友克里斯（海伦·米伦 Helen Mirren 饰）做出了一个惊人的决定，为了让其他血癌患者得到及时有效的治疗，她们要筹款捐献给医疗机构——筹款方式就是号召镇上一批中年妇女拍摄裸体挂历。于是，这个善意的举动产生了强大的号召力，十几个家庭妇女投身到拍摄当中。当然，这需要顶着巨大的舆论压力。挂历非常畅销，上面不仅记录了妇女们不再年轻但仍然美丽的身体，还为医疗机构筹来不少经费。家人慢慢的理解和支持她们的行动，媒体的关注让她们成为焦点人物，甚至好莱坞的大门也向她们敞开。安妮和克里斯万万想不到，命运的转折点会在自己中年时代迟迟到来，然而成名和功利面前，二人友谊的纯度再也比不上从前。精彩的世界就在她们面前，但她们要如何不让自己迷失其中？','sohu','','','高清$http://film.sohu.com/album/9118908.html','','','','');
INSERT INTO `mac_vod` VALUES('17268','怪兽大学','搜狐高清','guaishoudaxue','G','','http://photocdn.sohu.com/kis/fengmian/75/75892/75892_ver_big_20160408101503.jpg','http://photocdn.sohu.com/kis/fengmian/75/75892/75892_ver_big_20160408101503.jpg','','约翰·古德曼/比利·克里斯托/史蒂夫·布西密','丹·斯坎隆	','朋友,大学,怪物,麦克,最好','搜狐高清','美国','英语','2016','1','',',685,','0','0','0','0','0','0','0','0','471471','0','0','0','0','0','0','5.0','0','22','1481704187','1482342798','0','0','大眼怪麦克和毛怪苏利文这兄弟俩是形影不离的好伙伴。可是事情并不是从一开始就这样的……在怪物的大学里，麦克和苏利文从见到第一面就不能容忍对方。但是经过一系列的事情，两人最终解开分歧，接受对方的不同，而成为最好的朋友。','sohu','','','高清$http://film.sohu.com/album/5005834.html','','','','');
INSERT INTO `mac_vod` VALUES('17269','出狱一团糟','搜狐高清','chuyuyituanzao','C','','http://photocdn.sohu.com/kis/fengmian/52/52213/52213_ver_big_20160412170004.jpg','http://photocdn.sohu.com/kis/fengmian/52/52213/52213_ver_big_20160412170004.jpg','','蒂姆·艾伦/珍妮·特里普里霍恩/朱丽·鲍温/雷·利奥塔/西格妮·韦弗','蒂姆·艾伦	','朝思暮想,牢狱之灾,老太太,不离不弃','搜狐高清','美国','英语','2016','1','',',630,','0','0','0','0','0','0','0','0','123927','0','0','0','0','0','0','3.0','0','180','1481704187','1482342803','0','0','经过了三年的牢狱之灾，汤米（蒂姆.艾伦 Tim Allen 饰）终于重获了自由，多亏了姐姐维基（西格妮.韦弗 Sigourney Weaver 饰）的不离不弃，汤米才得以在这个冰冷而残酷的世界中找到一块可以安生的土地。可是，对于汤米的到来，姐夫杰夫（雷.利奥塔 Ray Liotta 饰）的态度并不能算得上友善，可是汤米相信，时间能够证明他的改过自新。最让汤米头疼的其实是自己的祖母，亲人们向她隐瞒了汤米入狱的事实，这让这位老太太对汤米三年的音信杳无耿耿于怀。朝思暮想的自由生活就在眼前，可汤米发现现实并没有想象的美好。','sohu','','','高清$http://film.sohu.com/album/1009614.html','','','','');
INSERT INTO `mac_vod` VALUES('17266','诱祸','搜狐高清','youhuo','Y','','http://photocdn.sohu.com/kis/fengmian/1205/1205729/1205729_ver_big_20160428143517.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205729/1205729_ver_big_20160428143517.jpg','','周波/蒋德亮/张萍萍','无花无果	','偷拍性爱,真实面目,虚荣心,公司经理,负责人','搜狐高清','大陆','国语','2016','1','',',634,','0','0','0','0','0','0','0','0','886559','0','0','0','0','0','0','1.0','0','314','1481704185','1482342801','0','0','乡下女孩小芳，为追求城市生活，丢下青梅竹马的大牛，来到城市拼搏，之后受到了大城市的诱惑，通过出卖自己的灵魂满足自己的虚荣心，在偶然的情况下遇见了以偷拍性爱视频敲诈勒索的某公司经理韩哥，小芳被韩哥的甜言蜜语所诱惑，韩哥利用小芳引诱项目负责人（田于正），并且乘机偷拍下小芳和田的视频，威胁田，拿到项目，后来小芳发现了韩哥的真实面目，于是偷走视频与田交易，并且回到了老家准备和大牛平平淡淡的生活，谁知韩哥发现小芳偷走视频，并且带着打手找到了小芳和大牛，一场生死之战在几人中间引爆，最终之后小芳辛存了下来，而偷拍的视频却也因此流传了出来，田身败名裂。','sohu','','','高清$http://film.sohu.com/album/9124140.html','','','','');
INSERT INTO `mac_vod` VALUES('17267','换妻游戏','搜狐高清','huanqiyouxi','H','','http://photocdn.sohu.com/kis/fengmian/1129/1129262/1129262_ver_big_20160412151532.jpg','http://photocdn.sohu.com/kis/fengmian/1129/1129262/1129262_ver_big_20160412151532.jpg','','凯文·克莱恩/福里斯特·惠特克/凯文·史派西','艾伦·J·帕库拉	','伊丽莎白,金发美女,发生关系,保险公司,私家侦探','搜狐高清','美国','英语','2016','1','',',682,','0','0','0','0','0','0','0','0','632870','0','0','0','0','0','0','10.0','0','111','1481704186','1482342801','0','0','作曲家李察（凯文·克莱恩 饰）与太太（玛丽·伊丽莎白·马斯特兰托尼奥 饰）本来婚姻美满，后来隔壁搬来新邻居艾迪(凯文·史派西 饰)，s两对夫妻很快成为好友。没想到艾迪布下美人局，利用太太诱惑李察，使他半夜溜入邻居家跟床上的金发美女发生关系，不料第二天艾迪的太太横尸床上，所有的证据都指向李察。在保险公司的私家侦探追查下，发现此事牵涉到一笔巨大的保险金诈领案。','sohu','','','高清$http://film.sohu.com/album/9118934.html','','','','');
