INSERT INTO `mac_vod` VALUES('17264','追梦狂想曲','搜狐高清','zhuimengkuangxiangqu','Z','','http://photocdn.sohu.com/kis/fengmian/1205/1205665/1205665_ver_big_20160422141011.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205665/1205665_ver_big_20160422141011.jpg','','周浩东/王洪祥/陈三木/晁金晟','任德勇	','励志电影,狂想曲,年轻人,影片','搜狐高清','大陆','国语','2016','1','',',630,','0','0','0','0','0','0','0','0','110830','0','0','0','0','0','0','3.0','0','345','1481704181','1482342792','0','0','这部影片主要讲述的是一帮年轻人，都怀有一个共同的梦想，就是拍电影。历经失败和挫折，在他们的坚持与努力下，最终实现了自己的梦想。也就是说只要怀抱梦想，就一定有理由成功，这是一部激发年轻人的励志电影，通过社会的真实性再现,酸甜苦辣,人生百态.一群平凡的人，做了一件不平凡的事！','sohu','','','高清$http://film.sohu.com/album/9122245.html','','','','');
INSERT INTO `mac_vod` VALUES('17263','第25小时','搜狐高清','di25xiaoshi','D','','http://photocdn.sohu.com/kis/fengmian/1087/1087959/1087959_ver_big_20160408114503.jpg','http://photocdn.sohu.com/kis/fengmian/1087/1087959/1087959_ver_big_20160408114503.jpg','','巴里·佩珀/爱德华·诺顿/利普·塞莫尔·霍夫曼','斯派克·李	','英语老师,爱德华,菲利普,霍夫曼,诺顿','搜狐高清','美国','英语','2016','1','',',613,','0','0','0','0','0','0','0','0','633561','0','0','0','0','0','0','7.0','0','105','1481704181','1482342797','0','0','Monty（爱德华·诺顿 Edward Norton 饰）牵着他的狗在纽约散步，白天，他去了他以前就读的学校拜访了他的老友Jacob（菲利普·塞默·霍夫曼 Philip Seymour Hoffman 饰），Jacob在里面当英语老师，课上他的女学生Mary（安娜·帕奎因 Anna Paquin 饰）非常活跃。而Monty和Jacob的另一个好友Frank（巴里·佩珀 Barry Pepper 饰）则在公司忙碌地工作着。','sohu','','','高清$http://film.sohu.com/album/9117513.html','','','','');
INSERT INTO `mac_vod` VALUES('17262','我恨你的十件事','搜狐高清','wohennideshijianshi','W','','http://photocdn.sohu.com/kis/fengmian/1205/1205435/1205435_ver_big_20160408160525.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205435/1205435_ver_big_20160408160525.jpg','','朱丽娅·斯蒂尔斯/希斯·莱杰/安德鲁·凯加/拉丽莎·奥蕾尼克/大卫·克鲁霍尔特兹/约瑟夫·高登·莱维特','吉尔·约格尔	','高中毕业,漂亮,约会','搜狐高清','美国','英语','2016','1','',',641,','0','0','0','0','0','0','0','0','149103','0','0','0','0','0','0','2.0','0','448','1481704181','1482342796','0','0','谁看到Stratford家两姐妹都会慨叹造化弄人：妹妹Bianca漂亮大方，人见人爱，但却从未约会过；因为爸爸规定，Bianca在高中毕业前不得约会，除非姐姐Kat约会成功。说到Kat那真是厉害：言语刻薄脾气坏——尤其是对男生，因此就算长得不难看也没有人敢约会她。','sohu','','','高清$http://film.sohu.com/album/9117508.html','','','','');
