INSERT INTO `mac_vod` VALUES('17261','还钱','搜狐高清','huaiqian','H','','http://photocdn.sohu.com/kis/fengmian/1205/1205721/1205721_ver_big_20160428143534.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205721/1205721_ver_big_20160428143534.jpg','','张来京/古享林/王新中','吴俊贤	','股市崩盘,股市大跌,高利贷,穷光蛋,老婆','搜狐高清','大陆','国语','2016','1','',',630,','0','0','0','0','0','0','0','0','820918','0','0','0','0','0','0','4.0','0','313','1481704180','1482342796','0','0','土豪老板古鑫豪炒股赚了钱，挥金如土，瞒着老婆在外包养情人阿mei。古鑫豪将全部身家押进股市，但没多久股市大跌，为了补仓他向放高利贷的黑道大哥强哥借钱，不料股市崩盘，古鑫豪彻底成了负债的穷光蛋，老婆也愤怒地离去。 强哥派打手追   钱，古鑫豪为还钱列了一张追债名单，上面记录了他借给别人的债款。自此，古鑫豪和小弟肥肠、光头强走上了艰辛而搞笑的讨债之路。','sohu','','','高清$http://film.sohu.com/album/9124129.html','','','','');
INSERT INTO `mac_vod` VALUES('17259','乡囧','搜狐高清','xiang','X','','http://photocdn.sohu.com/kis/fengmian/1205/1205548/1205548_ver_big_20160415155004.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205548/1205548_ver_big_20160415155004.jpg','','罗远波/陈宇星/王薪权','罗远波	','吃吃喝喝,村里人,美女,笑话,便宜','搜狐高清','大陆','国语','2016','1','',',630,','0','0','0','0','0','0','0','0','53773','0','0','0','0','0','0','4.0','0','237','1481704177','1482342787','0','0','在东北的一个农村，农忙刚过，村民们怀着喜悦的心情，忙完了一年的收成，村里家家户户都富裕来了。百姓们都喜气洋洋过着安居乐业的生活。没事时也搞些各种愉乐活动。随着时代的潮流人们的思想不断地改变，可村里总是有些各别人物，他们好吃懒做，站尖取巧，给村里带来了不少的麻烦，同时也闹出了不少的笑谈。老耿头就是其中的一个，他是个瘸子，贪图便宜，用东北话讲就是个赖皮，所以村里人都叫他二赖子。他有个侄子，整天崩崩达达走路都没个人样，尖懒馋滑，见到美女就眼直特别的猥琐，人们都叫他三侯子。四蒙子，整天酒瓶子不离手，喝的醉熏熏三分清醒七分醉，一天总是迷迷糊糊，被人们称为四蒙子。这三人是臭味相投，经常在一起吃吃喝喝，整天在村里串来串去搞出很多的笑话。','sohu','','','高清$http://film.sohu.com/album/9120304.html','','','','');
