INSERT INTO `mac_vod` VALUES('20063','孤狼','2016-12-15 18:24:43','gulang','G','','/npimg.php?pic=http://pic2.qiyipic.com/image/20161214/47/8d/v_111458278_m_601_m1_180_236.jpg','/npimg.php?pic=http://pic2.qiyipic.com/image/20161214/47/8d/v_111458278_m_601_m1_180_236.jpg','','DanPurdey,WarrenOtteraa,AlanaTranter','Christopher Jacobs','','BD1280超清中字','大陆','国语','2016','5','',',78,','0','0','0','0','0','0','0','0','343970','0','0','0','0','0','0','9.0','0','352','1481740578','1482367213','0','0','二等兵詹姆斯•康罗伊与队友执行一次任务时，突然出现闪光和噪声，之后，队友离奇死亡，疑似被怪物所杀。与此同时，詹姆斯发现所有人都不见了，整个世界只剩下他一个人，他建起了自己的弹药库和基地，并独自跟怪物作战。','qiyi$$$youku$$$ykyun$$$qq$$$letv','$$$$$$$$$$$$','$$$$$$$$$$$$','高清$http://www.iqiyi.com/v_19rra5oh24.html$$$http://v.youku.com/v_show/id_XMTg1NjMwNDEwNA==.html$$$BD$COTMyMjczNg==$$$腾讯高清$http://v.qq.com/x/cover/r2u1pt82598yto1/m0022en6iuh.html$$$高清完整版$http://www.le.com/ptv/vplay/27241646.html','','','','');
INSERT INTO `mac_vod` VALUES('17244','心迷途','搜狐高清','xinmitu','X','','http://photocdn.sohu.com/kis/fengmian/1205/1205267/1205267_ver_big_20160329113503.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205267/1205267_ver_big_20160329113503.jpg','','王帅/郭靖/韩淑贤/王铖','方霆	','情感,情侣','搜狐高清','大陆','国语','2016','1','',',623,','0','0','0','0','0','0','0','0','269844','0','0','0','0','0','0','10.0','0','248','1481704165','1482342782','0','0','女工凤莲和大菊是同乡，她们在长年打工的过程中和厂里的男工二田、铁柱产生了感情。两对情侣由于在家乡都有各自的家庭，因此虽然同居在一起，得到了情感和生活的慰籍，但却倍受内心良知的折磨。他们在情感的迷途中挣扎，最终走向痛苦绝望的深渊。','sohu','','','高清$http://film.sohu.com/album/9114246.html','','','','');
