INSERT INTO `mac_vod` VALUES('17241','比赛计划','搜狐高清','bisaijihua','B','','http://photocdn.sohu.com/kis/fengmian/1055/1055267/1055267_ver_big.jpg','http://photocdn.sohu.com/kis/fengmian/1055/1055267/1055267_ver_big.jpg','','道恩·强森/罗塞莉·桑切斯/杰莫尔·杜夫/劳伦·斯多姆/埃瑞克·布鲁诺·伯格曼/道恩·强森/克里斯蒂娜·拉金/杰莫尔·杜夫/凯拉·塞吉维克/埃瑞克·布鲁诺·伯格曼/麦迪森·佩蒂丝/海耶斯·麦克阿瑟/克里斯蒂娜·拉金/凯拉·塞吉维克/麦迪森·佩蒂丝/海耶斯·麦克阿瑟','安迪·菲克曼	','完美男人,运动员,单身汉,橄榄球,笑话','搜狐高清','美国','英语','2016','1','',',630,','0','0','0','0','0','0','0','0','124534','0','0','0','0','0','0','2.0','0','187','1481704162','1482342774','0','0','乔（道恩·强森 饰）是一名橄榄球运动员，身材强壮又高大的他不仅是队里的主力队员，更是女球迷心目中的完美男人。没有婚姻和家庭的束缚，乔穿梭于欢场与酒吧之间，充分享受着完全自由的单身汉生活，直到一个名叫佩顿（麦迪森·佩蒂丝 饰）的小女孩敲响了他的家门。七岁的佩顿自称是乔的女儿，虽然半信半疑，但乔无法拒绝女孩清澈而又充满了希望的眼神，就这样，乔莫名其妙的开始了他的奶爸生涯。面对女儿，毫无经验的乔闹出了不少的笑话，古灵精怪的佩顿也没少给乔惹麻烦，但是，在忙碌的生活间隙，乔逐渐感受到了佩顿带给她的快乐和温馨。一个男人，一个女孩，两人在相处的过程中都迅速成熟起来。','sohu','','','高清$http://film.sohu.com/album/8416222.html','','','','');
