INSERT INTO `mac_vod` VALUES('17233','呆呆向前冲','搜狐高清','daidaixiangqianchong','D','','http://photocdn.sohu.com/kis/fengmian/4/4155/4155_ver_big.jpg','http://photocdn.sohu.com/kis/fengmian/4/4155/4155_ver_big.jpg','','布莱克·克拉克/凯西·贝茨/费尔鲁扎·鲍克/亨利·温克勒/亚当·桑德勒','弗兰克·克拉斯	','人际交往,克莱恩,橄榄球,爱情,大学','搜狐高清','美国','英语','2016','1','',',630,','0','0','0','0','0','0','0','0','834541','0','0','0','0','0','0','6.0','0','472','1481704158','1482342775','0','0','橄榄球队的茶水男孩鲍比·布施（亚当·桑德勒 Adam Sandler 饰）有人际交往障碍，反应迟钝的鲍比频频被队友们捉弄，教练瑞德认为他妨碍了队员训练，将其开除。失业的鲍比无法离开坚守了18年的茶水员工作，以不计报酬的方式投奔了一只经济状况困窘屡战屡败的大学球队“泥狗”，泥狗教练克莱恩偶然发现愤怒时的鲍比有超乎寻常的拦截能力，随力主鲍比入队，鲍比的母亲（凯西·贝茨 Kathy Bates 饰）因为担心，反对他任何离开自己身边的念头，尤其鲍比童年玩伴、问题女孩维基（费尔鲁扎·鲍克 Fairuza Balk 饰）的出现更令她忧心忡忡。瞒着母亲加入球队的鲍比帮助队伍连连获胜，并最终收获了爱情，还有别人对他真正的认可。','sohu','','','高清$http://film.sohu.com/album/8416330.html','','','','');
