INSERT INTO `mac_vod` VALUES('17230','欲戒','搜狐高清','yujie','Y','','http://photocdn.sohu.com/kis/fengmian/1205/1205245/1205245_ver_big_20160328175509.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205245/1205245_ver_big_20160328175509.jpg','','李蒙蒙/王紧/董朋/郭文丽/刘萍/苏广益','赵成才	','初恋女友,爱情故事,男朋友,男主角,情人节','搜狐高清','大陆','国语','2016','1','',',623,','0','0','0','0','0','0','0','0','145751','0','0','0','0','0','0','3.0','0','79','1481704155','1482342763','0','0','情人节的上午，男主角白云飞受鲜花店的安排快递一份鲜花，却发现收花的人是自己的初恋女友何美丽，由此引出一段少年时期美丽而曲折的爱情故事。晚上，何美丽去现任男朋友王力扬家时，因为自己是农村出身，遭到了王力扬母亲的极力反对，何美丽被拒之门外。王力扬因为母亲的观念，与母亲大吵一架，在出门寻找何美丽时，意外发生了车祸，一个美满的家庭瞬间崩溃。然而，这一切并没有结束。','sohu','','','高清$http://film.sohu.com/album/9114220.html','','','','');
