INSERT INTO `mac_vod` VALUES('17229','同学同居吗','搜狐高清','tongxuetongjima','T','','http://photocdn.sohu.com/kis/fengmian/1205/1205317/1205317_ver_big_20160330173503.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205317/1205317_ver_big_20160330173503.jpg','','王良/苗青/陈浙西','王良	','大学生,英雄','搜狐高清','大陆','国语','2016','1','',',618,','0','0','0','0','0','0','0','0','220601','0','0','0','0','0','0','5.0','0','466','1481704154','1482342767','0','0','大学生林洋和他的一帮损友一起住进了他们家的一所别墅。原本不管不问的老妈却突然一反常态，要让他们交房租。无奈之下，他们广发英雄帖招纳新舍友，搞出一系列啼笑皆非的事儿。经过一番筛选，终于定下了两个貌美如花的女室友。可是，这两个新来的室友中有一个总是神神秘秘的，引起了林洋的注意。在一番调查打探之下，林洋越来越感觉自己爱上了这个神神秘秘的室友。可是没想到却因此揭露除了一段发生在自己兄弟身上的往事。','sohu','','','高清$http://film.sohu.com/album/9115429.html','','','','');
