INSERT INTO `mac_vod` VALUES('17223','谁上了我的床','搜狐高清','shuishangliaowodechuang','S','','http://photocdn.sohu.com/kis/fengmian/1205/1205030/1205030_ver_big_20160317084503.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205030/1205030_ver_big_20160317084503.jpg','','罗永强/皮逸佳','罗永强	','私生子,三轮车,爱情','搜狐高清','大陆','国语','2016','1','',',623,','0','0','0','0','0','0','0','0','103577','0','0','0','0','0','0','6.0','0','223','1481704148','1482256179','0','0','吴狄像往常一样骑着三轮车送快递,突然遇到迎面跑来的赵盈,赵盈为了摆脱一直对她穷追不舍的刘芒而故意接近吴狄，此时的吴狄被赵盈的美所深深的吸引了。在完全不知道事情的来龙去脉的情况下答应了赵盈请求，帮其摆脱刘芒而展开激烈的打斗。赵盈也被吴狄独有的魅力所深深的吸引。此后两人便误打误撞的开始了一段刻苦铭心的爱情。两人在这段爱情的旅途中遭受到了种种挫折：先是赵盈爸爸发现吴狄的身份竟是自己多年在外的私生子,赵盈得知这个消息后伤心的独自去喝酒，喝的宁酊大醉时却被刘芒乘虚而入上了赵盈的床....吴狄与赵盈之间的种种遭遇最终能否走到一起？','sohu','','','高清$http://film.sohu.com/album/9110809.html','','','','');
INSERT INTO `mac_vod` VALUES('17221','二货兄弟2','搜狐高清','erhuoxiongdi2','E','','http://photocdn.sohu.com/kis/fengmian/1205/1205112/1205112_ver_big_20160321180015.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205112/1205112_ver_big_20160321180015.jpg','','由力/张潮/陈市/张大龙/武君/尚桢/孙明文/臧小萱','武君	','天上掉馅饼,搞笑故事,真人秀,电视台,小人物','搜狐高清','大陆','国语','2016','1','',',630,','0','0','0','0','0','0','0','0','202965','0','0','0','0','0','0','10.0','0','375','1481704145','1482342763','0','0','黑哥与满哪黑、遥哪黑是从小一起长大的好兄弟。三个人是名副其实的城市混混。又因为三个人一个比一个傻，闹出不少笑话。他们从电视上看到一个真人秀的节目《创意者》，参加节目只要能成功，就可以获得一百万奖金。黑哥羡慕不已，于是夸下海口要带着两个兄弟上节目，拿百万奖金。在上电视台的过程中，曾遇到过天上掉馅饼的好事。也有被骗的身无分文的时候，有过爱的收获，也曾被情所伤。更遇到过兄弟情意和前途的两难选择。即是小人物的搞笑故事，也是关于兄弟情意的严酷拷问。城市中混混的人生缩影，也是大梦想家的内心展望','sohu','','','高清$http://film.sohu.com/album/9112349.html','','','','');
INSERT INTO `mac_vod` VALUES('17222','腐女的欲望','搜狐高清','funvdeyuwang','F','','http://photocdn.sohu.com/kis/fengmian/1205/1205135/1205135_ver_big_20160322174007.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205135/1205135_ver_big_20160322174007.jpg','','芦伟/逗号/霍金','夏青	','女朋友,注射毒品,大学生,手术费,小三','搜狐高清','大陆','国语','2016','1','',',613,','0','0','0','0','0','0','0','0','195214','0','0','0','0','0','0','5.0','0','40','1481704146','1482256177','0','0','大学生微微从小没有父母，为给年迈的奶奶筹集手术费，在酒吧陪酒赚钱。被毒枭老大松哥看上了，想包养微微做自己的小三，并欲强暴微微，被一直暗恋微微的，在车行修车的郭帅救下，不想微微再受伤害而对微微表白。松哥的手下小黑的女朋友飘飘是微微的同学，小黑利用飘飘报复郭帅。同时车行的老板大军的弟弟小军也因喜欢赌博而被算计欠下二十万，被赌场顺哥天天逼着要债。飘飘因急需奶奶的手术费而重回酒吧上班并与郭帅分手。遭到松哥轮暴而自杀。小军也因被顺哥注射毒品和假毒粉而死亡。郭帅和大军偷得证据，将两大黑帮绳之以法。','sohu','','','高清$http://film.sohu.com/album/9112362.html','','','','');
