INSERT INTO `mac_vod` VALUES('17214','王的美人之野蛮人乱入','搜狐高清','wangdemeirenzhiyemanrenluanru','W','','http://photocdn.sohu.com/kis/fengmian/1204/1204921/1204921_ver_big_20160304143507.jpg','http://photocdn.sohu.com/kis/fengmian/1204/1204921/1204921_ver_big_20160304143507.jpg','','赵波/张影辰/姬天语/郎家帅/刘增锴/吴聃/李慧龙','陈鹏翱	','资本市场,表演专业,房地产,红烧肉,宝马','搜狐高清','大陆','国语','2016','1','',',613,','0','0','0','0','0','0','0','0','701633','0','0','0','0','0','0','10.0','0','103','1481704140','1482083671','0','0','波诡云谲的资本市场上，国内一线地产商万石地产突然被一股来历不明的资金收购，公司第一大股东的位置也迅速被一群来历不明的野蛮人把持着。这里，究竟隐藏着什么样的阴谋？迷影重重.....15年前，卖玉米的王三石，联合炮哥、小潘、阿伦成立了万石集团，意图收购卖蔬菜的宝熊、宝马二兄弟的宝源集团。二宝不肯，但被王三石的用不正当的阴谋击败，被逐出了市场。他们收养的养女田小裙目睹了一切，把这一幕牢牢印在了心底。    15年后，从戏剧学院表演专业毕业的田小裙考上了黄河商学院，并在海魂盛筵上遇到了已经成为房地产大亨的王三石、小潘、阿伦等人。怀揣复仇大计的田小裙诱惑了王三石，使他成为了自己的裙下之臣。二人翻云覆雨，两情缱绻之时，王三石意乱情迷，为此不惜与相濡以沫的发妻离婚，付出了千夫所指的代价，只为和田小裙双宿双飞。情浓时，王三石放下亿万身家、商海教父的身段，委身下厨，为田小裙做下“笨笨”牌红烧肉，尽显柔情。套得万石集团重要内情的田小裙，将情报告知了宝熊和宝马。宝氏集团立即联合盟友，在资本市场上发起了波澜壮阔的收购。精神落寞的王三石又一次拜见了他的精神教父——橙王褚老，试图寻求慰藉……','sohu','','','高清$http://film.sohu.com/album/9107383.html','','','','');
