INSERT INTO `mac_vod` VALUES('17211','秀恩爱死得快','搜狐高清','xiuenaisidekuai','X','','http://photocdn.sohu.com/kis/fengmian/1205/1205084/1205084_ver_big_20160317175504.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205084/1205084_ver_big_20160317175504.jpg','','张美丽/冉玲珑/诸葛智','张美丽	','一个人生活,外星人,平安幸福,幼儿园,地球','搜狐高清','大陆','国语','2016','1','',',646,','0','0','0','0','0','0','0','0','363222','0','0','0','0','0','0','6.0','0','98','1481704138','1482083674','0','0','柏可是一位爱做梦的天真女孩，与男友邱枫一起生活的平安幸福，两人是大家眼中的恩爱情侣。一日，邱枫告诉柏可，邱枫的公司要安排他调职到南方工作，所以要留下柏可一个人生活。后来，邱枫却带回家来一个婴儿，他告诉柏可说那是他亲戚的孩子，所以希望柏可帮助他抚养这个孩子。柏可半信半疑的答应后，二人商量着将孩子送到做幼儿园老师的表姐那里，再给表姐找个保姆，让表姐帮忙照顾。可是当他们马上将要把孩子送过去的时候，邱枫告诉柏可，他如果不离开地球，就会死。他其实不是人类，他是来自于遥远太空--太痒星球，他的真实身份是一个外星人','sohu','','','高清$http://film.sohu.com/album/9112019.html','','','','');
INSERT INTO `mac_vod` VALUES('17208','勇夺冠军','搜狐高清','yongduoguanjun','Y','','http://photocdn.sohu.com/kis/fengmian/1205/1205043/1205043_ver_big_20160316094006.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205043/1205043_ver_big_20160316094006.jpg','','王雨萱/王满婷/李冠志/王泽轩/柴叶勇','李新宇/余小冻	','怒火攻心,霸王花,植物人,人贩子,经理人','搜狐高清','大陆','国语','2016','1','',',619,','0','0','0','0','0','0','0','0','360081','0','0','0','0','0','0','6.0','0','464','1481704137','1482083673','0','0','杨虎生于武术世家和妹妹自幼随父习武，妹妹不幸被人贩子拐走，父亲怒火攻心，在寻找过程中被飞速驶来的汽车撞倒在地，不省人事成为一名植物人。杨虎成年后，为了赚钱救治父亲筹集巨额医疗费用，认识了拳击经理人张飞燕，在飞燕的介绍下参加打黑拳赚取奖金。杨虎在低规格比赛中节节获胜，在高规格比赛却遭遇到的强劲的对手霸王花。杨虎在擂台上被霸王花打得奄奄一息生命垂危，为了筹集医疗费用拯救杨虎，飞燕不惜答应父母的安排违心答应了婚事。杨虎获救后被拳击噩梦困扰，昔日硬汉变成一名懦弱之人。王教练想出种种办法，杨虎重新找回自己重拾信心，回到拳击擂台打倒霸王花。没想到霸王花竟然是童年失散多年的妹妹，一家人终于团聚，喜极而泣。','sohu','','','高清$http://film.sohu.com/album/9111114.html','','','','');
INSERT INTO `mac_vod` VALUES('17209','唐僧肉惊天大骗局','','tangsengroujingtiandapianju','T','','http://photocdn.sohu.com/kis/fengmian/1205/1205001/1205001_ver_big_20160311171010.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205001/1205001_ver_big_20160311171010.jpg','','葛达/花旗/黄旭高','葛达	','','腾讯高清','大陆','国语','2016','1','',',630,','0','0','0','0','0','0','0','0','216925','0','0','0','0','0','0','10.0','0','187','1481704137','1482347487','0','0','唐僧和沙僧穿越到现代，偶遇长相一模一样的转世唐僧，更巧的转世唐僧竟然是个悍匪，两个唐僧引发一场惊天大骗局。','sohu$$$qq','$$$','$$$','高清$http://film.sohu.com/album/9108675.html$$$腾讯高清$http://v.qq.com/x/cover/jw6l3i8ew09ylge/p01888fei10.html','','','','');
