INSERT INTO `mac_vod` VALUES('20073','世界再见','','shijiezaijian','S','','http://i0.letvimg.com/lc03_isvrs/201611/14/09/56/36275971-9cce-494b-ad89-8f381acdf9d5.jpg','[db:缩略图]','[db:幻灯图]','卡洛琳·达芙娜/盖比·霍夫曼/','Denis Hennelly/','[db:tag]','乐视高清','美国','','0','10','',',345,','0','0','0','0','0','0','0','0','39603','0','0','0','0','0','0','6.0','0','33','1481742444','1481829007','0','0','詹姆和莉莉住在电网，提高他们的小女儿的舒适度和可持续发展的一个茧。当一个神秘的群发短信涟漪的方式在全国范围内，引发了瘫痪，大难临头的网络攻击，从庇护现代绿洲他们家过渡到一个要塞的疏远老朋友的出现在自己的门口，作为保护和社区。意外的重逢 - 丰富，狂欢和回忆，通过有机葡萄酒和杂草慷慨增强 -正在迅速由过去的轻视，缠绵调情的火花和本地种植的新的世界秩序的威胁破坏。平衡紧张的对峙与轻浮的条子，导演丹尼斯·亨利Hennelly精确定位，在未来，意识形态都分解成在各个领域的行动。','letv','','','高清完整版$http://www.le.com/ptv/vplay/27261133.html','','','','');
INSERT INTO `mac_vod` VALUES('17205','成名背后','搜狐高清','chengmingbeihou','C','','http://photocdn.sohu.com/kis/fengmian/1204/1204998/1204998_ver_big_20160310175003.jpg','http://photocdn.sohu.com/kis/fengmian/1204/1204998/1204998_ver_big_20160310175003.jpg','','曹蕾/郭中友/李感/颜敬杰','高泽阳	','年轻人','搜狐高清','大陆','国语','2016','1','',',613,','0','0','0','0','0','0','0','0','61231','0','0','0','0','0','0','10.0','0','412','1481704133','1481823952','0','0','每天，有太多怀揣着电影梦的年轻人来到这个城市，但有多少人发现现实的残酷后悻悻而归。荧幕前光鲜亮丽的背后，到底承载着多少的不甘和隐忍，坚守还是离开，梦想这个引擎到底还能驱动多久。','sohu','','','高清$http://film.sohu.com/album/9108667.html','','','','');
INSERT INTO `mac_vod` VALUES('17204','年咋过','搜狐高清','nianzhaguo','N','','http://photocdn.sohu.com/kis/fengmian/1205/1205022/1205022_ver_big_20160314170003.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205022/1205022_ver_big_20160314170003.jpg','','张雷鸣/白雪飞/何东旭/孙大伟/郑振强/姚春/袁赛博','马梓博	','留守儿童,老人家,年轻人,爱好者,女性','搜狐高清','大陆','国语','2016','1','',',630,','0','0','0','0','0','0','0','0','517399','0','0','0','0','0','0','4.0','0','279','1481704131','1481823949','0','0','故事围绕着几个年轻人：肖大力快递员，陆晓晓网店主，是个孤儿，拍客张东，摄影爱好者王涛，二蛋 夏夜社会混混，跟着老大混社会，一个碰瓷人的出现扰乱了他们，大力的包裹丢失一件，二蛋与夏夜拿错大哥发的毒品。张东取包裹忘记带手机，晓晓经过，被张东抢了手机，王涛所有的作品，缺少了女性，无意中拍摄到晓晓，吸引了他的目光 ，四人阴差阳错的闹了矛盾。二蛋夏夜包裹拿错，老大发话，货拿不回来就别想过年，二人不顾一切，要找到货。另一件包裹大力送错，送给一个空巢老人与留守儿童的家里。肖大力被二蛋夏夜暴打一顿，从大力口中得知货在老人家。张东王涛救出大力，大力想到老人孩子有危险，因为他，不想牵连到老人孩子，三人去营救，途中遇晓晓，四人又遇到一起。一方面就老人和孩子。一方面又担心二蛋和夏夜，双方对战，发生一连串搞笑的故事……','sohu','','','高清$http://film.sohu.com/album/9108709.html','','','','');
INSERT INTO `mac_vod` VALUES('17203','天使驾到之一夜精喜','搜狐高清','tianshijiadaozhiyiyejingxi','T','','http://photocdn.sohu.com/kis/fengmian/1205/1205002/1205002_ver_big_20160311171006.jpg','http://photocdn.sohu.com/kis/fengmian/1205/1205002/1205002_ver_big_20160311171006.jpg','','高伟/郭月/高一炜/王晓东/倪青','吴钦	','安全套,突如其来,意外怀孕,天使,矛盾','搜狐高清','大陆','国语','2016','1','',',638,','0','0','0','0','0','0','0','0','465897','0','0','0','0','0','0','8.0','0','83','1481704130','1481823949','0','0','几盒被扎了眼儿的安全套给三组不同人物的命运造成了极大的转变。已有一子的普通家庭要面临最现实的经济压力而烦恼是否应该要二胎。一心打拼事业的外企女金领，不想因为孩子毁了自己的大好前程，却因为突然怀孕引发了激烈的家庭矛盾。成天游手好闲以约妹子为乐的富二代只贪图享乐，从来不考虑责任问题，怀孕问题让他露出无耻嘴脸。突如其来的意外怀孕让他们不得不重新审视和思考未来的生活，而最终他们在天使的指引下做出了正确的选择。','sohu','','','高清$http://film.sohu.com/album/9108677.html','','','','');
INSERT INTO `mac_vod` VALUES('17201','找个高帅富','搜狐高清','zhaogegaoshuaifu','Z','','http://photocdn.sohu.com/kis/fengmian/1204/1204984/1204984_ver_big_20160309165502.jpg','http://photocdn.sohu.com/kis/fengmian/1204/1204984/1204984_ver_big_20160309165502.jpg','','','','','搜狐高清','大陆','国语','2016','1','',',623,','0','0','0','0','0','0','0','0','881669','0','0','0','0','0','0','4.0','0','187','1481704130','1481823948','0','0','','sohu','','','高清$http://tv.sohu.com/20160314/n440313476.shtml','','','','');
INSERT INTO `mac_vod` VALUES('17202','我滴个女神','搜狐高清','wodigenvshen','W','','http://photocdn.sohu.com/kis/fengmian/1204/1204924/1204924_ver_big_20160304162010.jpg','http://photocdn.sohu.com/kis/fengmian/1204/1204924/1204924_ver_big_20160304162010.jpg','','马越/王晓天/梅景洪','琅森	','一见钟情,面包车,火车站,拉杆箱,北京','搜狐高清','大陆','国语','2016','1','',',630,','0','0','0','0','0','0','0','0','437990','0','0','0','0','0','0','4.0','0','254','1481704130','1481823949','0','0','丈夫惨遭绑架，富家女林清怡救夫心切，千里送赎金，来到绑匪指定的西部小城。这天，正在相亲的老梅还是没有找到心仪的对象。小天打来电话要他帮忙接送顾客。老梅对林清怡一见钟情，驱车送林清怡去火车站的路上，不停搭讪，怎奈二人身份悬殊。林清怡登上火车前往北京，老梅发现林清怡留在车站广场的拉杆箱。暗中跟踪的绑匪正要收取赎金，不料，箱子被不明就里的老梅捷足先登。没有追上林清怡，老梅失望而归。为了追求女神，老梅忽悠小天开着破旧的小面包车奔爱而去。此行他们不仅要归还拉杆箱，更要获取美女芳心。可是事情远没有他们想像的那么简单，绑匪匪步步紧逼，试图将老梅与小天置于死地，怎奈两个奇葩，智商不同寻常，竟然阴差阳错地躲过一次次灾祸。两个活宝，能否顺利抵达目的地。一段疯狂搞笑的旅程就此展开。','sohu','','','高清$http://film.sohu.com/album/9107389.html','','','','');
