INSERT INTO `mac_vod` VALUES('17200','为房痴狂','搜狐高清','weifangchikuang','W','','http://photocdn.sohu.com/kis/fengmian/1204/1204923/1204923_ver_big_20160304162013.jpg','http://photocdn.sohu.com/kis/fengmian/1204/1204923/1204923_ver_big_20160304162013.jpg','','徐黄丽/张美娥','李振	','女朋友,房地产,开发商,小青年,矛盾','搜狐高清','大陆','国语','2016','1','',',631,','0','0','0','0','0','0','0','0','681878','0','0','0','0','0','0','9.0','0','431','1481704130','1481823948','0','0','为房痴狂，主要以马克几个家庭背景为题材，在房地产蒸蒸日上的年代， 几个家庭选房不慎， 开发商坑骗业主，给家庭带来了矛盾，两夫妻为房离婚，小青年准备结婚，没房和女朋友分手 。 有业主因房而喜、为房痴狂的几个家庭尝尽人生酸甜苦辣。','sohu','','','高清$http://film.sohu.com/album/9107387.html','','','','');
INSERT INTO `mac_vod` VALUES('17196','明月','搜狐高清','mingyue','M','','http://photocdn.sohu.com/kis/fengmian/1204/1204873/1204873_ver_big_20160229170010.jpg','http://photocdn.sohu.com/kis/fengmian/1204/1204873/1204873_ver_big_20160229170010.jpg','','王振/肖建新/韩潇雨','胡文冰	','突如其来,教育事业,考大学,教师,教学','搜狐高清','大陆','国语','2016','1','',',635,','0','0','0','0','0','0','0','0','598091','0','0','0','0','0','0','1.0','0','440','1481704127','1481706938','0','0','韩佳怡（小名明月）是明月山区一个普通的农村女孩，父亲是一名山村教师，弟弟则是一个傻子，虽然过着清苦的日子，但她有着农村女孩同样的梦想——向往山外的美好世界。然而，就在父亲送她去参加高考的时候，一场突如其来的车祸，夺去了她父亲的生命。父亲去世后，老支书见村里没有老师，非常着急。由于太僻远，再也没有人愿意来这里教书了。无奈之下，老支书只好请双腿残疾的于老师出来暂时代几天课，不料，于老师在去教学途中不小心掉入山沟里，导致病情加重。在于妻的坚决反对下，于老师已无法再去学校教书，在这种情况下，一心想考大学的韩佳怡放弃了准备去山外闯世界的理想，终于担起了山村女教师的重任。不久，当兵后考上军校不久的男友李军又在一次抗洪抢险中牺牲了，县里考虑到韩佳怡的实际情况，准备调离她的工作岗位，可是，韩佳怡考虑到如果她一走，村里又将没有老师了，便决定继续留在村里教书，扎根山区的教育事业。','sohu','','','高清$http://film.sohu.com/album/9106906.html','','','','');
INSERT INTO `mac_vod` VALUES('17194','疯狂的少妇2','搜狐高清','fengkuangdeshaofu2','F','','http://photocdn.sohu.com/kis/fengmian/1209/1209102/1209102_ver_big_20161209094003.jpg','http://photocdn.sohu.com/kis/fengmian/1209/1209102/1209102_ver_big_20161209094003.jpg','','张朕轩/杨亭/尚洪羽/孙婉倪','郭翔/刘新阔	','没有安全感,成功人士,男人味,少妇,美女','搜狐高清','大陆','国语','2016','1','',',618,','0','0','0','0','0','0','0','0','614022','0','0','0','0','0','0','6.0','0','92','1481702180','1482343120','0','0','王洛（杨亭饰）是一间画室的老师和所有者，有一天，她的画室来了一位学生娜娜（孙玺璐饰），王洛的老公李有名（张朕轩饰）是一名正值不惑之年，很有男人味的成功人士，李有名有一个癖好就是见了美女就无法自拔。有一天画室下课后，王洛意外发现娜娜向前来接她的老公李有名借火抽烟，而李有名眼神陷在娜娜身上无法自拔。回家后，王洛很生气，她总在这个男人面前没有安全感，但又无可奈何，因为李友名曾因她离婚，她也总觉得李友名跟她的前妻陈楚晗（尚洪羽饰）依然有瓜葛。为了验证李有明的忠心，王洛找来了娜娜，私下达成协议，让她去勾引自己的老公，原来这一切都是娜娜精心安排的，故事才刚刚开始。','sohu','','','高清$http://film.sohu.com/album/9258840.html','','','','');
INSERT INTO `mac_vod` VALUES('17193','寻找我的神奇女友','2016-12-15 3:18:17','xunzhaowodeshenqinvyou','X','','http://photocdn.sohu.com/kis/fengmian/1209/1209166/1209166_ver_big_20161213151006.jpg','http://photocdn.sohu.com/kis/fengmian/1209/1209166/1209166_ver_big_20161213151006.jpg','','曹蕾/辛一/周梓言','杜景峰	','世界杯,的情人,美女,超人,而且','BD1280超清中字','大陆','国语','2016','1','',',619,','0','0','0','0','0','0','0','0','839594','0','0','0','0','0','0','6.0','0','84','1481702179','1482367197','0','0','苏博要跳楼，但是却被楼下的警方的“赌球害人，远离世界杯”差点先气死，不过这不是重点，重点是在自己严防死守的楼顶，却有人上来，而且还说是他是上帝，以及他的弟弟下帝，苏博很想问明白，天空是不是自己。上帝说了，自己的手机摇一下就能约，虽然随机事件和随机美女各占一半，但是还是可能有生命危险的……黑帮的追杀、玩死尸的法医孟瑶、比超人还勤快的律师莫贝贝、以及那个追杀自己的黑道老大道哥的情人，冷的吓人的君兰，对了还有一条狗，以及两个终于相爱走到一起的“同志”，虽然危险，但是也充满了艳情不是吗？摇不摇呢？摇到了就能约呢，反正我是苏博，我就摇了。','sohu$$$qiyi$$$ykyun','$$$$$$','$$$$$$','高清$http://film.sohu.com/album/9263618.html$$$高清$http://www.iqiyi.com/v_19rra10y0g.html$$$BD1280高清$COTMwMDIxNg==','','','','');
INSERT INTO `mac_vod` VALUES('17192','捉鬼敢死队','搜狐高清','zhuoguigansidui','Z','','http://photocdn.sohu.com/kis/fengmian/1/1385/1385_ver_big_20161130110003.jpg','http://photocdn.sohu.com/kis/fengmian/1/1385/1385_ver_big_20161130110003.jpg','','丹·艾克罗伊德/西格妮·韦弗/比尔·默瑞','伊万·雷特曼	','纽约市,政府部门,敢死队,离开校园,实验室','搜狐高清','美国','英语','2016','1','',',627,','0','0','0','0','0','0','0','0','659873','0','0','0','0','0','0','7.0','0','186','1481702179','1482343113','0','0','三名大学教授彼得·温克曼（比尔·默瑞 Bill Murray 饰）、雷蒙德·斯坦兹（丹·艾克罗伊德 Dan Aykroyd 饰）和艾根·斯宾格勒（哈罗德·雷米斯 Harold Ramis 饰）专门研究鬼怪灵异之事。他们决定离开校园实验室，组成“捉鬼大队”。他们用最新的科学仪器，对付在纽约市出没的无数大鬼小鬼，取得成功。可政府部门却将他们视为江湖骗术。直到有一天，一群邪恶的魔鬼包围了整座纽约市，并附身于美女德纳（西格妮·韦弗 Sigourney Weaver 饰）身上时，众人终于意识到了事态的严重。这只“捉鬼大队”是否能够拯救纽约，让魔鬼无所遁形呢？','sohu','','','高清$http://film.sohu.com/album/5102609.html','','','','');
INSERT INTO `mac_vod` VALUES('17191','大二神捕','搜狐高清','daershenbu','D','','http://photocdn.sohu.com/kis/fengmian/1208/1208675/1208675_ver_big_20161116134513.jpg','http://photocdn.sohu.com/kis/fengmian/1208/1208675/1208675_ver_big_20161116134513.jpg','','袁心冉/陈辉/白那日苏','周艺华	','女扮男装,锦衣卫,东林党','搜狐高清','大陆','国语','2016','1','',',613,','0','0','0','0','0','0','0','0','667097','0','0','0','0','0','0','8.0','0','205','1481702179','1482343113','0','0','明朝末年，民不聊生，义军揭竿而起。白山县因数年前‘东林党’之争，而蒙上一层神秘诡异的面纱。当初消失的罪证横空出世，使得白头军，锦衣卫，官府三方势力纷纷入局。何氏兄弟生性呆愣，生活清贫，因戴有书写翰林二字的木牌，被几方势力盯上。兄弟俩无意间救下了白头军首领的女儿丁白，后者女扮男装希望从兄弟二人身上找到线索。另一方面，十二肖卫不断来袭，衙门里的县官和师爷也心怀叵测，麻烦接踵而至，事情仿佛越来越复杂。','sohu','','','高清$http://film.sohu.com/album/9238379.html','','','','');
INSERT INTO `mac_vod` VALUES('17190','茅山后裔','2016-12-15 3:15:49','maoshanhouyi','M','','http://photocdn.sohu.com/kis/fengmian/1209/1209188/1209188_ver_big_20161214134003.jpg','http://photocdn.sohu.com/kis/fengmian/1209/1209188/1209188_ver_big_20161214134003.jpg','','陈琳/王筝/赵阳','毕鉴威	','茅山后裔,老板娘,大学,旅馆','BD1280超清中字','大陆','国语','2016','1','',',615,','0','0','0','0','0','0','0','0','35242','0','0','0','0','0','0','1.0','0','442','1481702179','1482367194','0','0','大学教授百里孑入住神秘旅馆之后遭遇了一系列怪事，先是旅客半夜失踪，紧接着老板娘身着薄衣诡异地推开了他的房门，经过调查，百里孑锁定了与几年前命案息息相关的神秘人士，他登门拜访却陷入另一重困境。究竟百里孑能否用科学的方法解除最终的麻烦，而他真实的身份又是什么，一切谜题即将揭晓。','sohu$$$qiyi$$$ykyun$$$qq','$$$$$$$$$','$$$$$$$$$','高清$http://film.sohu.com/album/9263642.html$$$高清$http://www.iqiyi.com/v_19rr9bjkr0.html$$$BD1280高清$COTMwMDI1Ng==$$$腾讯高清$http://v.qq.com/x/cover/2detyzwpfxohudi/v0351x71bj0.html','','','','');
INSERT INTO `mac_vod` VALUES('17189','费城故事','搜狐高清','feichenggushi','F','','http://photocdn.sohu.com/kis/fengmian/0/823/823_ver_big.jpg','http://photocdn.sohu.com/kis/fengmian/0/823/823_ver_big.jpg','','乔安娜·伍德沃德/丹泽尔·华盛顿/汤姆·汉克斯/萝伯塔·麦斯威尔','乔纳森·戴米	','安德鲁,艾滋病,华盛顿,图书馆,普通人','搜狐高清','美国','英语','2016','1','',',613,','0','0','0','0','0','0','0','0','386128','0','0','0','0','0','0','5.0','0','266','1481702179','1482343113','0','0','安德鲁（汤姆·汉克斯 Tom Hanks 饰）和米勒（丹泽尔·华盛顿 Denzel Washington 饰）认识于法庭上，两人都是年轻有为的律师，各为其主。然而，年轻的安德鲁不久后因为同性恋和身染艾滋病被老板发现，以莫须有理由解雇了。 　 遭解雇后的安德鲁四处寻找律师为他讨回公道。当安德鲁找到米勒时，米勒一开始拒绝了他。因为米勒像普通人一样憎恨同性恋和惧怕艾滋病，但当他看到安德鲁在图书馆搜索“艾滋病歧视”时遭到管理员的白眼，听着妻子缓慢而平静地说出他们的姨妈、朋友有很多也是同性恋时，他决定受理安德鲁的案件。在最后的法庭上，病危的安德鲁毅然出庭。','sohu','','','高清$http://film.sohu.com/album/7118389.html','','','','');
INSERT INTO `mac_vod` VALUES('17187','北漂爱情故事','搜狐高清','beipiaoaiqinggushi','B','','http://photocdn.sohu.com/kis/fengmian/1208/1208937/1208937_ver_big_20161206165014.jpg','http://photocdn.sohu.com/kis/fengmian/1208/1208937/1208937_ver_big_20161206165014.jpg','','黄琦雯/王雪儿/徐振兴/王钧衡','徐宁	','爱情故事,项目经理,爱情游戏,北漂族,西西','搜狐高清','大陆','国语','2016','1','',',623,','0','0','0','0','0','0','0','0','264629','0','0','0','0','0','0','6.0','0','493','1481702178','1482343112','0','0','北漂族张洋，因不满整天被领导骂，愤然辞职，决定与学长大崔创业，两人变卖了最后的家当，打造一款相亲APP。APP做好后，两人极尽可能挨家挨户的推广宣传，而一个月后，仍然一无所获，挫败的大崔和张洋发生争执，分道扬镳。倍感失落的张洋决定放弃，就在这时APP迎来了第一位有需求的会员张西西，项目经理，容貌未知，气质上乘。张洋为了留住会员，决定亲自赴约相亲，伴随着约会时间的临近，一场0元投资，1000000+收益的爱情游戏悄然开启。','sohu$$$qq','$$$','$$$','高清$http://film.sohu.com/album/9256909.html$$$腾讯高清$http://v.qq.com/x/cover/7iq2qkkqvn30xc2/k0351xf2un7.html','','','','');
INSERT INTO `mac_vod` VALUES('17188','完美逃亡','搜狐高清','wanmeitaowang','W','','http://photocdn.sohu.com/kis/fengmian/215/215283/215283_ver_big_20161129140003.jpg','http://photocdn.sohu.com/kis/fengmian/215/215283/215283_ver_big_20161129140003.jpg','','玛丽·谢尔顿/克里斯·海姆斯沃斯/米拉·乔沃维奇/基拉·桑切斯/史蒂夫·茨恩/蒂莫西·奥利芬特','大卫·杜西	','夏威夷,时间的流逝,原始丛林,乔沃维奇,好莱坞','搜狐高清','美国','英语','2016','1','',',625,','0','0','0','0','0','0','0','0','666598','0','0','0','0','0','0','3.0','0','393','1481702178','1482343112','0','0','好莱坞编剧克里夫·安德森（斯蒂夫·赞恩 Steve Zahn 饰）和希德妮（米拉·乔沃维奇 Milla Jovovich 饰）这对看似新婚燕尔的小夫妻正驱车前往风景迷人的夏威夷度假，他们在当地结识了另一对情侣——极具野性的尼克（蒂摩西·奥利芬特 Timothy Olyphant 饰）和吉娜（凯尔·桑切斯 Kiele Sanchez 饰）。在尼克夫妇的指引下，他们走入原始丛林探险，寻找从未有人涉足的完美之地。但是在此过程中，他们从其他游客那里听说了一对新婚夫妇狂乱杀人的恐怖传闻。美丽的小岛瞬间杀气腾腾，阴云密布，是去是留成为了一个艰难的选择。    随着时间的流逝，死神的脚步似乎变得越来越清晰，而被深藏已久的秘密也慢慢浮出水面。','sohu','','','高清$http://film.sohu.com/album/8389750.html','','','','');
INSERT INTO `mac_vod` VALUES('17186','恋恋那年','2016-12-15 3:17:24','lianliannanian','L','','http://photocdn.sohu.com/kis/fengmian/1208/1208830/1208830_ver_big_20161130094506.jpg','http://photocdn.sohu.com/kis/fengmian/1208/1208830/1208830_ver_big_20161130094506.jpg','','林思海/涵子/杜鹏远','盖海涛	','人民日报,身心疲惫,关键词,改革开放,中国','BD1280超清中字','大陆','国语','2016','1','',',618,','0','0','0','0','0','0','0','0','778575','0','0','0','0','0','0','2.0','0','385','1481702178','1482367195','0','0','本片围绕安小溪和霍无畏、魏子琪三人之间的情感纠葛。安小溪喜欢魏子琪几年来都只是在远处默默的观望。霍无谓喜欢安小溪并追随他来到同一班，他很清楚安小溪喜欢的是魏子琪，所以他也只是在默默的关注着安小溪。魏子琪面对球友的怂恿，对新来的转校生突然展开了追求，原本平静的三人关系因为一次荒诞的赌注而打破。身心疲惫的安小溪大病后重回学校，用实际行动表达了对那份感情的失望，魏子琪想要挽回，却为时已晚。霍无谓对倔强坚强的安小溪越发喜欢，向安小溪表白失败以后，默默保护着安小溪不被人欺负，就当两人感情逐渐升温的时候，意外悄然而至，一切似乎回到了起点。','sohu$$$qiyi$$$ykyun','$$$$$$','$$$$$$','高清$http://film.sohu.com/album/9247659.html$$$高清$http://www.iqiyi.com/v_19rr9aoqdo.html$$$BD1280高清$COTMwMDI2OA==','','','','');
INSERT INTO `mac_vod` VALUES('4682','逗爱男女第2季','共12集全','douainannvdi2ji','D','','/npimg.php?pic=http://pic3.qiyipic.com/image/20160927/75/fd/a_100032809_m_601_m2_180_236.jpg','/npimg.php?pic=http://pic3.qiyipic.com/image/20160927/75/fd/a_100032809_m_601_m2_180_236.jpg','','赵圆圆,沈浩,金士杰,刘亚津,宫海滨,张圣岳,金珊,李红陶,孙涛,矢野浩二,许绍雄,刘惠,李金铭,马丽兹,丁艺','李巨涛','','共12集全','大陆','国语','0','12','',',70,','0','0','0','0','0','0','0','0','670586','0','0','0','0','0','0','10.0','0','87','1480320442','1482379423','0','0','故事讲述龙套演员麦田的女友菲菲因意外毁容后不辞而别，麦田失落不已；三年后，整容后的菲菲化名唐小唯来到麦田和富二代皮特合伙开的青年旅舍试图挽回爱情；与此同时，一直暗恋麦田的香草、自诩明日之星的歌手李尚进也加入了青年旅舍，一群追逐梦想、爱情的年轻人，和形形色色的客人在这里开始了一桩桩欢笑与泪水相伴的爆笑...','qiyi','','','第1集$http://www.iqiyi.com/v_19rr9gfqr0.html#第2集$http://www.iqiyi.com/v_19rr9gghac.html#第3集$http://www.iqiyi.com/v_19rr9gg0cc.html#第4集$http://www.iqiyi.com/v_19rr9gg3cg.html#第5集$http://www.iqiyi.com/v_19rr9gfth8.html#第6集$http://www.iqiyi.com/v_19rr9giekc.html#第7集$http://www.iqiyi.com/v_19rr9gj1j4.html#第8集$http://www.iqiyi.com/v_19rr9ftc88.html#第9集$http://www.iqiyi.com/v_19rr9ft0gk.html#第10集$http://www.iqiyi.com/v_19rr9fzczg.html#第11集$http://www.iqiyi.com/v_19rr9fz6kw.html#第12集$http://www.iqiyi.com/v_19rr9fyzzk.html','','','','');
