INSERT INTO `mac_vod` VALUES('4699','亲向前冲','共15集全','qinxiangqianchong','Q','','/npimg.php?pic=http://pic6.qiyipic.com/image/20161102/50/fe/a_100034668_m_601_m2_180_236.jpg','/npimg.php?pic=http://pic6.qiyipic.com/image/20161102/50/fe/a_100034668_m_601_m2_180_236.jpg','','姚星竹,魏大勋,任雨导演：钱玮炜','钱玮炜','','共15集全','大陆','','0','12','',',70,','0','0','0','0','0','0','0','0','478901','0','0','0','0','0','0','5.0','0','324','1480320447','1482379416','0','0','照相馆馆主张千里身患绝症后，寄出三封信，告诉三位儿女，拥有百年历史的照相馆里藏着一笔遗产。带着各种目的回到照相馆的三姐弟虽然没能找到遗产，但是他们在照相馆找到了童年的回忆和家庭的温馨，让游走他乡的他们百感交集，最终三姐弟决定继承父业，支撑起这个濒临到底的照相馆。在展望美好未来的同时，他们还将遇见怎样...','qiyi','','','第1集$http://www.iqiyi.com/v_19rr98z0mo.html#第2集$http://www.iqiyi.com/v_19rr98z4ss.html#第3集$http://www.iqiyi.com/v_19rr98z3j4.html#第4集$http://www.iqiyi.com/v_19rr98zacs.html#第5集$http://www.iqiyi.com/v_19rr98zrrs.html#第6集$http://www.iqiyi.com/v_19rr993ats.html#第7集$http://www.iqiyi.com/v_19rr995kk4.html#第8集$http://www.iqiyi.com/v_19rr986ie4.html#第9集$http://www.iqiyi.com/v_19rr97ypgw.html#第10集$http://www.iqiyi.com/v_19rr97ylx0.html#第11集$http://www.iqiyi.com/v_19rr98495o.html#第12集$http://www.iqiyi.com/v_19rr986n9k.html#第13集$http://www.iqiyi.com/v_19rr986ndw.html#第14集$http://www.iqiyi.com/v_19rr9859jc.html#第15集$http://www.iqiyi.com/v_19rr988494.html','','','','');
INSERT INTO `mac_vod` VALUES('4700','寒山令','共40集全','hanshanling','H','','/npimg.php?pic=http://pic0.qiyipic.com/image/20161020/8d/49/a_100034831_m_601_180_236.jpg','/npimg.php?pic=http://pic0.qiyipic.com/image/20161020/8d/49/a_100034831_m_601_180_236.jpg','','李健,乔乔,许亚军,宋运成,蒋君,张鹰,林栋甫,钱漪,周明汕,康磊','谷诗阳','','共40集全','大陆','国语','0','12','',',27,','0','0','0','0','0','0','0','0','274604','0','0','0','0','0','0','10.0','0','43','1480320447','1482379421','0','0','1938年，南京沦陷，日军驻苏州司令官松井觊觎寒山寺镇寺之宝“枫桥夜泊”诗碑，欲将其掠回日本献与天皇。从南京保卫战死里逃生的上等兵俞显扬，为报灭门深仇，一路追凶来到苏州。俞显扬凭借过人胆气和出众枪法，接二连三狙杀日寇，打破了松井的如意算盘。然而，在松井的一再胁迫下，“枫桥夜泊”诗碑还是落在了日寇手中。为...','qiyi$$$letv$$$sohu$$$youku$$$qq','$$$$$$$$$$$$','$$$$$$$$$$$$','第1集$http://www.iqiyi.com/v_19rr99rlz0.html#第2集$http://www.iqiyi.com/v_19rr99rnr4.html#第3集$http://www.iqiyi.com/v_19rr98rgm8.html#第4集$http://www.iqiyi.com/v_19rr98rjao.html#第5集$http://www.iqiyi.com/v_19rr9904xw.html#第6集$http://www.iqiyi.com/v_19rr9903yo.html#第7集$http://www.iqiyi.com/v_19rr9905ys.html#第8集$http://www.iqiyi.com/v_19rr9905k0.html#第9集$http://www.iqiyi.com/v_19rr981fb0.html#第10集$http://www.iqiyi.com/v_19rr981ej8.html#第11集$http://www.iqiyi.com/v_19rr97kodk.html#第12集$http://www.iqiyi.com/v_19rr97kefg.html#第13集$http://www.iqiyi.com/v_19rr97xy8k.html#第14集$http://www.iqiyi.com/v_19rr97y34g.html#第15集$http://www.iqiyi.com/v_19rr97xtj0.html#第16集$http://www.iqiyi.com/v_19rr97xu54.html#第17集$http://www.iqiyi.com/v_19rr97xmqw.html#第18集$http://www.iqiyi.com/v_19rr97w1uo.html#第19集$http://www.iqiyi.com/v_19rr96c3ic.html#第20集$http://www.iqiyi.com/v_19rr96c52o.html#第21集$http://www.iqiyi.com/v_19rr96m25s.html#第22集$http://www.iqiyi.com/v_19rr96kbjw.html#第23集$http://www.iqiyi.com/v_19rr95pozc.html#第24集$http://www.iqiyi.com/v_19rr95pris.html#第25集$http://www.iqiyi.com/v_19rr9etyfc.html#第26集$http://www.iqiyi.com/v_19rr9etowc.html#第27集$http://www.iqiyi.com/v_19rr9fabss.html#第28集$http://www.iqiyi.com/v_19rr9fa1wk.html#第29集$http://www.iqiyi.com/v_19rr9fa4z4.html#第30集$http://www.iqiyi.com/v_19rr9f9vxg.html#第31集$http:/