INSERT INTO `mac_vod` VALUES('4718','妖出长安','共12集全','yaochuchangan','Y','','/npimg.php?pic=http://pic3.qiyipic.com/image/20161108/a0/90/a_100035563_m_601_m1_180_236.jpg','/npimg.php?pic=http://pic3.qiyipic.com/image/20161108/a0/90/a_100035563_m_601_m1_180_236.jpg','','杨世瀚,文竹,袁琢,尹玲导演：杨东亮','杨东亮','','共12集全','大陆','','0','12','',',22,','0','0','0','0','0','0','0','0','493374','0','0','0','0','0','0','4.0','0','270','1480320452','1482379420','0','0','安史之乱后，长安城社会动乱，人心浮动，离奇连环杀人案爆发。 刀插两肋的回纥鹰卫、惨被割舌的学堂夫子、烧成焦炭的青楼女妓、剜掉双眼的骡马富商……每宗命案的间隔都是七天，每个死者都是心口先被放血，血流尽而死。更瘆人的是，每一个新的凶案发生时，总会有人看到上一个凶案的死者出现在凶案现场。“厉鬼索命”的传说...','qiyi','','','第1集$http://www.iqiyi.com/v_19rr9d5cjw.html#第2集$http://www.iqiyi.com/v_19rr9d4x6c.html#第3集$http://www.iqiyi.com/v_19rr9d4snk.html#第4集$http://www.iqiyi.com/v_19rr9d4eeg.html#第5集$http://www.iqiyi.com/v_19rr9d80kk.html#第6集$http://www.iqiyi.com/v_19rr9d9aco.html#第7集$http://www.iqiyi.com/v_19rr9d8mb8.html#第8集$http://www.iqiyi.com/v_19rr9d8ptw.html#第9集$http://www.iqiyi.com/v_19rr9d73s4.html#第10集$http://www.iqiyi.com/v_19rr9d73ko.html#第11集$http://www.iqiyi.com/v_19rr9d7440.html#第12集$http://www.iqiyi.com/v_19rr9d6x8w.html','','','','');
INSERT INTO `mac_vod` VALUES('4719','深爱食堂第2季','共13集全','shenaishitangdi2ji','S','','/npimg.php?pic=http://pic1.qiyipic.com/image/20161118/4f/0e/a_100036830_m_601_m1_180_236.jpg','/npimg.php?pic=http://pic1.qiyipic.com/image/20161118/4f/0e/a_100036830_m_601_m1_180_236.jpg','','保剑锋,伊一,潘辰,孙伟豪','杨永春','','共13集全','大陆','国语','0','12','',',71,','0','0','0','0','0','0','0','0','553757','0','0','0','0','0','0','3.0','0','384','1480320453','1482379431','0','0','主要以几个小故事串接而成，这些故事均是发生在一家有特色的“深爱食堂”中，剧情通过美食而发展，这里就像是每一个孤独灵魂的家，来往顾客纷纷讲述着自己的情感纠葛，以最真诚、质朴的交流互动向观众展现都市年轻人积极向上、励志奋斗的感人经历。','qiyi','','','第1集$http://www.iqiyi.com/v_19rra3a4jg.html#第2集$http://www.iqiyi.com/v_19rra3dozc.html#第3集$http://www.iqiyi.com/v_19rra3d6dw.html#第4集$http://www.iqiyi.com/v_19rra3btw8.html#第5集$http://www.iqiyi.com/v_19rra1op98.html#第6集$http://www.iqiyi.com/v_19rra1or98.html#第7集$http://www.iqiyi.com/v_19rra1py74.html#第8集$http://www.iqiyi.com/v_19rra1po90.html#第9集$http://www.iqiyi.com/v_19rra91dy8.html#第10集$http://www.iqiyi.com/v_19rra914r8.html#第11集$http://www.iqiyi.com/v_19rra91714.html#第12集$http://www.iqiyi.com/v_19rra90x0k.html#第13集$http://www.iqiyi.com/v_19rra910xo.html','','','','');
