INSERT INTO `mac_vod` VALUES('4725','女人的武器','共14集全','nvrendewuqi','N','','/npimg.php?pic=http://pic4.qiyipic.com/image/20161124/93/a4/a_100035818_m_601_m4_180_236.jpg','/npimg.php?pic=http://pic4.qiyipic.com/image/20161124/93/a4/a_100035818_m_601_m4_180_236.jpg','','罗嘉良,韩雪,胡兵,王希维,宋佳,姚懿纯,郭金','刘二威','','共14集全','大陆','国语','0','12','',',15,','0','0','0','0','0','0','0','0','487134','0','0','0','0','0','0','8.0','0','295','1480320455','1482379432','0','0','《女人的武器》讲述了职场女性遭受性骚扰后勇敢维权的故事。林九妮和夏安琪是从小到大的好友、大学同窗。她们毕业后同时进入一家大型外企乐易网工作，并受到位高权重的副总裁杨欣君的赏识。杨欣君觊觎杨九妮的青春美貌，企图利用手中职权：加薪、升职等好处来收买她。老实本分的林九妮断然拒绝，而心思复杂的夏安琪选择了投...','qiyi','','','第1集$http://www.iqiyi.com/v_19rr9b6mt8.html#第2集$http://www.iqiyi.com/v_19rr9bih3c.html#第3集$http://www.iqiyi.com/v_19rr9bh3yo.html#第4集$http://www.iqiyi.com/v_19rr9bnvk8.html#第5集$http://www.iqiyi.com/v_19rr9bowjs.html#第6集$http://www.iqiyi.com/v_19rr9aii08.html#第7集$http://www.iqiyi.com/v_19rr9amk4c.html#第8集$http://www.iqiyi.com/v_19rr9aicy0.html#第9集$http://www.iqiyi.com/v_19rra3u7tw.html#第10集$http://www.iqiyi.com/v_19rr9atu2c.html#第11集$http://www.iqiyi.com/v_19rr9arzas.html#第12集$http://www.iqiyi.com/v_19rr9asof8.html#第13集$http://www.iqiyi.com/v_19rra3x5uo.html#第14集$http://www.iqiyi.com/v_19rr9ar8f4.html','','','','');
