INSERT INTO `mac_vod` VALUES('12978','死亡风暴','','siwangfengbao','S','','http://i0.letvimg.com/lc03_isvrs/201503/19/15/41/15a7e536-7357-4731-8c30-da5f9a207c12.jpg','[db:缩略图]','[db:幻灯图]','//','','[db:tag]','乐视高清','德国','','0','19','',',159,','0','0','0','0','0','0','0','0','813873','0','0','0','0','0','0','2.0','0','179','1480845859','1482348975','0','0','1918年，两千万人死于流感，在德国一个城市考洛格尼发现了与其相似的病毒，两种病毒有无关系？免疫学家们夜以继日的工作，研制出疫菌病毒，桑亚克斯洛面临一系列严峻的问题。她的丈夫克斯洛突然神秘地“自杀”身亡。而ASL病毒研究所里的同事在他死后竟然指控他放出病毒，桑亚克斯洛不相信丈夫如此不负责任，开始寻找线索，并与跟她疏远的儿子简一同调查此事。简开始怀疑父亲的真诚。由于看到桑亚克斯洛对父亲清白确信无...','letv','','','高清完整版$http://www.le.com/ptv/vplay/1403428.html','','','','');
