INSERT INTO `mac_vod` VALUES('12977','卡廷惨案','','katingcanan','K','','http://i0.letvimg.com/lc07_isvrs/201608/15/15/11/5a75748c-fa6d-48c5-8a90-baa2b995d603.jpg','[db:缩略图]','[db:幻灯图]','玛雅·奥丝塔泽斯卡/亚特·祖米卓斯基/帕威·马拉欣斯基/','安杰依·瓦伊达/','[db:tag]','乐视高清','欧美地区','','0','19','',',159,','0','0','0','0','0','0','0','0','377865','0','0','0','0','0','0','6.0','0','309','1480845858','1482348972','0','0','1939年9月1日，纳粹德国向波兰发动闪电战，抢占波兰西部地区。16天后，苏俄由东部进入波兰，并俘虏了约25万波兰军人，将他们分别关押。1943年，入侵苏联境内的德国宣布，在苏联斯摩棱斯克市附近的卡廷森林发现埋葬波兰军人尸骨的万人坑，而苏俄正是残忍杀害这些军人的真正凶手…… 　　影片根据真实事件改编，波兰导演安杰依•瓦伊达最终将这个波兰国内长久以来的禁忌话题搬上银幕。本片荣获2008丹佛国际电影节人民选择奖、卢布尔雅那国际电影节观众大奖以及波兰电影节最佳剧本、最佳男配角、最佳电影、最佳配乐、最佳音效等7项大奖。','letv$$$qq','$$$','$$$','高清完整版$http://www.le.com/ptv/vplay/26432196.html$$$腾讯高清$http://v.qq.com/x/cover/syunshf3ptesmsu/a0021va792f.html','','','','');
