INSERT INTO `mac_vod` VALUES('10046','生化英雄&middot;夺魂','01:05:37','shenghuayingxiongmiddotduohun','S','','/npimg.php?pic=http://pic4.qiyipic.com/image/20161130/78/5e/v_111373131_m_601_m2_180_236.jpg','/npimg.php?pic=http://pic4.qiyipic.com/image/20161130/78/5e/v_111373131_m_601_m2_180_236.jpg','','武琳（女）,沈文俊,林琪,狄全泰','张帆（导演）','','奇艺高清','大陆','国语','2016','8','',',78,','0','0','0','0','0','0','0','0','746478','0','0','0','0','0','0','8.0','0','334','1480604578','1482345978','0','0','钟逸经历了十年牢狱终于出狱，他要找昔日的生化药物研究搭档、曾经的好兄弟陆冰讨回这十年怨债。他找到陆冰的秘密试验场，发现陆冰的试验已经可以使活体生命变异，基因强者变成高智商、强体能的冷血行尸，基因弱者则变成嗜血丧尸。为了阻止陆冰的研究，避免这场灾难，钟逸与变异守卫殊死搏斗，步步逼近试验场核心。突然十年前已经死去的钟逸的恋人——高雅现身，牵出三人之间的血火恩仇。恋人出现让钟逸百感交集，又令他困惑，她在钟逸和陆冰之间摇摆不定，背后似乎还有一个更大的迷局。昔日恋人、兄弟，眼前的殊死对手，钟逸要在重重迷惑中辩清敌友，而试药者随时发生的变异，在情感与理性、利益与责任之间，他必须做出决断……','qiyi','','','高清$http://www.iqiyi.com/v_19rra1wiro.html','','','','');
