INSERT INTO `mac_vod` VALUES('4838','妖出长安','共12集全','yaochuchangan','Y','','/npimg.php?pic=http://pic3.qiyipic.com/image/20161108/a0/90/a_100035563_m_601_m1_180_236.jpg','/npimg.php?pic=http://pic3.qiyipic.com/image/20161108/a0/90/a_100035563_m_601_m1_180_236.jpg','','杨世瀚,文竹,袁琢,尹玲导演：杨东亮','杨东亮','','共12集全','大陆','','2016','12','',',22,','0','0','0','0','0','0','0','0','37046','0','0','0','0','0','0','3.0','0','87','1480321367','1480680563','0','0','安史之乱后，长安城社会动乱，人心浮动，离奇连环杀人案爆发。 刀插两肋的回纥鹰卫、惨被割舌的学堂夫子、烧成焦炭的青楼女妓、剜掉双眼的骡马富商……每宗命案的间隔都是七天，每个死者都是心口先被放血，血流尽而死。更瘆人的是，每一个新的凶案发生时，总会有人看到上一个凶案的死者出现在凶案现场。“厉鬼索命”的传说...','qiyi','','','第1集$http://www.iqiyi.com/v_19rr9d5cjw.html#第2集$http://www.iqiyi.com/v_19rr9d4x6c.html#第3集$http://www.iqiyi.com/v_19rr9d4snk.html#第4集$http://www.iqiyi.com/v_19rr9d4eeg.html#第5集$http://www.iqiyi.com/v_19rr9d80kk.html#第6集$http://www.iqiyi.com/v_19rr9d9aco.html#第7集$http://www.iqiyi.com/v_19rr9d8mb8.html#第8集$http://www.iqiyi.com/v_19rr9d8ptw.html#第9集$http://www.iqiyi.com/v_19rr9d73s4.html#第10集$http://www.iqiyi.com/v_19rr9d73ko.html#第11集$http://www.iqiyi.com/v_19rr9d7440.html#第12集$http://www.iqiyi.com/v_19rr9d6x8w.html','','','','');
