INSERT INTO `mac_vod` VALUES('16137','怕见眼泪','','pajianyanlei','P','','http://i0.letvimg.com/lc03_isvrs/201503/20/11/54/6b7d7358-9c05-418f-908a-f35e8b973c1b.jpg','[db:缩略图]','[db:幻灯图]','金芝昊/金太宇/韩载锡/金正恩/韩在石/','金士玄/','[db:tag]','正片','韩国','','0','14','',',183,','0','0','0','0','0','0','0','0','755539','0','0','0','0','0','0','4.0','0','391','1481655696','1482347469','0','0','女主角金盈恩来到这个世界，成了不受欢迎的人。父亲因为她的出生而抛弃了母亲，她也因此受到母亲的冷落。幸好老天爷赐予她天生乐观的性格，她总是以微笑来对待伤害她的人，不管遇到再大的困难也顽强地坚持着，岁月就这样流逝，她渐渐理解母亲的苦衷。','letv','','','http://www.letv.com/ptv/vplay/1198936.html#http://www.letv.com/ptv/vplay/1198838.html#http://www.letv.com/ptv/vplay/1198839.html#http://www.letv.com/ptv/vplay/1198851.html#http://www.letv.com/ptv/vplay/1198885.html#http://www.letv.com/ptv/vplay/1198893.html#http://www.letv.com/ptv/vplay/1198900.html#http://www.letv.com/ptv/vplay/1198902.html#http://www.letv.com/ptv/vplay/1198904.html#http://www.letv.com/ptv/vplay/1198924.html#http://www.letv.com/ptv/vplay/1198925.html#http://www.letv.com/ptv/vplay/1198928.html#http://www.letv.com/ptv/vplay/1198931.html#http://www.letv.com/ptv/vplay/1198933.html#http://www.letv.com/ptv/vplay/1198935.html#http://www.letv.com/ptv/vplay/1198929.html','','','','');
