INSERT INTO `mac_vod` VALUES('4870','民兵葛二蛋','共33集全','minbinggeerdan','M','','/npimg.php?pic=http://pic4.qiyipic.com/image/20151228/9d/72/a_50276422_m_601_m1_180_236.jpg','/npimg.php?pic=http://pic4.qiyipic.com/image/20151228/9d/72/a_50276422_m_601_m1_180_236.jpg','','黄渤,高虎,童瑶,阎娜,方慧,尚铁龙,曾肖龙,周建鹏,袁满,李梦男,浅野长英,王一鸣,王晴,汤晶媚,刘仪伟,康福震,韩童生,王迅导演：林柯,韦大军','林柯','','共33集全','大陆','','2016','12','',',21,','0','0','0','0','0','0','0','0','460702','0','0','0','0','0','0','1.0','0','96','1480322342','1481639284','0','0','1943—1945年，在小街镇和塔湾村城乡，葛二蛋和麦子，一个性格直爽，侠肝义胆、敢作敢为；另一个精于算计，极端利己、不择手段。他们曾是患难兄弟，也曾同仇敌忾，他们转战于相同的战场而遭遇了不同的命运。葛二蛋和麦子进城找鬼子报仇未果，葛二蛋来到塔湾村，受到八路军的启蒙，将自己的家仇转变为国恨，从农民成长为优秀...','qiyi','','','第1集$http://www.iqiyi.com/dianshiju/20121212/4900c064dfee98d4.html#第2集$http://www.iqiyi.com/dianshiju/20121212/94e65a590fc5801a.html#第3集$http://www.iqiyi.com/dianshiju/20121213/5602dff553ac770d.html#第4集$http://www.iqiyi.com/dianshiju/20121213/e15986317ebc28e1.html#第5集$http://www.iqiyi.com/dianshiju/20121214/fd646c18e3c49b72.html#第6集$http://www.iqiyi.com/dianshiju/20121214/f7c2b6b48e6765ae.html#第7集$http://www.iqiyi.com/dianshiju/20121215/aa57fbbe720368c5.html#第8集$http://www.iqiyi.com/dianshiju/20121215/4b0f17e5c6b7e109.html#第9集$http://www.iqiyi.com/dianshiju/20121216/677b7640d0c7d096.html#第10集$http://www.iqiyi.com/dianshiju/20121216/d09c12e5fed02103.html#第11集$http://www.iqiyi.com/dianshiju/20121217/48e90c4c777aa3dc.html#第12集$http://www.iqiyi.com/dianshiju/20121217/3876182f8dbea31d.html#第13集$http://www.iqiyi.com/dianshiju/20121218/be79602b37c428ae.html#第14集$http://www.iqiyi.com/dianshiju/20121218/9bf38da92739c1dc.html#第15集$http://www.iqiyi.com/dianshiju/20121219/fcfccf8379d384db.html#第16集$http://www.iqiyi.com/dianshiju/20121219/b96475a23d7117fc.html#第17集$http://www.iqiyi.com/dianshiju/20121220/dc6261f266194b1f.html#第18集$http://www.iqiyi.com/dianshiju/20121220/236c270d9e38830a.html#第19集$http://www.iqiyi.com/dianshiju/20121221/ac14966af5b43657.html#第20集$http://www.iqiyi.com/dianshiju/20121221/ec725aaa16e40e