INSERT INTO `mac_vod` VALUES('4876','天天有喜','共91集全','tiantianyouxi','T','','/npimg.php?pic=http://pic6.qiyipic.com/image/20150305/01/97/83/a_50494534_m_601_m3_180_236.jpg','/npimg.php?pic=http://pic6.qiyipic.com/image/20150305/01/97/83/a_50494534_m_601_m3_180_236.jpg','','陈浩民,穆婷婷,谭耀文,陈紫函,刘娜萍,陆昱霖,方数真,邓捷,陈秀丽,宫媛,陈威翰导演：黄建勋,苏沅峰','黄建勋','','共91集全','大陆','','2016','12','',',22,','0','0','0','0','0','0','0','0','254904','0','0','0','0','0','0','6.0','0','181','1480322344','1480389986','0','0','以神话故事“刘海砍樵”为题材的暑期减压神话大剧，“最帅济公”陈浩民变身“穷屌丝”樵夫刘枫，再展搞笑功力，凭借专情幽默成功打动狐狸小九妹。诙谐人妖恋看你能否Hold住！狐狸小九妹在与金蟾大王的打斗中负伤逃下凤凰山，被樵夫刘枫救助。伤愈后的小九妹念念不忘刘枫的恩情，时常下山帮助刘枫，为刘枫对母亲的孝心感动。...','qiyi','','','第1集$http://www.iqiyi.com/dianshiju/20130630/b8b59d58af1eec74.html#第2集$http://www.iqiyi.com/dianshiju/20130630/dd49616ce694f567.html#第3集$http://www.iqiyi.com/dianshiju/20130630/68222941255f5eef.html#第4集$http://www.iqiyi.com/dianshiju/20130702/44fb1ab02a69fc1d.html#第5集$http://www.iqiyi.com/dianshiju/20130702/0cfadb5545b10711.html#第6集$http://www.iqiyi.com/dianshiju/20130702/f8517eff1858002b.html#第7集$http://www.iqiyi.com/dianshiju/20130702/56781e64fe5b8e3d.html#第8集$http://www.iqiyi.com/dianshiju/20130702/77466af547528eb8.html#第9集$http://www.iqiyi.com/dianshiju/20130702/95e7ea66e0c28522.html#第10集$http://www.iqiyi.com/dianshiju/20130704/19c09398f8f5bb79.html#第11集$http://www.iqiyi.com/dianshiju/20130704/14fe8c58e6986f78.html#第12集$http://www.iqiyi.com/dianshiju/20130704/1a7d4b6be08642a9.html#第13集$http://www.iqiyi.com/dianshiju/20130705/aa36b8c51d2c4db8.html#第14集$http://www.iqiyi.com/dianshiju/20130705/0d709d6e1e7eff98.html#第15集$http://www.iqiyi.com/dianshiju/20130705/f065389ef991f1f4.html#第16集$http://www.iqiyi.com/dianshiju/20130705/bf13a4f58e909333.html#第17集$http://www.iqiyi.com/dianshiju/20130706/fa83da027efaa185.html#第18集$http://www.iqiyi.com/dianshiju/20130707/45c9c61504869bff.html#第19集$http://www.iqiyi.com/dianshiju/20130707/c4f7e36131ffd63c.html#第20集$http://www.iqiyi.com/dianshiju/20130707/fac6941b9b2575fb.html#第21集$http: